CREATE TABLE `vaccination` (
  `vaccination_date` date NOT NULL,
  `patient_SSN` int NOT NULL,
  `nurse_EmployeeID` int NOT NULL,
  `physician_EmployeeID` int NOT NULL,
  `symptoms` varchar(900) DEFAULT NULL,
  `vaccines_vax_name` varchar(50) NOT NULL,
  PRIMARY KEY (`vaccination_date`,`patient_SSN`,`nurse_EmployeeID`,`physician_EmployeeID`,`vaccines_vax_name`),
  KEY `fk_vaccination_patient1_idx` (`patient_SSN`),
  KEY `fk_vaccination_nurse1_idx` (`nurse_EmployeeID`),
  KEY `fk_vaccination_physician1_idx` (`physician_EmployeeID`),
  KEY `fk_vaccination_vaccines1_idx` (`vaccines_vax_name`),
  CONSTRAINT `fk_vaccination_nurse1` FOREIGN KEY (`nurse_EmployeeID`) REFERENCES `nurse` (`EmployeeID`),
  CONSTRAINT `fk_vaccination_patient1` FOREIGN KEY (`patient_SSN`) REFERENCES `patient` (`SSN`),
  CONSTRAINT `fk_vaccination_physician1` FOREIGN KEY (`physician_EmployeeID`) REFERENCES `physician` (`EmployeeID`),
  CONSTRAINT `fk_vaccination_vaccines1` FOREIGN KEY (`vaccines_vax_name`) REFERENCES `vaccines` (`vax_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
