INSERT INTO `vaccination` VALUES ('2020-01-01',514924,1821299140,1891804746,'Tinnitus in left ear','Covishield'),('2020-01-01',51607741,1013362193,1144226366,'Headache, Arthralgia, Fever, R arm soreness, chills Narrative:','Covishield'),('2020-01-01',52793649,1356301378,1518903608,'delirium; Fever of 100.8; chills; flushed; overall soreness; deltoid pain; This is a spontaneous report from a non-contactable consumer. A 50-year-old male patient received BNT162B2 (lot# unknown) on 03Feb2021 01:30 PM at single dose for covid-19 immunization. Medical history and concomitant drug were not reported. Patient experienced Fever of 100.8, chills, flushed, overall soreness, delirium, and deltoid pain on 04Feb2021 04:00 AM with outcome was Recovering. No covid prior vaccination. No covid tested post vaccination.  No follow-up attempts are possible; information about lot/batch number cannot be obtained.','ASTRAZENECA'),('2020-01-02',34464717,1306283189,1376505917,'Swelling at the site, Day one was about size of a 50 cent piece Day two- size of a baseball and was very itchy Day Three- size of a Softball and is very itchy  and more than fills the palm of your hand','CoronaVac'),('2020-01-03',328333,1245483015,1003264318,'fever chills/rigors  body aches within 12 of getting  vaccine','PFIZER'),('2020-01-03',50332216,1043260268,1417194366,'Injection site very sore continues  ; injection site swollen continues; extreme muscle ache throughout body; sore throat the morning after injection; temperature 101 first day after; second day 99 (normal 98.4); third day 98.9.','Sputnik'),('2020-01-03',51658025,1447228127,1396198289,'Within the first hour my left arm was already feeling sore. Within 6 hours I began not feeling good, I felt hot, nauseous, coworkers reported me looking pale. swarmed with nurses giving me water, cold/wet towel, and temperature taken= afebrile. I was able to finish my shift. My body was aching and I felt as if I was coming down with something that night. By the next morning  I felt nauseous, body aches, muscle tightness, chills, low grade fever, and fatigued. I took 1- 500mg  acetaminophen and 400mg ibuprofen x 2 that day. My fever broke around 6pm on 01/02/2021. I had a good night sleep and felt fine the next day. I did have Covid over 5 months prior.','PFIZER'),('2020-01-03',51792335,1598298556,1164612206,'Agitation, Palpitations, HYPERtension, Tachycardia,  Anxiety, clammy skin, nervousness  Narrative:  Employee with history of severe anxiety, panic attacks. States this is same symptoms as panic attack.','BBIBP-CorV'),('2020-01-04',52657863,1154417699,1760458699,'Received at 9am.  Continued arm pain so at 10pm I took Tylenol. Then by 11pm I had shakes, fever 100.4 after Tylenol, weakness all over, massive headache, dizzy, and nausea.  I tried to tolerate and wait it out by 11am 1:6/2021 I felt some what better. Fever gone. Headache continues.','MODERNA'),('2020-01-05',15311198,1811966302,1003809658,'Patient became lightheaded, flushed, tachycardic, and developed hives.  Patient was administered 25mg of diphenhydramine orally and observed.  Patient quickly began feeling better, hives disappeared.  The patient left with 2 other coworkers.','PFIZER'),('2020-01-05',40374387,1073686101,1417288895,'Pt suffered Cardiac Arrest and respiratory arrest on 2/9/21 and passed away at a local hospital. He had multiple health conditions likely contributing to this.  he arrested at home and CPR was attempted and unsuccessful. Pt received his Covid vaccine #1 on 1/27/21. No issues were noted after vaccine and was due for his 2nd dose next week. However, we were notified he passed away on 2/9/21.  Very likely death not at all related to vaccine but wanted to document as patient was in the middle of the covid vaccine series.','Sputnik'),('2020-01-05',65216505,1003031642,1073931747,'Approx 30 minutes after vaccination, started feeling stomach upset, cramping. Approx 1.5 hours after vaccination, started feeling joint pain. Continued to work until the end of shift 1930. took Benadryl at 32130. Fell asleep; awoke next morning with aches; nasal congestion. Took Sudafed & came to work again (12/18/2020, 0700). Face started itching; then arms @t 0800 but continued working and finished shift. took Benadryl to relieve itching. Awoke early in morning to severe itching. Increased dose of Benadryl and fell asleep. Continued itching on Sat 12/19/2020 and having difficulty breathing. Used inhaler, Pepcid and Prednisone with good effect. Took off work Monday 12/21/2000,  Tues 12/22/2020 and Wed 12/23/2020 (no meds taken). Returned to work on 12/24/2020, no fever, no exposure','Covaxin'),('2020-01-06',52910197,1073686101,1851322754,'Altered mental status, fever 102.7. Left sided weakness report.  I did not see this on my h and p','PFIZER'),('2020-01-07',64603028,1780612150,1740331867,'EE reported muscle aches that started on 01/6/2020 at 9: 00 AM.  Muscles aches completely resolved  without the use of medication. She reports feeling fine no other complaints.','MODERNA'),('2020-01-08',34406833,1922546464,1003855149,'approx. 10 min after infection my heart started pounding in my chest, felt dizzy and weak. Was monitor for 45 min, blood pressure was  stable , heart rate 120s. Was taken to ER, took 2 person assist to transfer to cart because I felt very weak, like I was going to pass out. In ER was given liter of fluid, Benadryl 25mg ivp. After about 45 min my symptoms started improving. By 90 mins later I was able to walk out of the ER','Covishield'),('2020-01-09',47238229,1497782122,1245389709,'Pt presented back to clinic on 1/7/21 and shared adverse event of numbness/tingling on right side of face and right leg (same side as vaccine was given).  She was treated by PCP for potential bells palsy.','CoronaVac'),('2020-01-10',3718754,1073945705,1700015716,'9 days after getting first dose of covid vaccine I woke up with my arm having a big red circle where the injection has been administered on 12/28/2020.  The sight felt a little warm . Didn\'t hurt.','Sputnik'),('2020-01-12',40301415,1083013148,1669481404,'Swelling at site, Red and hot to touch, Pain, Lumped up, Was told to go in to be seen. Place on antibiotic, Went in on 1/2/2021. Swelling not so much now, still red and hot to touch, redness has expanded.','Covishield'),('2020-01-14',50470714,1679025639,1255349452,'Arm got red, itchy, sensitive and sore, slightly discolored. Lasted about 3-4 days and has since resolved','MODERNA'),('2020-01-15',36346433,1710963483,1972611531,'Red inflamed rash at site of injection','MODERNA'),('2020-01-15',50819381,1073521316,1003829268,'Arm started swelling within five minutes. Arm was turning red, itchy and burned. Neck and chest started turning red, itchy and burning, then spread up left side of face. Started coughing, throat itched, was really dizzy. Nurse sat next to me with an Epi-Pen for a few hours.','CoronaVac'),('2020-01-15',54165661,1104020759,1902219850,'Hours after the vaccine developed cough, tiredness, neck aches, chills, headache, orbital pain, nausea. By that evening had fever 100.6 in addition to other symptoms. Next morning same symptoms. That afternoon, extreme tiredness along with prior symptoms. That evening fever 102.8. Next morning, exteremely dizzy, head foggy, orbital pain, minor cough. By Thursday no better so got covid test.','BBIBP-CorV'),('2020-01-16',25016419,1023374279,1104826122,'Yesterday was day 8 and i woke up with my arm hot, itchy, red and had a welt about 2 inches round. its gotten slightly bigger today.','ASTRAZENECA'),('2020-01-17',40417137,1104847219,1366435851,'Heart Palpitations, Heightened anxiety , Sleeplessness for almost 12hours  Heart Racing. Heavy beating.  Chills, Fever,  Lethargy.','Sputnik'),('2020-01-17',47630274,1265760599,1659777977,'UrticariaPruritus sweating, fatique, lymph node swelling Narrative:','CoronaVac'),('2020-01-19',22248801,1760730154,1740368448,'Patient called,  stating  swelling of arm and lymph nodes within 24 hrs of injection and lump at site.  Applied ice and heat. States it is getting better but if ball does not get any better would like to be seen.  Agreed with aptient','Sputnik'),('2020-01-20',24292094,1861411613,1609072123,'Headache, Myalgia, pain at injection site Narrative:','Covishield'),('2020-01-20',26060910,1275505083,1215929633,'Nausea, Confusion, fever, weakness, SOB, pain','Covaxin'),('2020-01-20',35214736,1417955220,1447219845,'severe cough, phlegm,  severe asthma flare up, headaches','PFIZER'),('2020-01-21',29396976,1447228127,1326160789,'Patient sudden death reported by family.  No further details available at this time.','ASTRAZENECA'),('2020-01-22',22102658,1518339605,1508127895,'Tenant developed nausea/vomiting in the middle of the night after vaccination. The next day she continued with GI upset, fever, and body aches. Toward the afternoon with Tylenol she appeared to be feeling better. At around 6pm she had sudden onset shortness of breath and respiratory distress. Nebulizer was given without improvement, O2 sats were in the 70\'s and 80\'s. Tenant was transported to the hospital via ambulance','ASTRAZENECA'),('2020-01-22',53980370,1306297858,1750340048,'Unbalanced, confusion, vomiting, memory loss, & nausea.','CoronaVac'),('2020-01-24',13822320,1538251970,1639126634,'Pt developed Left eye twitching on 12/20/20 which continues to 1/4/21','Covaxin'),('2020-01-26',44868170,1215282132,1578855987,'After receiving the vaccine in the morning, patient developed eye swelling later on that evening, for which he took diphenhydramine 50 mg orally once. He felt better the next day, however the swelling came back the following day (12/24) in addition to eye itchiness. He was prescribed prednisone 60 mg orally daily for 5 days and diphenhydramine 50 mg q6h.','CoronaVac'),('2020-01-26',57623802,1417484817,1518903608,'dizziness, fatigue, arm soreness, myalgia','Covaxin'),('2020-01-28',818858,1184826786,1841348828,'Rapid heart rate ten minutes after administration, anxiety attack and a hot face. Lasted 25 minutes in total.','CoronaVac'),('2020-01-29',75012407,1225550023,1922075480,'Hospitalized February 28, 2021 with acute cerebrovascular accident with left hemiparesis, 4 days after vaccine','CoronaVac'),('2020-01-30',3534192,1467855676,1043289887,'PATEINT FELT FINE ON THE HOME FROM PHARMACY, STARTED FILLING ILL (NOT QUITE HERSELF) BEFORE BED. SHE AWAKENED AT 5:45 AM. FELT AS IF SHE WAS GOING TO FAINT. SAT DOWN AND PASSED OUT AND HAD A SEIZURE. SLID OUT OF THE CHAIR AND URINATED ON HERSELF AND THE FLOOR. WAS TRANSPORTED BY AMBULANCE TO HOSPITAL.','Sputnik'),('2020-01-31',57788123,1851534606,1992045439,'AFIB diagnosis','Covishield'),('2020-02-01',4330399,1063647766,1164488417,'Side effects included fever and chills about 24 hours after the shot. In general, I felt like you would when an individual is in early flu stages. Fever was 100.2 and chills progressed throughout the night.','BBIBP-CorV'),('2020-02-01',13848287,1790994697,1699820480,'Client received an unknown dosage due to improper vaccine draw. Nurse administered 7 doses in one vial - Janssen vial contains only 5 doses, 6 doses maximum. Other client\'s dosage verified by myself or other nurse leads.','Covishield'),('2020-02-01',39521940,1124227111,1700820818,'Pfizer-BioNTech COVID-19 Vaccine  Hospital Emergency Room Provider reported cause of death as COVID vaccine administered 11 days prior to death.  Additional information being reported from LTCF.','Sputnik'),('2020-02-03',650330,1902816911,1952307829,'12/22/20, 13:36: 6 minutes after receiving the 1st Pfizer vaccine injection, there was stiffness felt behind my ears and in the back of my neck. 10 minutes after the injection, there was a fullness noted along my throat and upper pallet. The symptoms only slightly lessened after 30 minutes. I have a hx of Rheumatoid Arthritis, completing prednisone doses 4 days ago and currently taking Celebrex and IBU daily. The Benadryl liquid dose (25mg) taken at 14:15 completely resolved my reaction symptoms by 15:15.','MODERNA'),('2020-02-03',36403364,1427002039,1881858876,'10 minutes after vaccine was given, patient had onset of throat tightness, difficulty breathing, flushing, and rash.  Patient was immediately treated with 0.3 mg of epinephrine and within approximately 60 seconds began having improvement in her symptoms.  EMS was called and patient was taken to the ER via EMS for ongoing observation.  Patient was feeling improved but not back to baseline prior to leaving the clinic.','PFIZER'),('2020-02-04',14909409,1538694971,1336192095,'Fever, chills, body aches, headache. Lymph node in right armpit swollen to size of a baseball. Have not received treatment.','BBIBP-CorV'),('2020-02-04',40539795,1457783565,1285948265,'Dizziness, NauseaVomiting, Palpitations, Tachycardia, None Narrative:  Employee experienced listed symptoms appox. 1800 on 12/30. Has made it difficult to perform daily routine. All non listed vitals within normal limits.','Sputnik'),('2020-02-05',884734,1972676526,1316989288,'REC\'D CALL FROM PT\'S DAUGHTER, HER FATHER WAS VACCINATED ON 1/22/21, WOKE UP 1/23/21 WAS SHORT OF BREATH AND DIZZY. PT PRESENTED TO ED OF LOCAL HOSPITAL AND WAS ADMITTED, PT PASSED ON 1/25/21. DAUGHTER STATES THAT FAMILY AND DOCTORS AGREE THAT THE VACCINE DID NOT CONTRIBUTE TOWARDS PT\'S DEATH, BUT FELT IT NEEDED TO BE REPORTED.  PT\'S DAUGHTER CONTACTED THIS RN AT LOCAL HEALTH DEPARTMENT TO REPORT TO VAERS.','ASTRAZENECA'),('2020-02-05',52041872,1609216134,1194733006,'3-in circumferral rash around injection site.','Covaxin'),('2020-02-05',69507518,1730401886,1063965390,'Response (1/27) after receiving 2nd dose of Moderna COVID-19 vaccine (~1840), c/o itching, throat swelling, SOB, racing heart & nausea about 50min after vaccination. S/p IM Epi, Benadryl, Pepcid, Solumedrol & Racemic Epi. CCM consulted. Close monitoring in ICU overnight. (1/28) Symptoms resolved, plan to discharge home with Rx for Epi pen.','Covaxin'),('2020-02-06',50503447,1184034027,1679741151,'Headache within hour of receiving vaccine, patient took Tylenol','BBIBP-CorV'),('2020-02-06',60950629,1770957995,1891848669,'Emergency room 1/25/21 HPI patient is a 66 y.o. female who presents with dizziness, nausea, and vomiting.  Patient reports that she began having acute episodic dizziness and vertigo early this morning when she rolled over in bed.  She states the dizziness became so bad it made her nauseous and she began vomiting.  Patient reports she tried to take a Dramamine but was unable to keep it down, and thus it did not help.   Patient denies any ringing in the ears, decreased hearing, or ear pain.  Patient does report she has had episodes of dizziness and vertigo like this in the past.  Patient denies any fevers or chills.  Patient does report mild frontal headache.  Patient denies any chest pain, palpitations, or shortness of breath.  ','ASTRAZENECA'),('2020-02-08',620946,1265827679,1245433804,'DEVELOPED FLAT, RED RASH OVER NECK AND UPPER TORSO. BENADRYL 25MG ADMINISTERED IM AND RASH RESOLVED WITHIN A HALF HOUR','Covaxin'),('2020-02-08',51612998,1386992196,1306295092,'Myalgia tingling and paresthesia of mouth, tongue , scratchy throat, mild cough, metallic taste, myalgia Narrative:  tingling and paresthesia of mouth, tongue , scratchy throat, mild cough, metallic taste, myalgia','Covaxin'),('2020-02-09',51246563,1912216052,1801991666,'The next morning I woke up and thought my mouth hurt then the more I thought about it I realized it didn\'t hurt but it was numb on the left side, like I had Novocain wearing off.   It is getting a little better but is still numb a week later.','MODERNA'),('2020-02-10',20426044,1033174313,1124145214,'Tested positive for COVID; Tested positive for COVID; This is a spontaneous report from a contactable consumer.  A male patient  of unspecified age received BNT162B2 (PFIZER-BIONTECH COVID-19 mRNA VACCINE), via an unspecified route of administration in Dec2020 at single dose for covid-19 immunization.  The patient\'s medical his