094772,1306845128,'dizziness, fatigue, arm soreness, myalgia','Covaxin'),('2020-03-26',58526067,1770632036,1164467379,'Employee stated that she is allergic to multiple medications and was anxious that she may get a reaction to the vaccine. After sitting for about 1/2 hour after receiving the vaccine, she began to c/o of a sharp epigastric pain. Employee stated that she only had a banana to eat for breakfast. She was transferred over to the first responders area, where she was assessed.Her vitals were within normal range.  After few minutes on the stretcher employee stated that  the pain was slowly subsiding, she then opted to leave.','CoronaVac'),('2020-03-26',66209344,1144242694,1831205343,'Patient became ill with pneumonia on 1/29/21 and then recurrent pneumonia on 2/10/21. Pt\'s plan of care was subsequently changed to comfort-focused on 2/11/21 and patient was deceased that same day.','Covishield'),('2020-03-27',44868170,1376910166,1861728677,'After receiving the vaccine in the morning, patient developed eye swelling later on that evening, for which he took diphenhydramine 50 mg orally once. He felt better the next day, however the swelling came back the following day (12/24) in addition to eye itchiness. He was prescribed prednisone 60 mg orally daily for 5 days and diphenhydramine 50 mg q6h.','CoronaVac'),('2020-03-28',4105938,1174526933,1104937622,'Headache, HYPERtension, neck stiffness, left arm weakness, Narrative: individual states having these symptoms all the time, almost resolved when left with husband driving home','Sputnik'),('2020-03-28',44238708,1508271784,1437256518,'Woke up very fatigued 12/25 only minimal activity performed creating additional fatigue.  Was sleeping 12 plus hours a day without feeling rested in the least. No problems with sleep. Also had heaviness of chest - felt like rib cage made of iron- this dissipated by the 28-29th. No excessive cough or fever, did have dyspnea with any exertion and this continues but seems to be lessening. Was not able to work due to fatigue. Yesterday remained tired but felt noticeably different-felt lighter-and today seems promising.','BBIBP-CorV'),('2020-03-29',818858,1841501343,1598792830,'Rapid heart rate ten minutes after administration, anxiety attack and a hot face. Lasted 25 minutes in total.','CoronaVac'),('2020-03-29',66720587,1972917987,1679525828,'AT APPROXIMATELY 8 AM , I BEGAN A SNEEZING FIT OF 12 OR SO CONSECUTIVE FORCEFUL SNEEZES.  IT CONTINUED FOR SEVERAL MINUTES.  I HAVE  NASAL CONGESTION SINCE 8 AM (IT IS NOW 11:15 AM), SNEEZING, AND I AM CONSTANTLY BLOWING MY NOSE. I AM EXPERIENCING SEVERE COLD SYMPTOMS. I HAVE  SORENESS IN THE ARM THE VACCINE WAS GIVEN. OTHERWISE I AM FEELING FINE.','CoronaVac'),('2020-03-29',75012407,1962505123,1568410652,'Hospitalized February 28, 2021 with acute cerebrovascular accident with left hemiparesis, 4 days after vaccine','CoronaVac'),('2020-03-30',3534192,1710412234,1053448589,'PATEINT FELT FINE ON THE HOME FROM PHARMACY, STARTED FILLING ILL (NOT QUITE HERSELF) BEFORE BED. SHE AWAKENED AT 5:45 AM. FELT AS IF SHE WAS GOING TO FAINT. SAT DOWN AND PASSED OUT AND HAD A SEIZURE. SLID OUT OF THE CHAIR AND URINATED ON HERSELF AND THE FLOOR. WAS TRANSPORTED BY AMBULANCE TO HOSPITAL.','Sputnik'),('2020-03-30',13848287,1346617511,1528019338,'Client received an unknown dosage due to improper vaccine draw. Nurse administered 7 doses in one vial - Janssen vial contains only 5 doses, 6 doses maximum. Other client\'s dosage verified by myself or other nurse leads.','Covishield'),('2020-03-30',25011334,1952407728,1598898363,'Pain in the arm a t the injection site, now having shoulder pain. woke up with headache and dizziness.','BBIBP-CorV'),('2020-03-30',39521940,1932150794,1023127636,'Pfizer-BioNTech COVID-19 Vaccine  Hospital Emergency Room Provider reported cause of death as COVID vaccine administered 11 days prior to death.  Additional information being reported from LTCF.','Sputnik'),('2020-03-30',57788123,1558799163,1376505917,'AFIB diagnosis','Covishield'),('2020-03-31',46766597,1669860250,1194767178,'Myalgia Chills and skin hurting Narrative:  Had COVID in Sept. The myalgia,chills,skin hurting were a mild version of what she had during active COVID infection','Covaxin'),('2020-03-31',57953267,1326402546,1851652432,'Cardiac Arrest/Death Date of death 03/03/2021 time 01:54 pm','MODERNA'),('2020-04-01',650330,1194026120,1225059249,'12/22/20, 13:36: 6 minutes after receiving the 1st Pfizer vaccine injection, there was stiffness felt behind my ears and in the back of my neck. 10 minutes after the injection, there was a fullness noted along my throat and upper pallet. The symptoms only slightly lessened after 30 minutes. I have a hx of Rheumatoid Arthritis, completing prednisone doses 4 days ago and currently taking Celebrex and IBU daily. The Benadryl liquid dose (25mg) taken at 14:15 completely resolved my reaction symptoms by 15:15.','MODERNA'),('2020-04-01',42349608,1730496944,1619351277,'Received injection on 12/29/2020 with no adverse event until 10 days post injection on 1/7/2021.  Woke up with strong dull headache; raised, red injection site with heat to the touch and severe itching of site.  Experienced severe fatigue for 24-48 hours.  Following day, 1/8/2021, site is less red, warm still, less itchy, and fatigue is better.','Sputnik'),('2020-04-01',46864376,1750836565,1427207497,'1st Night/2nd Day: extreme pain in arm, could not raise it, redness, extreme swelling 3rd Day: swelling, reduction in pain, reduction in redness 4 Day: Swelling, no pain, redness is a extremely light pink 5th Day/6th day: all symptoms gone 6th night/7th Day: swelling and redness returned, itchiness began 8th day: reduce in swelling, redness becoming larger, itchiness reduced 9th Day: redness becoming larger, swelling and itchiness gone 10th Day: Redness still becoming larger 11th Day: Redness is largest since shot, warm to the touch','Covaxin'),('2020-04-01',53040908,1578599940,1649439951,'My tonsils have