r vaccination. S/p IM Epi, Benadryl, Pepcid, Solumedrol & Racemic Epi. CCM consulted. Close monitoring in ICU overnight. (1/28) Symptoms resolved, plan to discharge home with Rx for Epi pen.','Covaxin'),('2020-04-06',42754523,1104176478,1073502001,'Localized painful, and itchy swelling at injection site, grew to baseball size over the course of a week. Stiff arm and neck.','Covishield'),('2020-04-06',50503447,1073924908,1073530655,'Headache within hour of receiving vaccine, patient took Tylenol','BBIBP-CorV'),('2020-04-06',52041872,1063528990,1922149426,'3-in circumferral rash around injection site.','Covaxin'),('2020-04-06',60950629,1801833306,1104811835,'Emergency room 1/25/21 HPI patient is a 66 y.o. female who presents with dizziness, nausea, and vomiting.  Patient reports that she began having acute episodic dizziness and vertigo early this morning when she rolled over in bed.  She states the dizziness became so bad it made her nauseous and she began vomiting.  Patient reports she tried to take a Dramamine but was unable to keep it down, and thus it did not help.   Patient denies any ringing in the ears, decreased hearing, or ear pain.  Patient does report she has had episodes of dizziness and vertigo like this in the past.  Patient denies any fevers or chills.  Patient does report mild frontal headache.  Patient denies any chest pain, palpitations, or shortness of breath.  ','ASTRAZENECA'),('2020-04-07',620946,1538410832,1356456446,'DEVELOPED FLAT, RED RASH OVER NECK AND UPPER TORSO. BENADRYL 25MG ADMINISTERED IM AND RASH RESOLVED WITHIN A HALF HOUR','Covaxin'),('2020-04-07',21477230,1861737140,1952697112,'Within 24 hours of injection, the left arm became very red below the injection site, and after five days the redness had traveled down to the elbow.  The arm was also distinctly warm to the touch and tender.  During the first evening, I experienced chills and presumed fever that responded to 400 mg of Ibuprofen.  I experienced some nausea, loss of appetite, and malaise over the next three to four days after injection.','MODERNA'),('2020-04-07',32538484,1194079533,1417957648,'Vaccine given on 01-25-2021. Wife reported on 01-29-2021 that patient had a ran a fever on 01-26-2021, Was better on 01-27-2021. She found him dead when she came home work on the evening of 01-28-2021.','MODERNA'),('2020-04-07',41807390,1750395414,1083665640,'Client complains of itching, burning, redness, swelling, warm to the touch at injection site. State he has used ibuprofen, benedryl, and ice pack to relieve symptoms. No improvement since started yesterday, but reports he is at work today and is not able to treat symptoms regularly. He will continue current treatment of symptoms and report any improvement/worsening over the next few days. He has been advised to seek emergency care if he should have worsening symptoms and/or has any difficulty breathing. He also reports he gets annual flu vaccines and was in the military and has not had reactions to vaccines like this in the past.','CoronaVac'),('2020-04-07',42737184,1184099905,1528596962,'19 Feb: Received vaccinate roughly 1330hrs. [1400hrs through 2100hrs] lightheaded, slight headache. [1500hrs onward] tightness in throat. 20 Feb: [All day] tightness in throat; fatigue; glands swollen in jaw/neck; joint pain in shoulders and ankles. 21 Feb: [All day] tightness in throat; fatigue; glands swollen in jaw/neck; joint pain in shoulders, lower spine, and ankles. 22 Feb: [as of 1100hrs] tightness in throat; fatigue; glandes swollen in jaw/neck; joint pain in shoulders and ankles.  Takes benadryl to alleviate sysmptoms, declines advise for further care.','BBIBP-CorV'),('2020-04-07',63480510,1215077151,1275535882,'1/23 - Mild injection site discomfort. Appetite loss compared to previous day. Beginning loss of mental acuity compared to previous day.  1/24 - Continued loss of appetite. Near complete loss of ability to move. Continued decline of mental acuity. Very little speaking. 1/25 - Stopped speaking completely. Loss of bowel control in the evening and continued until death. Complete loss of appetite. 1/26 - Near complete loss of ability to swallow. Moved to hospice 4:00pm. 1/27 - Died 4:00am','Covishield'),('2020-04-08',51612998,1023260320,1396198289,'Myalgia tingling and paresthesia of mouth, tongue , scratchy throat, mild cough, metallic taste, myalgia Narrative:  tingling and paresthesia of mouth, tongue , scratchy throat, mild cough, metallic taste, myalgia','Covaxin'),('2020-04-09',20426044,1578948899,1598924839,'Tested positive for COVID; Tested positive for COVID; This is a spontaneous report from a contactable consumer.  A male patient  of unspecified age received BNT162B2 (PFIZER-BIONTECH COVID-19 mRNA VACCINE), via an unspecified route of administration in Dec2020 at single dose for covid-19 immunization.  The patient\'s medical history and concomitant medications were not reported.  The patient tested positive for COVID in Jan2021.  Details were as follows: the patient received the vaccine in Dec2020 (reported as about 14 days or 15 days ago),  and then he tested positive for COVID in Jan2021. Therapeutic measures were taken as a result of the event.  On 09Jan2021, he went and got the monoclonic infusion. The outcome of tested positive for COVID was unknown.   The batch/lot number for the vaccine, BNT162B2, was not provided and will be requested during follow-up.','Sputnik'),('2020-04-09',50833001,1760593339,1952393761,'Pt presented to the emergency department with complaints of myalgias after receiving the vaccine. She noted that she had vomiting the night prior. She denied any chest pain, shortness of breath, abdominal pain, headaches, fever at that time. Pt was left in room by herself for approximately 5 minutes and was found unresponsive. Code Blue was called. Pt was found in asystole. ACLS was initiated. Return of circulation occurred after 7 minutes of resuscitation. Pt is currently intubated and sedated.','ASTRAZENECA'),('2020-04-09',51246563,1548470198,1194272120,'The next morning I woke up and thought my mouth hurt then the more I thought about it I realized it didn\'t hurt but it was numb on the left side, like I had Novocain wearing off.   It is getting a little better but is still numb a week later.','MODERNA'),('2020-04-09',57941612,1962704577,1598924839,'died 01/16/2021','Covaxin'),('2020-04-09',64854785,1407213036,1023083599,'Started out as a localized bruise several days after injection. On Saturday 1/2/21 noticed a pink spot where the bruise occured. The spot was 4 inches long & 2 inches wide. Spot is warm to touch & was itchy. The spot remained the same until 1/5/21. It did not take anything to help with itching','ASTRAZENECA'),('2020-04-10',960261,1376895318,1316029382,'Fever, Tachycardia, CHILLS Narrative: PULSE WAS 115 FOR ABOUT 3 HOURS. TOOK TYLENOL AND NO FEVER, CHILLS OR HIGH PULSE NEXT MORNING','CoronaVac'),('2020-04-10',1082657,1851772537,1003809575,'Flu Sx HA','BBIBP-CorV'),('2020-04-10',3609346,1598159139,1598851404,'Started experiencing heart palpitations within minutes of receiving vaccine. Heart rate is between 170-180 bpm. Patient states that she has had ?palpitations? in past but has never been diagnosed with cardiac condition. Is currently on SVT rhythm on EKG. Attempted to have patient vagal down with no change in heart rate. Patient was transferred to paramedics for transport to Medical Center.','PFIZER'),('2020-04-10',18120098,1578625984,1730426768,'Dizziness, Headache, NauseaVomiting, insomnia, weakness','Sputnik'),('2020-04-10',24791188,1447636691,1295823938,'Client developed swelling, redness, itchiness at injection site 9 days after receiving vaccine.  Client states she had only mild soreness at the injection site the day after receiving the vaccine but it went away in a day','CoronaVac'),('2020-04-10',27334212,1407919822,1972533198,'Narrative:  Patient with history of seizures was given his 1st dose of Moderna COVID- 19 vaccine toward the end of a stable dialysis treatment. 15 minutes post immunization, patient experienced hypotension and grand mal seizures. Hypotension resolved with saline administration. Oxygen via NC administered. EMS called due to ongoing seizure activity. Transported to hospital where he was admitted for an undisclosed diagnosis.','Sputnik'),('2020-04-10',42433004,1710963483,1386635464,'Pt was accompanied by daughter, who drove pt to clinic. Pt was correctly identified, screened, given vaccine, monitored for appropriate time.  Pt left clinic as passenger of vehicle and was being driven  by daughter.  Pt started complainingg of Shortness of breath and not feeling right..  Daughter brought pt to local emergency room, Pt was later transferred to higher care hospital.  Information regarding symptoms and further medical care was relayed to clinic by family member.','CoronaVac'),('2020-04-10',57496007,1861412090,1174694301,'Site pain and swelling for 6 days after vaccination. Day 7 post vaccination; redness, itching, edema at injection site, circular area, about 5 inches in diameter. Plus swollen, painful axillary  lymph nodes bilaterally.','Covaxin'),('2020-04-11',29718353,1982141347,1700867892,'I tested positive for Covid-19 on 8/10/20.  Symptoms were moderate (No hospitalizations/oxygen/interventions.  Just flu like symptoms with significant chest pain.  MI & PE ruled out in two ED visits, symptoms last about a month).  Moderna Covid-19 Vaccine on 1/2/21 at 7:45 am.  Developed significant chills at about 8:00 pm that evening.  By 10:30 pm, chills, rigors, bodyaches, & fatigue (no fever).  1/3/21:  Significant fatigue, chills, bodyaches, and now headache.  Essentially stayed in bed the whole day; completely useless.  Symptoms improved throughout the day.  Was about 45% better by bed time.  Severe diaphoresis in the middle of the night.  1/4/21:  75% better.  Went to work and completed my shift.  95% better by the end of my shift.','ASTRAZENECA'),('2020-04-11',42362657,1659757946,1699959841,'Elevated HR up to 130 for a few hrs after administration and intermittently for several days; Severe fatigue; This is a spontaneous report from a contactable nurse. A 43-year-old female patient received bnt162b2 (PFIZER-BIONTECH COVID-19 VACCINE, Lot number: eh9899, expiry date not reported), intramuscular on the left arm on 16Dec2020 12:00 at single dose for COVID-19 immunisation. Medical history included asthma. Concomitant medications were not reported. On 16Dec2020 14:00, the patient experienced elevated HR up to 130 for a few hours after administration and intermittently for several days and severe fatigue. No therapeutic measure was taken as a result of the events. Clinical outcome of the events was recovered with sequelae on Dec2020.  Follow-up attempts are not possible. No further information is expected.','Covishield'),('2020-04-11',42592640,1073945705,1265432611,'Employee here with COVID vaccine reaction was given the vaccine on 12/30/20 in left upper arm, noticed the area was red on 01/07/21. The area is red, swollen, warm to the touch, itching. The area measures 6 X 4.5cm borders not clearly defined. Explained conservative measures including cool compresses, if approved by PCP taking OTC IBU and antihistamines and hydrocortisone cream. Explained signs of cellulitis including skin tightness and red streaking, informed if the area worsens after trying conservative measure to go for further care with either PCP or walk in clinic. Employee verbalized understanding and agrees with plan.','ASTRAZENECA'),('2020-04-12',830475,1710072335,1568690915,'sudden onset of symptoms: left side of face drooping. Pain in left ear radiating along jaw line. PCP put me on course of steroids','Covishield'),('2020-04-12',47430480,1477519478,1780724971,'Facial drooping, watering of the right eye, twitching of the right eye.  Diagnosed as Bell\'s Palsey. Rx for prednisone.','Covaxin'),('2020-04-13',41953331,1285823344,1063603249,'Fainted at 6:30 a.m. the next morning','ASTRAZENECA'),('2020-04-13',57404007,1295149300,1467413120,'Syncopal episode followed by death. Unable to be revived. Coroner\'s case.','PFIZER'),('2020-04-14',21772848,1265877989,1235199811,'Patient began experiencing arm redness/swelling approximately the size of 2x2. Reaction started day 3 and increased daily. Patient taking OTC pain reliever and benadryl. States that it feels like a bee sting.','Covaxin'),('2020-04-14',29264224,1992796841,1457356545,'Patient developed  lower extremity weakness, the weakness progressed and after few days he was not able to walk even with help of crutches. Guillain barre  syndrome was suspected. He was sent to hospital. Lumbar puncture was performed on him showed elevation of CSF protein. He received  IVIG and his weakness improved. He also received Vitamin B12 injection due to Vitamin B12 deficiency','PFIZER'),('2020-04-14',41898142,1518339605,1124007091,'Headache after dose was given at 10:00 a.m   Died at after 7:30 pm the same night the dose was given.','CoronaVac'),('2020-04-14',43228093,1245365949,1215093760,'Severe arm pain in injection site, fever (100.2), horrible leg aches and muscle pain.  Felt like I had the worse case of the flu in my life.  Very tired and little energy.   This lasted about 36 hours.','Covishield'),('2020-04-14',50237888,1952574048,1790821916,'redness at injection site, swollen eyelid, congestion, chest tightness all started 8 days after vaccine. prior to this, there was no redness at the injection site or facial welling or other nasal/chest symptoms. reported on v-safe program daily for one week, then v-safe stopped allowing reporting. other than this, only other symptoms were arm soreness for 12 hours and a bump at injection site for 48 hours. Again, redness and facial swelling started 8 days post vaccination. 5 weeks pregnant at time of vaccine.','Covishield'),('2020-04-14',52553276,1053841163,1811094550,'At site of shot on night of Feb 16, my arm was itchy and hurting.  By the morning of Feb 17, My arm was swollen at the site s