in in my rt arm with a distinctive red area at the vaccine site approximately 3 inches around and swollen lymph nodes in the rt under arms.   Had to call out of work for two days so far.   I am covid recovered from 4/1/20','Sputnik'),('2020-04-16',68010466,1366626673,1700867892,'Patient felt warm with palpitations 5 minutes after vaccine administered. was monitored for 30 mins & then returned to work. on 12/30/2020 patient was at work in Presurgical testing dept & experienced near syncope, dizziness & elevated BP. reported to ED & was admitted to telemetry unit.','Covaxin'),('2020-04-17',64560394,1083698492,1538457205,'L sided Facial Numbness','Covaxin'),('2020-04-19',368070,1174965966,1982767240,'I experienced vertigo and naseua','CoronaVac'),('2020-04-20',21381586,1184172918,1689607871,'Patient received a dose of vaccine that may be less than completely effective due to storage conditions.  No adverse effect noted.','ASTRAZENECA'),('2020-04-20',22499863,1568421816,1427025311,'patient developed nausea and arm soreness at injection site day after administration. Symptoms lasted about 1 day. No other complaints.','ASTRAZENECA'),('2020-04-20',50136635,1538694971,1760586622,'The patient noted weakness starting in the legs on January the 19th, 10 days  after receiving the first dose of the vaccine.  The weakness progressed to the point that he was able to ambulate only with assistance.   He was seen in my neurology clinic on January 28th and his evaluation suggested an ascending, painless weakness of the legs with rapidly progressive symptoms.  He  was admitted to Hospital on the same day.  His evaluation is consistent with Guillain Barre Syndrome and he has been started on plasmapheresis to treat the condition.','Sputnik'),('2020-04-20',66018279,1861932717,1871865493,'Period very very late for jam and just dark brown spotting very end of jan beginning of feb. unusual','Covishield'),('2020-04-21',856513,1720333685,1417994575,'2.5 hours after the vaccine given in my left arm - My right face and neck (jaw line) started to swell up with some pain to touch.  My hearing was effected as my right ear felt like it had a cotton ball in it. I immediately knew it was an allergic reaction to the vaccine injection. I presented to the Emergency Room @ 2:40 pm.  I was seen my Dr.  I was given 10 mg of steriod and Benadryl.  I was evaluated for 3 hours and discharged with Diphenydramine 25 mg script. The swelling decreased 2 days later.','MODERNA'),('2020-04-21',15411403,1962495630,1952331407,'Recipient reported a temp of 101.2','PFIZER'),('2020-04-21',21736874,1114372646,1427116409,'Rash occurred day after on stomach then each day rash would form somewhere else. Itchiness gradually worsened each day and rash gradually spreading. Large swollen welt on lower back and past 4 hours progressively increasing in itching and widespread rash over entire back and shoulders.  Red swollen welts all throughout with excessive itching. Took levocetirizine and will take 50 mg Benadryl in a few hours. Examined by dermatologist over video and he suggested IM kenalog and antihistamines.','Sputnik'),('2020-04-21',27214224,1841630910,1437150562,'headache/sneezing/runny nose occurring  16hours after vaccination lasting 24hours total fever/chills/fatigue, highest reading 100.7, occurring 19 hours after vaccination lasting 12 hours total generalized GI distress without nausea/vomitting starting within 2 hours of vaccination and lasting over 36hours; difficult to discern from my typical GI issues but certainly seemed to be heightened','Covaxin'),('2020-04-22',3403716,1013083229,1952697112,'Fever 102 for 2 days, chills, headache, nausea,golf ball sized lump at injection site and bruising','BBIBP-CorV'),('2020-04-22',41269216,1134194962,1295927291,'Injection given 12/26/2020. On 1/2/2021 around 1:40 pm injection site erupted into a painful, red, itchy hot rash. Seen in Urgent Care on 1/3/2021 where doctor diagnosed probable cellulitis and advised time off of work. Given antibiotics and steroid cream to treat.  Seen for follow up with same doctor but in occupational health on 1/6/2021. Doctor extended course of antibiotics and did not release me for work. At time of this writing,  I am still being treated and my next appointment with occupational health is 1/14/2021.','Covishield'),('2020-04-22',48022254,1861940645,1619903689,'Patient reported metal smell','ASTRAZENECA'),('2020-04-22',50107566,1811259955,1982649810,'No adverse event. We picked up what was supposed to be COVID-19 Moderna vaccine. Lot numbers and expiration date matched tracking sheet given to us. Color of medication also matched what was stated on Fact Sheet for Healthcare Providers for the Moderna vaccine. Instead, the medication in the vial was actually COVID -19 antibodies meant for hospital use. After administration for 44 individuals, we received call that the medications had been mixed up. The vials and box that medication came in had no identifying factors to indicate it was not the Moderna vaccine.','MODERNA'),('2020-04-22',54410529,1154543478,1225285349,'Pancreatitis, unclear origin','PFIZER'),('2020-04-22',60109226,1306943949,1831348812,'I was extremely sleepy.  I went to sleep Saturday night, got up at 8 am.  At 9:30 am I was so sleepy I could hardly walk.  I went to bed and slept  for 7 hours without waking up.  When I got up I felt better.','ASTRAZENECA'),('2020-04-23',26815951,1326422312,1063462547,'Received vaccine at 1730, then just before midnight my heart began to pound hard and very fast, and it made me feel short of breath or as though I had to cough. After about a minute I thought it might be SVT so I did a valsalva maneuver and it stopped.  I was resting in bed, no alcohol or caffeine, and this has never happened to me before. Since then, I have felt at least one heart palpitation per day, sometimes many more. The last few days I have felt extremely fatigued and have had an odd sensation in my chest. On 1/7 I developed a dry cough, and was swabbed for Covid because I felt so bad. It was negative. This made me wonder if the odd sensation in my chest was related to my heart and not my lungs. I am due for my second vaccine today, and am unsure if I should get it.','MODERNA'),('2020-04-25',47852557,1629493515,1336192095,'Diarrhea & NauseaVomiting Narrative:','Sputnik'),('2020-04-25',50258827,1841490141,1538376793,'WENT TO SLEEP ON 1/6/21 WITHOUT ANY ADVERSE EVENTS. WHEN AWOKE ON 1/7/21 AT 07:00AM, HAD A RASH ON ARMS AND BELLY. RASH IS NOT ITCHY.','Sputnik'),('2020-04-25',64812656,1518123173,1649208752,'Sedation, Myalgia & Arthralgia','Covishield'),('2020-04-26',60120434,1699047241,1689669749,'Myalgia, Arthralgia, Rash, ErythemaMultiform &  NauseaVomiting Narrative:  required alt ibuprofen and acetaminophen and rash appeared with hives on 1/2/2021 and Benadryl was needed','Covaxin'),('2020-04-27',39654652,1366998478,1548288293,'Pt had reaction of redness and swelling to injection site. Second day of reaction increased swelling at injection site as well and lymph nodes in this arm swollen. Also stated it was hard, warm and swollen.','BBIBP-CorV'),('2020-04-28',41198000,1902211162,1992771919,'Myalgia fatigue, itching/pain/erythema/swelling at injection site','Covishield'),('2020-04-28',65916497,1356398325,1386909562,'Rash over chest and arms','PFIZER'),('2020-04-29',25951309,1164884938,1528346145,'Headache fever body ache','CoronaVac'),('2020-04-29',60014709,1528137981,1730634817,'The patient was observed to be lethargic on 1/29/21 at 1515. BP-80/50, P-75, RR-27, T-100.1. He was given a bolus of  NS 150 mlx2. and Rocephin 1 gram IM.','ASTRAZENECA'),('2020-04-29',76468240,1538480975,1093742488,'Pain in my left arm, continuous ache, worse when I move it. So far it has not stopped hurting.','Sputnik'),('2020-04-30',22203153,1679996375,1841205358,'Headache & Myalgia','Sputnik'),('2020-04-30',49682711,1649714296,1659449304,'soreness @ injection site, 4 puffs of inhaler & advair diskus within 1st hour. No additional symptoms until 1:30 am where I was up all night. In severe systemic pain, fever, severe myo aches, some mild wheezing resolved with inhalers & migraine. Intermittent stuffy nose & sore throat but it goes away. Pain level 10. I can barely move. Dizzy & drinking water & taking otc pain meds. Unable to work or daily function','Sputnik'),('2020-05-01',3728661,1467462671,1861434037,'Next morning, I woke up with severe positional headache (headache with standing or sitting up, resolved completely with ibuprofen and tylenol within 20 minutes). The next morning I also had a sore left deltoid, and soreness extending into my left chest and shoulder, which diminished throughout the day after ibuprofen and tylenol. I also had a left swollen armpit, which I interpreted as swollen lymph nodes. My left armpit was sore and was visibly swollen compared to the right. The left lymph node is still visibly swollen as I report this (approximatley 36 hours after vaccine administration), and is sore but less sore than initially.   Of note, when I received the first vaccine in this series, my left deltoid was more sore than with the second administration, but soreness was limited to the deltoid and resolved within 3 days.','MODERNA'),('2020-05-01',57706210,1306071584,1194759555,'2 hours after vaccine I had a headache, high blood pressure, lightheaded and, dizzy the day after I was sore all day. In addition ligament pain with lots of muscle pain.','CoronaVac'),('2020-05-01',57801148,1437411220,1013462373,'Symptoms 01/24/2021- numbness, weakness, tingling bilateral legs. Lost inability to walk and bladder control Admitted to hospital  01/24/2021-1/26/21. Not diagnosed. Had 4 MRIS and a lumbar puncture 02/3/2021- was in ED at hospital due vision issues/double vision- discharged same day. Repeated 4 MRIS and blood work, and lumbar puncture.  02/09/2021- patient was seen at a neurologist, due to numbness in bilateral hands and arms. And was admitted to Medical Center until 02/13/2021. Ruled out MS,