r about 1/2 hour after receiving the vaccine, she began to c/o of a sharp epigastric pain. Employee stated that she only had a banana to eat for breakfast. She was transferred over to the first responders area, where she was assessed.Her vitals were within normal range.  After few minutes on the stretcher employee stated that  the pain was slowly subsiding, she then opted to leave.','CoronaVac'),('2020-05-05',51408067,1417918103,1962434126,'Headache, Bodyache','Covaxin'),('2020-05-06',2186069,1629118500,1538331996,'Vomiting, nausea, neck muscle tightness, throat tightness and muscle soreness of back of tongue,  severe disorientation, blurred vision, neck soreness, diarrhea','Sputnik'),('2020-05-06',57920746,1205827995,1932279726,'Moderna Covid-19 Vaccine EUA    Arm pain at injection site, body and joint aches , chills, fever to 102.5, severe headache','Covaxin'),('2020-05-06',66209344,1023460318,1669555314,'Patient became ill with pneumonia on 1/29/21 and then recurrent pneumonia on 2/10/21. Pt\'s plan of care was subsequently changed to comfort-focused on 2/11/21 and patient was deceased that same day.','Covishield'),('2020-05-07',20638449,1528414612,1669770913,'on 2/13 at 7:30am resident was observed congested, foaming at the mouth. transferred to the  hospital, verbal report from hospital nurse stated the resident was admitted for hypercalcemia and dehydration.   The resident expired on 2/14/21 at 9:30am.    Died on 2/14/2021','BBIBP-CorV'),('2020-05-07',52246929,1053577098,1497020879,'Headache & Fever Narrative:','MODERNA'),('2020-05-08',948342,1376910166,1871587956,'?Covid toe? - wasn?t painful but slightly itchy in the beginning. Middle toe on each foot.','CoronaVac'),('2020-05-08',4105938,1750505020,1730113770,'Headache, HYPERtension, neck stiffness, left arm weakness, Narrative: individual states having these symptoms all the time, almost resolved when left with husband driving home','Sputnik'),('2020-05-08',44238708,1255390043,1811985708,'Woke up very fatigued 12/25 only minimal activity performed creating additional fatigue.  Was sleeping 12 plus hours a day without feeling rested in the least. No problems with sleep. Also had heaviness of chest - felt like rib cage made of iron- this dissipated by the 28-29th. No excessive cough or fever, did have dyspnea with any exertion and this continues but seems to be lessening. Was not able to work due to fatigue. Yesterday remained tired but felt noticeably different-felt lighter-and today seems promising.','BBIBP-CorV'),('2020-05-08',66720587,1942539937,1013044411,'AT APPROXIMATELY 8 AM , I BEGAN A SNEEZING FIT OF 12 OR SO CONSECUTIVE FORCEFUL SNEEZES.  IT CONTINUED FOR SEVERAL MINUTES.  I HAVE  NASAL CONGESTION SINCE 8 AM (IT IS NOW 11:15 AM), SNEEZING, AND I AM CONSTANTLY BLOWING MY NOSE. I AM EXPERIENCING SEVERE COLD SYMPTOMS. I HAVE  SORENESS IN THE ARM THE VACCINE WAS GIVEN. OTHERWISE I AM FEELING FINE.','CoronaVac'),('2020-05-09',25011334,1578572541,1942488531,'Pain in the arm a t the injection site, now having shoulder pain. woke up with headache and dizziness.','BBIBP-CorV'),('2020-05-10',46766597,1972802510,1578562435,'Myalgia Chills and skin hurting Narrative:  Had COVID in Sept. The myalgia,chills,skin hurting were a mild version of what she had during active COVID infection','Covaxin'),('2020-05-10',64828502,1093918997,1437113537,'Swelling of different areas throughout my body and hives','MODERNA'),('2020-05-11',57953267,1699730739,1174600431,'Cardiac Arrest/Death Date of death 03/03/2021 time 01:54 pm','MODERNA'),('2020-05-13',32832756,1760559330,1790941185,'felt dizzy in the first 40 minutes.  went away.  10 hours later began to experience body aches and vomiting.','Covaxin'),('2020-05-13',46864376,1619412079,1720080864,'1st Night/2nd Day: extreme pain in arm, could not raise it, redness, extreme swelling 3rd Day: swelling, reduction in pain, reduction in redness 4 Day: Swelling, no pain, redness is a extremely light pink 5th Day/6th day: all symptoms gone 6th night/7th Day: swelling and redness returned, itchiness began 8th day: reduce in swelling, redness becoming larger, itchiness reduced 9th Day: redness becoming larger, swelling and itchiness gone 10th Day: Redness still becoming larger 11th Day: Redness is largest since shot, warm to the touch','Covaxin'),('2020-05-15',42349608,1619246873,1780895722,'Received injection on 12/29/2020 with no adverse event until 10 days post injection on 1/7/2021.  Woke up with strong dull headache; raised, red injection site with heat to the touch and severe itching of site.  Experienced severe fatigue for 24-48 hours.  Following day, 1/8/2021, site is less red, warm still, less itchy, and fatigue is better.','Sputnik'),('2020-05-15',54382996,1760857445,1073507380,'I had body aches, low grade fever and headaches.','Covaxin'),('2020-05-15',57868072,1770990061,1093896698,'Patient reported onset of chills, aches, fatigue, nausea, dizziness within 24 hours of receiving 1st dose of Moderna COVID-19 vaccine. Post COVID-19 infection onset 12/24/2020. Had been released back to work and sx free 01-04-2021.','MODERNA'),('2020-05-15',58751483,1275937419,1326013533,'Client experience dizziness.  Client was evaluated by onsite paramedic and released to ho home at 9:57 am.','BBIBP-CorV'),('2020-05-15',60193348,1417918830,1942460688,'Shingles. Next morning','Sputnik'),('2020-05-15',75609062,1518107614,1407809288,'About 30 post administration, I had injection site soreness which progressively worsened in severity as time went on. About 12 hours after the injection I had a pretty sudden onset of fatigue, headache and nausea.','PFIZER'),('2020-05-16',54436055,1871878835,1578855987,'On 01/19/2021 patient was observed to have a slight right facial droop and slight slurred speech, hand grips were equal, pupils equal and reactive, she had difficulty moving her right leg. 911 activated due to possible CVA, admitted to the hospital , a MRI was done to rule out a stroke. Readmitted 1/20/21 with the diagnosis of probable Bell\'s Palsey. The patient is stable medically at this time. Facial droop remains at this time, she is able to swallow without difficulty.','PFIZER'),('2020-05-17',608543,1952798779,1669470852,'I have no concerns about my reaction and did expect it but wanted to report for your information. I did report to v-safe. I had COVID-19 disease in September, so I was expecting to have a robust response to the vaccine. I received my Moderna vaccine on 12/29. I developed fever, shaking chills, and terrible body aches about 13 hours after the dose. I felt a bit better in the morning, so I went to work as usual but was still sore with body aches. I developed shaking chills, nausea, and worsening aches at lunch time and left work early because the nausea and chills were so significant. I slept the remainder of the day and by the morning of 12/31 felt well again. My symptoms probably lasted around 24-30 hours total. I did miss a half day of work but otherwise had no significant effects.','Covishield'),('2020-05-17',53040908,1629376611,1477564037,'My tonsils have swollen. Negative strept and covid test. Never had swollen tonsils before. No swollen glands associated','BBIBP-CorV'),('2020-05-18',75107129,1033376629,1568778918,'left upper arm muscle pain, left shoulder pain, some discomfort in left forearm and left elbow, decreased ROM left arm and left shoulder','PFIZER'),('2020-05-19',40436966,1639152788,1104859032,'fever spiking to 101.8 orally, chills and aches lasting 4 days','BBIBP-CorV'),('2020-05-20',21477230,1003209412,1962529206,'Within 24 hours of injection, the left arm became very red below the injection site, and after five days the redness had traveled down to the elbow.  The arm was also distinctly warm to the touch and tender.  During the first evening, I experienced chills and presumed fever that responded to 400 mg of Ibuprofen.  I experienced some nausea, loss of appetite, and malaise over the next three to four days after injection.','MODERNA'),('2020-05-20',32538484,1992194989,1568527497,'Vaccine given on 01-25-2021. Wife reported on 01-29-2021 that patient had a ran a fever on 01-26-2021, Was better on 01-27-2021. She found him dead when she came home work on the evening of 01-28-2021.','MODERNA'),('2020-05-20',42754523,1376881607,1174600431,'Localized painful, and itchy swelling at injection site, grew to baseball size over the course of a week. Stiff arm and neck.','Covishield'),('2020-05-20',63480510,1184857500,1235230327,'1/23 - Mild injection site discomfort. Appetite loss compared to previous day. Beginning loss of mental acuity compared to previous day.  1/24 - Continued loss of appetite. Near complete loss of ability to move. Continued decline of mental acuity. Very little speaking. 1/25 - Stopped speaking completely. Loss of bowel control in the evening and continued until death. Complete loss of appetite. 1/26 - Near complete loss of ability to swallow. Moved to hospice 4:00pm. 1/27 - Died 4:00am','Covishield'),('2020-05-21',3609346,1518107614,1083873319,'Started experiencing heart palpitations within minutes of receiving vaccine. Heart rate is between 170-180 bpm. Patient states that she has had ?palpitations? in past but has never been diagnosed with cardiac condition. Is currently on SVT rhythm on EKG. Attempted to have patient vagal down with no change in heart rate. Patient was transferred to paramedics for transport to Medical Center.','PFIZER'),('2020-05-21',41807390,1447496997,1417992447,'Client complains of itching, burning, redness, swelling, warm to the touch at injection site. State he has used ibuprofen, benedryl, and ice pack to relieve symptoms. No improvement since started yesterday, but reports he is at work today and is not able to treat symptoms regularly. He will continue current treatment of symptoms and report any improvement/worsening over the next few days. He has been advised to seek emergency care if he should have worsening symptoms and/or has any difficulty breathing. He also reports he gets annual flu vaccines and was in the military and has not had reactions to vaccines like this in the past.','CoronaVac'),('2020-05-21',42737184,1639433402,1497983464,'19 Feb: Received vaccinate roughly 1330hrs. [1400hrs through 2100hrs] lightheaded, slight headache. [1500hrs onward] tightness in throat. 20 Feb: [All day] tightness in throat; fatigue; glands swollen in jaw/neck; joint pain in shoulders and ankles. 21 Feb: [All day] tightness in throat; fatigue; glands swollen in jaw/neck; joint pain in shoulders, lower spine, and ankles. 22 Feb: [as of 1100hrs] tightness in throat; fatigue; glandes swollen in jaw/neck; joint pain in shoulders and ankles.  Takes benadryl to alleviate sysmptoms, declines advise for further care.','BBIBP-CorV'),('2020-05-21',48314179,1578581310,1538331996,'5 days after Moderna vaccine, developed severe abd pain, mid epigastrium. No Nausea or vomiting. No fever.  Mild diarrhea. after 48 hrs with no improvement went to ED','Sputnik'),('2020-05-21',50833001,1093769127,1902891179,'Pt presented to the emergency department with complaints of myalgias after receiving the vaccine. She noted that she had vomiting the night prior. She denied any chest pain, shortness of breath, abdominal pain, headaches, fever at that time. Pt was left in room by herself for approximately 5 minutes and was found unresponsive. Code Blue was called. Pt was found in asystole. ACLS was initiated. Return of circulation occurred after 7 minutes of resuscitation. Pt is currently intubated and sedated.','ASTRAZENECA'),('2020-05-21',52007132,1982861720,1639148554,'chills headache body aches','Covaxin'),('2020-05-21',64854785,1144212754,1760922405,'Started out as a localized bruise several days after injection. On Saturday 1/2/21 noticed a pink spot where the bruise occured. The spot was 4 inches long & 2 inches wide. Spot is warm to touch & was itchy. The spot remained the same until 1/5/21. It did not take anything to help with itching','ASTRAZENECA'),('2020-05-21',75101759,1801861901,1447420732,'Myalgia Soreness at injection site','Sputnik'),('2020-05-22',27334212,1821422098,1922149426,'Narrative:  Patient with history of seizures was given his 1st dose of Moderna COVID- 19 vaccine toward the end of a stable dialysis treatment. 15 minutes post immunization, patient experienced hypotension and grand mal seizures. Hypotension resolved with saline administration. Oxygen via NC administered. EMS called due to ongoing seizure activity. Transported to hospital where he was admitted for an undisclosed diagnosis.','Sputnik'),('2020-05-22',56955397,1780677716,1063494953,'woke up on day 7 with a red 4 inch red raised mark (cellulitis) at injection site. Progressing to cellulitis ring around injection site.','Sputnik'),('2020-05-23',42362657,1922354869,1205873395,'Elevated HR up to 130 for a few hrs after administration and intermittently for several days; Severe fatigue; This is a spontaneous report from a contactable nurse. A 43-year-old female patient received bnt162b2 (PFIZER-BIONTECH COVID-19 VACCINE, Lot number: eh9899, expiry date not reported), intramuscular on the left arm on 16Dec2020 12:00 at single dose for COVID-19 immunisation. Medical history included asthma. Concomitant medications were not reported. On 16Dec2020 14:00, the patient experienced elevated HR up to 130 for a few hours after administration and intermittently for several days and severe fatigue. No therapeutic measure was taken as a result of the events. Clinical outcome of the events was recovered with sequelae on Dec2020.  Follow-up attempts are not possible. No further information is expected.','Covishield'),('2020-05-23',65124636,1548347198,1861473803,'1 st dose  lot EL 9262 1/25/21 2nd dose Lot EN 6201    ornENG201  --this was hand written for sure if it is a 6 or a g  2/11/2021 March 4th ER diagnosed with A Fib-----cardiovert--on eliquis  twice a day and metoprolol 50 mg twice a day kept in hospital overnight-now home','MODERNA'),('2020-05-24',29718353,1699730739,1811179807,'I tested positive for Covid-19 on 8/10/20.  Symptoms were moderate (No hospitalizations/oxygen/interventions.  Just flu like symptoms with significant chest pain.  MI & PE ruled out in two ED visits, symptoms last about a month).  Moderna Covid-19 Vaccine on 1/2/21 at 7:45 am.  Developed significant chills at about 8:00 pm that evening.  By 10:30 pm, chills, rigors, bodyaches, & fatigue (no fever).  1/3/21:  Significant fatigue, chills, bodyaches, and now headache.  Essentially stayed in bed the whole day; completely useless.  Symptoms improved throughout the day.  Was about 45% better by bed time.  Severe diaphoresis in the middle of the night.  1/4/21:  75% better.  Went to work and completed my shift.  95% better by the end of my shift.','ASTRAZENECA'),('2020-05-24',65103411,1952726739,1740252915,'Severe joint pain, especially in hips, knees and hands lasting approximately 72 hours after first onset of symptoms. Treatment Tylenol/NSAIDs. Resolved on its own.','PFIZER'),('2020-05-25',830475,1700844313,1255489936,'sudden onset of symptoms: left side of face drooping. Pain in left ear radiating along jaw line. PCP put me on course of steroids','Covishield'),('2020-05-25',45271765,1841550829,1952565897,'Resident began having fever on 1/11/21 @0600. VS= T-102 B/P- 100/57 P- 112 RR- 24 O2 Sat 92% on RA. MD called. Rapid COVID Test was negative. CBC,CMP, U/A were ordered as well as CXR. Resident\'s condition declined. At 3:00pm resident started having respiratory distress and hypoxia O2 Sat 89%. Supplemental O2/mask @ 5LPM. Neb TX, EKG, and Rocephin 1 GM ordered. Condition worsened. Resident sent to nearest ER for evaluation. Later in the evening the staff AT Medical Center called to inform staff that resident had expired @ 2230 as a result of Respiratory Failure and Sepsis.','Sputnik'),('2020-05-26',21772848,1609234046,1538331996,'Patient began experiencing arm redness/swelling approximately the size of 2x2. Reaction started day 3 and increased daily. Patient taking OTC pain reliever and benadryl. States that it feels like a bee sting.','Covaxin'),('2020-05-26',29264224,1033342050,1811209836,'Patient developed  lower extremity weakness, the weakness progressed and after few days he was not able to walk even with help of crutches. Guillain barre  syndrome was suspected. He was sent to hospital. Lumbar puncture was performed on him showed elevation of CSF protein. He received  IVIG and his weakness improved. He also received Vitamin B12 injection due to Vitamin B12 deficiency','PFIZER'),('2020-05-26',50237888,1588910061,1023004272,'redness at injection site, swollen eyelid, congestion, chest tightness all started 8 days after vaccine. prior to this, there was no redness at the injection site or facial welling or other nasal/chest symptoms. reported on v-safe program daily for one week, then v-safe stopped allowing reporting. other than this, only other symptoms were arm soreness for 12 hours and a bump at injection site for 48 hours. Again, redness and facial swelling started 8 days post vaccination. 5 weeks pregnant at time of vaccine.','Covishield'),('2020-05-26',65610134,1528034519,1568427243,'Shaking chills achy knees hurt','ASTRAZENECA'),('2020-05-27',60198437,1447327077,1407152283,'chest tightness, flushing, swollen lips, tingling in the left arm, no shortness or breath, no palpitations, no lightheadedness, no dizziness, no nausea or vomiting, no rash, no redness, no cough, no tongue swelling  Started within 20-30 minutes of receiving the vaccine  Received 25mg of Benadryl with improvement','ASTRAZENECA'),('2020-05-27',65352737,1205251584,1316132137,'Injection site pain, tiredness, headache, muscle pain, joint pain, swollen lymph nodes, and over all not feeling well.','Sputnik'),('2020-05-28',42557487,1851710685,1437326410,'Left facial droop. Sent to Emergency Department via EMS 1/19/2021.','Covaxin'),('2020-05-28',51180759,1760737027,1861706046,'temp and chills began at 6pm(1/5/20) , starting at 99.9 and the highest was 101.2 lasted until 1/7/21 at 2AM-also had headache,body aches and nausea . on 1/7 at 7AM I noticed increase pain in my rt arm with a distinctive red area at the vaccine site approximately 3 inches around and swollen lymph nodes in the rt under arms.   Had to call out of work for two days so far.   I am covid recovered from 4/1/20','Sputnik'),('2020-05-28',68010466,1881130144,1427291491,'Patient felt warm with palpitations 5 minutes after vaccine administered. was monitored for 30 mins & then returned to work. on 12/30/2020 patient was at work in Presurgical testing dept & experienced near syncope, dizziness & elevated BP. reported to ED & was admitted to telemetry unit.','Covaxin'),('2020-05-29',21218565,1811999741,1336584341,'Felt dizzy and light headed. Watch indicated heart rate climbing up to 172bpm momentarily and dropped back down to 120bpm.','PFIZER'),('2020-05-29',39112164,1831420280,1245527340,'Headache, Fever & NauseaVomiting Narrative:  Received vaccine in morning. By evening experiencing flu-like symptoms. Missed the next two days of work. Did not seek medical treatment. Managed low fever with tylenol.','Sputnik'),('2020-05-30',7103462,1821268103,1053448589,'Tachycardia and flushing immediately after shot given, followed by fullness (slight swelling) in mouth, prickly feeling to tongue.','BBIBP-CorV'),('2020-05-30',60003371,1619922770,1386804052,'Fever of 101.6, body aches and headache','BBIBP-CorV'),('2020-05-31',64560394,1134501695,1629088448,'L sided Facial Numbness','Covaxin'),('2020-05-31',64794116,1255701207,1922239326,'Swelling at vaccination site, skin red and hot','MODERNA'),('2020-06-02',23327057,1033185269,1932254745,'Chills, aches, post dose 2 and left sick within 24 hours of receiving the injection but was fine approximately 16 hours post injection. On or about 2/03/2021 felt intense itching deeply in left flank area. On 2/52011 the pain became so intense that I missed work and went to the hospital, and had concerns there was a problem with my kidneys.   On 2/9  itching,  urning and pain in left flank area and later developed shingles for the first time.','BBIBP-CorV'),('2020-06-03',21450529,1265734677,1982865101,'1/6/2021 1245 am: chills, fever. Body ache, left arm aching, headache,  fatigue  1:30pm: chills, fever, body aches, headache fatigue','MODERNA'),('2020-06-03',26440038,1962827634,1396851903,'CHF, Resp failure, intubated, on Levophed, suspected septic and cardiogenic shock.','Sputnik'),('2020-06-03',27214224,1730107236,1013101542,'headache/sneezing/runny nose occurring  16hours after vaccination lasting 24hours total fever/chills/fatigue, highest reading 100.7, occurring 19 hours after vaccination lasting 12 hours total generalized GI distress without nausea/vomitting starting within 2 hours of vaccination and lasting over 36hours; difficult to discern from my typical GI issues but certainly seemed to be heightened','Covaxin'),('2020-06-03',50136635,1487667606,1245598192,'The patient noted weakness starting in the legs on January the 19th, 10 days  after receiving the first dose of the vaccine.  The weakness progressed to the point that he was able to ambulate only with assistance.   He was seen in my neurology clinic on January 28th and his evaluation suggested an ascending, painless weakness of the legs with rapidly progressive symptoms.  He  was admitted to Hospital on the same day.  His evaluation is consistent with Guillain Barre Syndrome and he has been started on plasmapheresis to treat the condition.','Sputnik'),('2020-06-04',48022254,1922374487,1770548042,'Patient reported metal smell','ASTRAZENECA'),('2020-06-04',61645973,1942392006,1164749545,'Within 12 hours was having trouble breathing heart pounding thought I could just rest and could not it was so bad  went to the ER on 2/14/21 @ 8:30 am my O2 was at 87 dropped to 81 BP was 158/101','PFIZER'),('2020-06-05',54410529,1417907072,1851302830,'Pancreatitis, unclear origin','PFIZER'),('2020-06-06',4524