nuing though 5 days after vaccine. Tested negative for Covid-19 via PCR test on day 5 after vaccine.','MODERNA'),('2020-06-11',52281026,1699760793,1033168711,'This patient was hospitalized and subsequently diagnosed with GBS or AIDP','BBIBP-CorV'),('2020-06-11',65916497,1205349271,1558468579,'Rash over chest and arms','PFIZER'),('2020-06-12',22248949,1154478832,1124026554,'Approximately 5 hours after receiving my 2nd Pfizer Covid shot, I started to get diffuse abdominal pain & back aching. Seen in the ED 1/8/20 - Negative US, Normal labs - returned to ED 12 hours after D/C for worsening abdominal pain. 1/9/21 - CT showed Appendiciticitis','MODERNA'),('2020-06-12',38074578,1114326261,1508012519,'Patient started experiencing a tingling at the injection site.  There was also flushing of the left arm.  Then started to experience right flank and back pain. Never experienced respiratory difficulty or distress.  Patient was sent to the emergency department.  Patient received Solumedrol, Pepcid, and Zyrtec in the emergency department (allergic to Benadryl)','MODERNA'),('2020-06-12',41198000,1437143161,1053304469,'Myalgia fatigue, itching/pain/erythema/swelling at injection site','Covishield'),('2020-06-13',52698382,1972961472,1295927291,'Body aches, fatigue, arm pain(first couple of days), diarrhea and nausea','Covishield'),('2020-06-13',60014709,1326392259,1073888236,'The patient was observed to be lethargic on 1/29/21 at 1515. BP-80/50, P-75, RR-27, T-100.1. He was given a bolus of  NS 150 mlx2. and Rocephin 1 gram IM.','ASTRAZENECA'),('2020-06-14',22203153,1881845857,1720033244,'Headache & Myalgia','Sputnik'),('2020-06-14',51622097,1073935813,1770544207,'Moderate tingling to arms, itching throat, and flushing. Vital Signs 1315 - HR 91, RR 24, SPO2 99% Vital Signs 1320 - BP 125/88, HR 86, RR 20, SPO2 100% Vital Signs 1335 - BP 109/80, HR 84, RR 16, SPO2 98% Vital Signs 1345 - BP 123/90, HR 89, RR 16, SPO2 100%','PFIZER'),('2020-06-14',57801148,1790122810,1689669749,'Sympt