le toe on each foot.','CoronaVac'),('2020-06-21',15576923,1609216134,1831327980,'Rapid heart rate >170, flushing, chills, shaking, increased blood pressure','CoronaVac'),('2020-06-21',64828502,1518359439,1285668707,'Swelling of different areas throughout my body and hives','MODERNA'),('2020-06-22',32832756,1346513462,1154416352,'felt dizzy in the first 40 minutes.  went away.  10 hours later began to experience body aches and vomiting.','Covaxin'),('2020-06-22',54382996,1437484219,1245433804,'I had body aches, low grade fever and headaches.','Covaxin'),('2020-06-23',3836527,1801234513,1003988353,'patient claimed that she developed arm pain that radiate to the nick and ear aches after 1 hour from receiving the first dose and pain still occuring 3 days after her first dose. patient denies any allergies. patient is taking synthroid for low thyroid level, lipitor for high cholestrol, and effexor for depression. patient was instructed to take over the counter medication ibuprofen or acetaminophen and to perfom cold compression to help with the pain symptoms,','Sputnik'),('2020-06-23',57868072,1083918551,1417276015,'Patient reported onset of chills, aches, fatigue, nausea, dizziness within 24 hours of receiving 1st dose of Moderna COVID-19 vaccine. Post COVID-19 infection onset 12/24/2020. Had been released back to work and sx free 01-04-2021.','MODERNA'),('2020-06-24',4209451,1679851554,1710006879,'The night of getting the vaccine I was the sickest; fatigue, malaise, body aches, hot and cold sweats, weakness, loss of appetite, dizziness.  The day after I had to call into work due to these symptoms. Since then I?ve continued to feel fatigue, throat swelling / scratchiness, dry cough,  malaise. Also arm soreness.','MODERNA'),('2020-06-24',60193348,1275505083,1861706046,'Shingles. Next morning','Sputnik'),('2020-06-25',11130271,1801940770,1073844973,'Patient had an anaphylactic reaction, lips and facial swelling.','Sputnik'),('2020-06-25',43968196,1093743908,1083873319,'Arm