rV'),('2020-06-29',48314179,1194143347,1043274509,'5 days after Moderna vaccine, developed severe abd pain, mid epigastrium. No Nausea or vomiting. No fever.  Mild diarrhea. after 48 hrs with no improvement went to ED','Sputnik'),('2020-06-29',49756207,1134456270,1972656908,'Red, itchy rash on right arm above elbow for last three days','PFIZER'),('2020-06-29',56955397,1376947424,1295759025,'woke up on day 7 with a red 4 inch red raised mark (cellulitis) at injection site. Progressing to cellulitis ring around injection site.','Sputnik'),('2020-06-29',65124636,1750691028,1992775993,'1 st dose  lot EL 9262 1/25/21 2nd dose Lot EN 6201    ornENG201  --this was hand written for sure if it is a 6 or a g  2/11/2021 March 4th ER diagnosed with A Fib-----cardiovert--on eliquis  twice a day and metoprolol 50 mg twice a day kept in hospital overnight-now home','MODERNA'),('2020-06-29',75101759,1811226798,1245395383,'Myalgia Soreness at injection site','Sputnik'),('2020-06-30',670636,1518347319,1255489936,'It has been over a week.  Early this week 1/5 I noticed continued mild pain, itching, redness and a keloid on left arm at site of injection.  Very uncomfortable, especiall itchiness.','PFIZER'),('2020-06-30',26371238,1588111249,1992961486,'The next morning after vaccine, patient ran a fever, vomited, and was very tired.  Mom laid her down to sleep and when she checked later, patient had passed away.','Covishield'),('2020-06-30',65103411,1760775258,1336140722,'Severe joint pain, especially in hips, knees and hands lasting approximately 72 hours after first onset of symptoms. Treatment Tylenol/NSAIDs. Resolved on its own.','PFIZER'),('2020-07-01',48419388,1073945705,1568427243,'Patient reports she had numbness in her tongue for approx 24 hours after Moderna Covid 19 Vaccine dose #1.  Pt also reports approx one week after receiving first dose of Moderna Cov19 vaccine she had edema to left side of face.   Nurse suggest patient consult with per PCP before receiving 2nd dose of Mo