ntinued after first use. Patient refused to go to urgent care or ER or to have ambulance come due to financial constraints and no insurance.  Given referral to free clinics and refused to go. Symptoms resolved by 1/5/2021','ASTRAZENECA'),('2020-07-03',29088453,1881902963,1700885761,'tested positive to SARS-COV2; tested positive to SARS-COV2; This is a spontaneous report from a contactable consumer (reported for himself). A male patient of an unspecified age received first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE, Solution for injection; lot number and expiry date: not known), via an unspecified route of administration on 28Dec2020 at single dose for COVID-19 immunization. The patient\'s medical history and concomitant medications were not reported. The patient tested positive to SARS-COV2 on 08Jan2021. Today (18Jan2021), he got his appointment to get the second dose. He just wanted to know if he should go to get it or not. The outcome of the event was unknown.  Information on the Lot/Batch number has been requested.','Covishield'),('2020-07-04',21218565,1942594361,1558354043,'Felt dizzy and light headed. Watch indicated heart rate climbing up to 172bpm momentarily and dropped back down to 120bpm.','PFIZER'),('2020-07-04',22294478,1588088827,1003809575,'Headache Narrative:','Sputnik'),('2020-07-04',39112164,1124146626,1093913212,'Headache, Fever & NauseaVomiting Narrative:  Received vaccine in morning. By evening experiencing flu-like symptoms. Missed the next two days of work. Did not seek medical treatment. Managed low fever with tylenol.','Sputnik'),('2020-07-04',42557487,1376749911,1497958896,'Left facial droop. Sent to Emergency Department via EMS 1/19/2021.','Covaxin'),('2020-07-04',60198437,1265626691,1245630870,'chest tightness, flushing, swollen lips, tingling in the left arm, no shortness or breath, no palpitations, no lightheadedness, no dizziness, no nausea or vomiting, no rash, no redness, no cough, no tongue swelling  Started within 20-30 minutes of receiving the vaccine  Received 25mg of Benadryl with improvement','ASTRAZENECA'),('2020-07-04',65352737,1184826786,1194041285,'Injection site pain, tiredness, headache, muscle pain, joint pain, swollen lymph nodes, and over all not feeling well.','Sputnik'),('2020-07-05',7103462,1528373586,1336584341,'Tachycardia and flushing immediately after shot given, followed by fullness (slight swelling) in mouth, prickly feeling to tongue.','BBIBP-CorV'),('2020-07-05',41506446,1295712826,1982767240,'Patient complained of localized itching at site of injection upon receiving the injection','Sputnik'),('2020-07-05',60003371,1992259980,1477669166,'Fever of 101.6, body aches and headache','BBIBP-CorV'),('2020-07-06',23327057,1578716601,1235110719,'Chills, aches, post dose 2 and left sick within 24 hours of receiving the injection but was fine approximately 16 hours post injection. On or about 2/03/2021 felt intense itching deeply in left flank area. On 2/52011 the pain became so intense that I missed work and went to the hospital, and had concerns there was a problem with my kidneys.   On 2/9  itching,  urning and pain in left flank area and later developed shingles for the first time.','BBIBP-CorV'),('2020-07-06',64794116,1134525132,1386909562,'Swelling at vaccination site, skin red and hot','MODERNA'),('2020-07-07',21450529,1710011689,1003809575,'1/6/2021 1245 am: chills, fever. Body ache, left arm aching, headache,  fatigue  1:30pm: chills, fever, body aches, headache fatigue','MODERNA'),('2020-07-07',39430398,1538444096,1548239858,'Patient states he had a typical reaction the day of the vaccine (low fever, chills, aches, injection site pain) and when to bed earlier than usual because he was tired.  He didn\'t sleep well, and this morning his sleep app indicated his heart rate during the night was between 100-110.  After noticing his heart rate was between 130-140, he called the clinic and was told to go to the ER.  Hospital ER administered several tests and did blood work. The MD\'s determined his heart was fine and it is likely vaccine related.  He is home again and is feeling better (no chills, etc.) and his resting heart rate is now in the low-90\'s.','Covaxin'),('2020-07-08',17066333,1023547353,1689718892,'Approximately 20 minutes after vaccination developed burning sensation in sternum. States non radiating. Felt similar to heartburn. Persistent. No SOB. No changes to pain with deep breathing. Approximately 445 mins post vaccination developed dizziness as well. Patient was seen in clinic and EKG performed. Noted to be SR. Vital signs stable. Patient sent via EMS to local hospital for full workup.','Covishield'),('2020-07-08',26440038,1831142272,1225369119,'CHF, Resp failure, intubated, on Levophed, suspected septic and cardiogenic shock.','Sputnik'),('2020-07-09',22871367,1396926515,1932153285,'On Sunday, 1/17/21, patient was nauseous and vomiting and could not keep anything down at one point vomit was dark in appearance.  Patient receives home dialysis when nurse came to home on Monday, 1/18,  saw condition of patient and sent them to the hospital.  At the hospital it was noted she had redness throughout body, no hives or blisters.  Patient was lethargic, received antiemetic and medication for rash, does not know what medications were.  On Tuesday, 1/19,  she received 2 liter transfusion, discharged on Thursday, 1/21.  Today, Thursday 1/28 patient still feels lethargic and states rash is peeling.','BBIBP-CorV'),('2020-07-09',30627374,1932650405,1609031210,'Soreness Headache','BBIBP-CorV'),('2020-07-09',61645973,1912032897,1033232327,'Within 12 hours was having trouble breathing heart pounding thought I could just rest and could not it was so bad  went to the ER on 2/14/21 @ 8:30 am my O2 was at 87 dropped to 81 BP was 158/101','PFIZER'),('2020-07-09',68314013,1588680714,1972696037,'Massive ischemic stroke with aspiration, unable to arouse on the morning of 1/21/2021 and placed on Hospice with death 1/24/2021','MODERNA'),('