os of my arm it was severe.','CoronaVac'),('2020-07-12',27724127,1619089810,1821050758,'I woke in the morning with nasal congestion. Around 0800 I started with fatigue and malaise. At 1000 I had a temperature of 100.4, took Tylenol 500 mg, and laid down. I got up an hour later feeling fine. Around 1600 hours I felt malaise again and warm. I checked my temperature and it was 100.2. I took Tylenol 500 mg again. I went to bed at 2030 and woke Friday morning feeling completely normal. All of the symptoms had resolved.','PFIZER'),('2020-07-12',67407134,1538153317,1073706594,'Pt. states that he received covid Pzifzer vaccine at 11:17 am on 01/05/2021 to left deltoid IM. Around six to seven minutes  at 11:23 am post vaccination patient started having burning sensation at site, felt flushed, diaphoretic, light-headed, nauseated, and now he is experiencing tingling to bilateral feet. Pt. states that earlier post vaccination he was feeling anxious, but he is no longer feeling anxious. Pt. denies feeling this way post vaccination with other vaccines. Pt. states that he is still having bilateral  feet tingling up to both calves right greater than left.','Covishield'),('2020-07-13',24521564,1609252568,1669475455,'Myalgia, Arthralgia, Fever, 100.1 fever Narrative: right arm pain at site of injection fell ill a couple hours after','CoronaVac'),('2020-07-13',48078723,1407866031,1326022658,'Severe headache, fatigue, and facial flushing.','PFIZER'),('2020-07-14',22021640,1750721726,1346420940,'Rash erythema, warmth, and itchiness to site of injection Narrative: erythema, warmth, and itchiness to site of injection','BBIBP-CorV'),('2020-07-14',51919925,1376910166,1114911401,'Sever muscle aches and joint pain, headache radiating down into neck 6/10, sore throat, pain at injection site','MODERNA'),('2020-07-15',50866447,1811963945,1194833509,'About 45 mins to an hour of receiving the vaccination , i felt  a terrible pounding headache, I took Tylenol ES 500mg after felt relief  but decided to sleep early. When I woke up this morning my injection site arm felt so painful and heavy and i had fevers between 103-101.5 though I took some tylenol 500mg every 6 hours. Tachycardic between 140-120bpm, i still have  terrible headache, muscle & joint pains, extreme fatigue. Some dry cough but no shortness of breath.','MODERNA'),('2020-07-15',57449275,1356402473,1144544842,'40 min. injection - 200/100 - blood pressure - and was sent to ER to get follow up and was there for 90 min, until it was 156/99. And they released me. 10  days of very high blood pressure and headaches. Just started coming down (Blood Pressure) the day before yesterday. 98/72 now. Primary Care doctor - Telemed appt-  had advised me to wait it out a little and now it\'s down. Feel better now. DIdn\'t take anything to treat it. Just rested.  Only worked 1/2 of day of  work- and not a full 8 hr shift on my scheduled shifts. But going back now full time. Blood type RH Negative.','Covishield'),('2020-07-16',52041406,1124419312,1053448589,'Myalgia, NauseaVomiting, Fatigue','Covaxin'),('2020-07-17',36736310,1003844671,1134346166,'Fever, rapid heart rate, and flu like symptoms within 6 hours of receiving vaccine. Extreme abdominal pain coupled with fever began again in the night of 01/26-01/28/2021. Extreme abdominal pain continued and I had to have emergency appendectomy on 01/30/2021.','BBIBP-CorV'),('2020-07-17',51406604,1790072981,1467458265,'She was diagnosed with Transverse Myelitis','Covishield'),('2020-07-18',4690250,1922351733,1457318891,'Arm swollen below the injection site chills body aches','CoronaVac'),('2020-07-19',50847005,1487649950,1538331996,'Fever - 100.7','Covaxin'),('2020-07-19',52281026,1215963996,1063442283,'This patient was hospitalized and subsequently diagnosed with GBS or AIDP','BBIBP-CorV'),('2020-07-20',22248949,1528414612,1649611435,'Approximately 5 hours after receiving my 2nd Pfizer Covid shot, I started to get diffuse abdominal pain & back aching. Seen in the ED 1/8/20 - Negative US, Normal labs - returned to ED 12 hours after D/C for worsening abdominal pain. 1/9/21 - CT showed Appendiciticitis','MODERNA'),('2020-07-20',23929290,1831518588,1164606042,'c/o funny taste 10 min after vaccination Narrative:  10 min after vaccination employee c/o funny taste. Denies numbness/tingling to lips or tongue. No difficulty swallowing. Monitored pt for 30 minutes. Emploees states funny taste has resolved.','CoronaVac'),('2020-07-20',40192329,1891157780,1679685838,'Headache, Fever, Fatigue Headache, fatigue, and fever starting one day after receipt of the vaccine and continuing though 5 days after vaccine. Tested negative for Covid-19 via PCR test on day 5 after vaccine.','MODERNA'),('2020-07-20',66505356,1891115663,1841257540,'Long bone aching pain, involving bilateral humeral bones and left femur.   Pain began on day two and resolved on day five.  I required two doses of ibuprofen to sleep on days three and four.','Covishield'),('2020-07-21',38074578,1346586757,1164497129,'Patient started experiencing a tingling at the injection site.  There was also flushing of the left arm.  Then started to experience right flank and back pain. Never experienced respiratory difficulty or distress.  Patient was sent to the emergency department.  Patient received Solumedrol, Pepcid, and Zyrtec in the emergency department (allergic to Benadryl)','MODERNA'),('2020-07-22',42066901,1215383559,1649546821,'Swelling of throat and tongue, anaphylaxis, hives, redness, swelling','Covishield'),('2020-07-22',43365468,1841285483,1083811335,'ONE WEEK AFTER RECEIVING THE VACCINE, THE PATIENT HAD SWELLING, PAIN, AND A RASH THAT DEVELOPED AROUND THE INJECTION SITE. IT RESOLVED AFTER A FEW DAYS.','MODERNA'),('2020-07-22',44810500,1740591437,1437105327,'2/9 received 2nd vaccine in series. 2/10 mild headache and fatigue. 2/11 worsening headache, extreme fatigue, and general malaise. In bed except for bathroom use and minimal food consumption starting 2/11 until hospitalization on 2/17/2021.','BBIBP-CorV'),('2020-07-22',51622097,1316991615,1467750497,'Moderate tingling to arms, itching throat, and flushing. Vital Signs 1315 - HR 91, RR 24, SPO2 99% Vital Signs 1320 - BP 125/88, HR 86, RR 20, SPO2 100% Vital Signs 1335 - BP 109/80, HR 84, RR 16, SPO2 98% Vital Signs 1345 - BP 123/90, HR 89, RR 16, SPO2 100%','PFIZER'),('2020-07-22',52698382,1215082458,1306907100,'Body aches, fatigue, arm pain(first couple of days), diarrhea and nausea','Covishield'),('2020-07-23',50676145,1467901165,1134150329,'Hospital on 1/2 - then again on 1/5, transferred and admitted to hospital, discharged 1/6 Abnormal reflex/weakness   back pain  paresthesia and weakness of legs abdominal pain  evaluation for possible GBS post covid 19 vaccine','MODERNA'),('2020-07-24',43074656,1669471231,1215236815,'Patient completed 30 min observation (due to hx of anaphylaxis to emgality) and as she was leaving she c/o lips swelling and tingling in throat. Pt was asked to stay for further observation. A few minutes later pt began to cough and stated worsening swelling in throat. Epi given and pt transferred to ED','PFIZER'),('2020-07-25',43045874,1376858837,1669555314,'large rash surrounding injection site.','BBIBP-CorV'),('2020-07-25',66316075,1487814091,1417915109,'Fever, tachycardia,  hypotension, diffuse urticaria','MODERNA'),('2020-07-26',21058499,1417482530,1417212432,'pulmonary embolism that presented with chest pain and inability to take a deep breath, admitted and started on Heparin drip.  Patient transitioned to Apixiban.','ASTRAZENECA'),('2020-07-26',58970086,1518339605,1982767240,'Hives from head to toe, Itching really bad,  nausea , and diarrhea  Took Benadryl','Sputnik'),('2020-07-26',62457621,1891069092,1851466767,'Patient started to have itching on her right side of the neck, then the itching started in the right arm where shot was givien. Patient had redness on the right deltiod. Patient did not have any shortness of breath.  Was given 2 tabs of 25mg benadrly @ 5:40 pm. Patient was watched for 30 mins. Patient did have itching that spread to the whole body.  Patient said last night she cont to have itching all over the body. She took  2 more benadrly @ 10:00 pm. Patient reports that she is still having itching today 01/07/2021. Took a allergy tab in the am.  Patient also reports feeling swollen in the face, neck and hands.','Covaxin'),('2020-07-27',27168199,1841573482,1225258767,'Thyroiditis with hyperthyroidism: 5 days after vaccine developed sweats, 10 days after the vaccine (1/1/21)developed fevers and right sided neck pain, tachycardia, myalgia','BBIBP-CorV'),('2020-07-27',43554672,1326136052,1285670521,'Day of injection developed a nickel sized raised bump at injection site. 1 week after this red area began enlarging; did not start subsiding until 1/5/2021. See photo taken 1/3/2021: perimeter was red and raised. Itching started on 1/4/2021.','PFIZER'),('2020-07-28',39384655,1265458970,1720026255,'SkinRash Narrative:','ASTRAZENECA'),('2020-07-28',44658828,1609262146,1790983237,'Dizziness, flushing','PFIZER'),('2020-07-28',51960347,1356446918,1669407516,'Hives on left arm initially below injection site, but gradually growing in size up towards injection site. Zyrtec has helped. Hives still present but getting better.','Sputnik'),('2020-07-29',51602849,1730100165,1700867892,'She received the vaccine on 12/30/2020 at approximately 4:35 PM. At 7 PM she experienced immediate exhaustion, very hot, and body aches. Her temp when she got home was 102.7. She experienced an all over rash and her temp fluctuated for 65 hours. She went to Urgent Care both on Saturday and Sunday due to the ?burning? of the rash. She received Steroid treatment both days. She is back to work today, however, continues to have burning rash. She was advised by the Urgent Care provider not to receive the second injection, and not to ever receive vaccines with the mRNA component.','Sputnik'),('2020-07-29',51886999,1205804416,1255491239,'Immediately after she felt faint, heart rate 121, felt faint again bp 62/33. Was taken to the ER, within a half hour, she fully recovered. Vitals went back to normal.','PFIZER'),('2020-07-30',21547879,1013378280,1922239326,'Hospitalization-planned Narrative:  Patient with planned admission to the hospital for COVID testing and quarantine prior to admission to rehabilitation, strengthening, and social services to establish new home health care services after the previous provider discontinued services.','PFIZER'),('2020-07-30',50290539,1114461274,1033146691,'hive like appearance at injection site, next day 1/1 followed by redness and hot to the touch, worse on 1/2 went away by 1/3. returned with redness and hot to the touch on 1/5 worse on 1/6 starting to go away today 1/7','Covishield'),('2020-07-30',66110403,1780957084,1720163074,'3pm, day after vaccine, general malaise, fatigue, body aches, no fever. Slept for 2.5 hours and woke up feeling better. Went to bed early and feel fine.','PFIZER'),('2020-07-31',65512418,1386048270,1356509038,'Large localized reaction at injection site. Pain, swelling, redness, lumps under the skin and intense itching lasting for just over 1 week and unresolved but slowly improving. Initial reaction was approximately 10 cm in diameter and lasted for 5 days. Current reaction is approximately 5 cm but itching is worsening.','CoronaVac'),('2020-08-01',15576923,1093743908,1548211774,'Rapid heart rate >170, flushing, chills, shaking, increased blood pressure','CoronaVac'),('2020-08-01',40284051,1255390043,1487631065,'Fever (max temp 38.7C), chills, myalgias, fatigue, sweats. Symptoms began 10 hrs after vaccination and lasted until 36 hrs after vaccination. Unable to work the following two days.','BBIBP-CorV'),('2020-08-01',53338829,1447282611,1023042330,'One hour after vaccination, she experienced itchy throat, facial flushing, tongue swelling, respiratory distress, and abdominal pain and cramping.   Patient self-administered epinephrine injection 0.3 mg in the car on the way home.  Administered a second dose at home 45 minutes later.  Then went to Hospital ER. she was given injections of benadryl and phenergan.  observed and released.','BBIBP-CorV'),('2020-08-02',42564073,1447496997,1790016004,'nauseated; vomited and cannot keep anything down; This is a spontaneous report from a contactable consumer (patient). An 82-year-old female patient received the first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE; lot number and expiry date: unknown), via an unspecified route of administration on the left arm, on 30Jan2021 14:40 at a single dose for covid-19 immunisation. Medical history included diabetes mellitus diagnosed 40 years ago.  There were no concomitant medications and no prior vaccinations within 4 weeks. The patient was nauseated and vomited and cannot keep anything down starting on 31Jan2021 to the date of report. Events did not require emergency room nor physician\'s office visit and no treatment was received. Outcome of the events was not recovered.  Information on the lot/batch number has been requested.','Covishield'),('2020-08-03',3836527,1609241538,1063654044,'patient claimed that she developed arm pain that radiate to the nick and ear aches after 1 hour from receiving the first dose and pain still occuring 3 days after her first dose. patient denies any allergies. patient is taking synthroid for low thyroid level, lipitor for high cholestrol, and effexor for depression. patient was instructed to take over the counter medication ibuprofen or acetaminophen and to perfom cold compression to help with the pain symptoms,','Sputnik'),('2020-08-04',4209451,1881845857,1508825464,'The night of getting the vaccine I was the sickest; fatigue, malaise, body aches, hot and cold sweats, weakness, loss of appetite, dizziness.  The day after I had to call into work due to these symptoms. Since then I?ve continued to feel fatigue, throat swelling / scratchiness, dry cough,  malaise. Also arm soreness.','MODERNA'),('2020-08-04',47651650,1891115663,1063494953,'Developed mild redness, hives, and itching at site of injection on days 2 and 3. Symptoms completely resolved independently on days 4 and 5. On day 6, developed significant welt-like hives, intense burning and itching, and numbness/tingling of entire extremity. Also developed a non-pruritic, flat, diffuse, pinpoint rash to the trunk. Rash and itching resolved with Benadryl. Right upper extremity burning, pain, and numbness persist.','Covaxin'),('2020-08-04',51992211,1023374279,1356560064,'Myalgia Narrative:','ASTRAZENECA'),('2020-08-04',53807800,1780930255,1629013933,'The next day after shot I was very dizzy. Fell on floor going to bathroom. Ears and nose appeared stuffed up. I have only been out of bed 2 days since getting this shot 3 weeks ago. I have tried decongestants, Meclizine for dizziness., Levofloxacin and azithromycin for possible sinus infection..','PFIZER'),('2020-08-04',57740722,1518361880,1598724783,'Myalgia both arms, neck and back','MODERNA'),('2020-08-04',57845577,1659406759,1578557807,'fatigue, nausea, loss of appetite, on side of shot pain on right side of neck all the way down to elbow.  Lasted for 3 days.  arm pain went away and returned 7 days later at the injection site and lasted for 3 days.  arm pain started same evening as shot.  Also had chills that evening only.  Had itching inside right ear and right ear ringing.  Fatigue, loss of appetite and nausea was present for 2 full days after the shot.','MODERNA'),('2020-08-05',3905367,1649631946,1952325029,'Dizziness, Elevated','Sputnik'),('2020-08-05',50220150,1255701207,1861728677,'The covid vaccine that has caused severe abdominal pain/severe pains; This is a spontaneous report from a contactable consumer (patient). An unknown age and gender patient received BNT162B2 (Batch/lot number: Unknown) on 03Feb2021 at single dose for covid-19 immunization. Medical history and concomitant drug were not reported. It was reported that the covid vaccine that has caused severe abdominal pain (hospitalization). I round up in hospital and yesterday was severe pains and they ruled any life threatening issue out, through a CAT scan, blood work and urine specimen, so I just basically wanted to know if anybody else had the problems with the abdominal pain. Outcome of the event was unknown.  Information on the lot/batch number has been requested.','Covaxin'),('2020-08-05',66407486,1790072981,1497751499,'Headache, Myalgia, NauseaVomiting, Chills and pain at injection site','Covishield'),('2020-08-06',43968196,1265899835,1801991666,'Arm swelling and tenderness from wednesday until friday After, could feel hardness and it was itchy from saturday through thursday Still feels hard but no longer itchy Day after felt throat and ear pain but went away within a day.','MODERNA'),('2020-08-07',48496632,1972633212,1932169463,'Summary - ANAPHYLAXIS. Screened via medical questionnaire with no known hx of anaphylaxis after receiving injection.  Less than 10 minutes after receiving injection, pt\'s son reported to staff that pt was overheated and not feeling well. After receiving ice water, pt became non-responsive to questions and developed tongue swelling, blocked airway and audible wheezing. 0.3mg IM epinephrine injected into L thigh. Pt was laid down in empty exam room. Blood pressure 130/80, pulse 96, temp 96.9. Pt able to sit up, answer questions and breathe comfortably without distress within few minutes of receiving epinephrine. Examined by EMS and declined transportation to ER. Called by physician 4 hours later; pt reported doing well.','Sputnik'),('2020-08-08',23250422,1013188333,1972577534,'2 hours, after receiving injection, started feeling nausea, slight headache, very slight sore arm;  3-4 hours later took 3 ibuprofen due to the headache.  Feeling light headedness. Next morning, sore arm was heavy, headache, body aches, temp 99, and nausea; felt unwell; took 3 ibuprofen.   Time off from work to just lay flat and rest for the day.','Covaxin'),('2020-08-08',50088988,1033133855,1467602946,'Severe nausea and vomiting, unable to tolerate PO intake for over 48 hrs and severe vomiting for 36 hrs','ASTRAZENECA'),('2020-08-08',59216204,1902142367,1376532580,'CoughWheeze some mild congestion, scratchy throat post nasal drip Narrative: 12/29 Tested positive COVID','CoronaVac'),('2020-08-09',50224785,1568408995,1952379497,'HPI: 69 y/o woman with minimal PMH of hysterectomy and cystic mass resection in 2016. She presented with c/o fatigue, fevers, shaking chills, SOB/cough, anorexia, N/V/D for the past 6 days (GI symptoms started 2 days ago). Husband reports she has also had periodic confusion during this time. She received her second COVID vaccine 7 days ago and symptoms started the following day.','MODERNA'),('2020-08-10',40236366,1093806325,1063442283,'Miscarriage on 01/03/21  (due date 08/08/21) 2 previous pregnancies with live births (2006,2010)','Covaxin'),('2020-08-10',53818936,1710384896,1700857547,'lip/tongue swelling, tingling','PFIZER'),('2020-08-11',51941661,1891090189,1447319181,'The employee was hospitalized on 1/25/21 and is currently being treated for multiple reasons including IVIG therapy for Guillian Barre.','BBIBP-CorV'),('2020-08-12',46825612,1316219272,1265436208,'Fever Facial tingling, blue nailbeds Narrative:  Facial tingling resolved. Still has low grade fever, fatigue','PFIZER'),('2020-08-12',49756207,1285093443,1679897102,'Red, itchy rash on right arm above elbow for last three days','PFIZER'),('2020-08-12',55882709,1972875847,1912115320,'Developed red rash in the region where the vaccine was administered. It started out very small and has progressively gotten larger in size. Measures approximately 4 x 2.5 in. This is warm to the touch. It is red and blotchy.','MODERNA'),('2020-08-12',59365662,1528008232,1689613259,'In the morning of Thursday February 25 at around 6:5 AM, as I was brushing my teeth, the water was leaking out when swishing from side to side. As the day progress, the right side of my mouth was getting number.  The next morning Friday February 26, the right side of my face was numb, my speech was swirl, eating and drinking became  challenging. I went to the emergency rom at Hospital where the team of doctors diagnosed me with Bell\'s Palsy.  I was given Prednisone and Valtrex for a period of 7 days. Physical therapy as also being advised.  The hospital advise me to follow up with my Primary Care Doctor (schedule for Monday March 1st), and to see a neurologist (waiting for an appt). As of today, the right side of my face has lost mobility.','PFIZER'),('2020-08-13',670636,1154738771,1154310738,'It has been over a week.  Early this week 1/5 I noticed continued mild pain, itching, redness and a keloid on left arm at site of injection.  Very uncomfortable, especiall itchiness.','PFIZER'),('2020-08-13',26371238,1003094772,1376594887,'The next morning after vaccine, patient ran a fever, vomited, and was very tired.  Mom laid her down to sleep and when she checked later, patient had passed away.','Covishield'),('2020-08-13',50110889,1619417581,1881871374,'Resident was noted yesterday to have red itchy rash to his left arm','CoronaVac'),('2020-08-13',54286632,1043659261,1124102736,'fever, body aches, chills, fatigue','Covaxin'),('2020-08-14',60052938,1528008232,1073543567,'1/28/21 5:35 p.m. extreme fatigue (useless), 1/29/21 Muscle pain in both upper arms all day, 1/30/21Intense joint pain in left hip continued 1/31 and 2/1 plus painful to walk, sit down and get up again,  Unable to lead with (before vaccine) good left leg to go up stairs and now am unable to walk on my own because of the hip joint pain and must use a walker or furniture to get around.  Muscle pain in upper left arm has continued and frequently in the upper right arm.  I am scheduled for the second dose of Moderna  Covid-19 vaccine and am  concerned about having same.','ASTRAZENECA'),('2020-08-15',48419388,1740653583,1508002726,'Patient reports she had numbness in her tongue for approx 24 hours after Moderna Covid 19 Vaccine dose #1.  Pt also reports approx one week after receiving first dose of Moderna Cov19 vaccine she had edema to left side of face.   Nurse suggest patient consult with per PCP before receiving 2nd dose of Monderna Covid19 vaccine.  Pt called her PCP office, who suggested  not to receive 2nd dose of vaccine.  Patient currently declines to receive 2nd dose at this time.','CoronaVac'),('2020-08-15',49415490,1619242377,1568884559,'caller (son) stayed w/ the pt for about an hour after he received the vax and the pt stated the only symptoms at that time  was some achiness on the arm around the injection site.  Son went home after that.  He tried to contact him on 3/1/2021 but wasn\'t able to reach him.  On 3/2/21 the brother tried to contact him and wasn\'t able to reach him.  They contacted the police dept on 3/2/2021 around 8:00 AM to do a well check.  Pt was found on the couch like he had fallen asleep but was deceased.  They suspect he probably expired on 3/1/2021.  No autopsy will be conducted per the son.','BBIBP-CorV'),('2020-08-15',52608693,1588981724,1952325029,'SOB, respiratory distress, non-cyanotic.  BP 136/73, Pulse 120, Pulse ox 95%Multiple reddened, swollen hived typed areas with petachie looking areas and welts and broken capillaries with distension of vessels as if they were blocked especially in feet with small knots on bottom of feet that were extremely painful. Look like chillblains pictures. The areas were severely painful, itchy. Patient took large doses Benadryl q 12 hrs and Tylenol x 5 days and cortisone otc topical which burned and he discontinued after first use. Patient refused to go to urgent care or ER or to have ambulance come due to financial constraints and no insurance.  Given referral to free clinics and refused to go. Symptoms resolved by 1/5/2021','ASTRAZENECA'),('2020-08-16',21810757,1497851059,1417994575,'MILD URTICARIA Narrative:','CoronaVac'),('2020-08-16',29088453,1346776150,1811043102,'tested positive to SARS-COV2; tested positive to SARS-COV2; This is a spontaneous report from a contactable consumer (reported for himself). A male patient of an unspecified age received first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE, Solution for injection; lot number and expiry date: not known), via an unspecified route of administration on 28Dec2020 at single dose for COVID-19 immunization. The patient\'s medical history and concomitant medications were not reported. The patient tested positive to SARS-COV2 on 08Jan2021. Today (18Jan2021), he got his appointment to get the second dose. He just wanted to know if he should go to get it or not. The outcome of the event was unknown.  Information on the Lot/Batch number has been requested.','Covishield'),('2020-08-17',22294478,1851547475,1174562797,'Headache Narrative:','Sputnik'),('2020-08-17',41506446,1467446328,1053496406,'Patient complained of localized itching at site of injection upon receiving the injection','Sputnik'),('2020-08-17',42692457,1558743286,1346505641,'Night sweats beginning at unknown time, noticed upon waking at 6:00 AM. Heart rate about 20 points higher than normal throughout course of sleep as evidenced by Apple Watch data.','CoronaVac'),('2020-08-18',4978998,1033372396,1932281201,'on 2/21/2021, I noticed vaccination site was slightly sore again like it had been in days after receiving vaccine and felt a little firm.  On 2/22 I felt a slight discomfort and looked at my arm, discovering redness.  It looked like a welt approximately 2 inches in height by about 5 inches in length, from the injections site to the inside of my arm.  today, on 2/23/2021, I can see that the welt is about 4 inches in height and about 6 inches in width from the inside of my arm to just past the injections site.  The welt is not raised, nor does it have any signs of rash.  It is just pink.  The lower part of my arm below the elbow is 97.2 degrees and the pink area is 97.5 degrees, with an temperature gun.','MODERNA'),('2020-08-18',17066333,1912282435,1922484211,'Approximately 20 minutes after vaccination developed burning sensation in sternum. States non radiating. Felt similar to heartburn. Persistent. No SOB. No changes to pain with deep breathing. Approximately 445 mins post vaccination developed dizziness as well. Patient was seen in clinic and EKG performed. Noted to be SR. Vital signs stable. Patient sent via EMS to local hospital for full workup.','Covishield'),('2020-08-18',39430398,1467765875,1326274036,'Patient states he had a typical reaction the day of the vaccine (low fever, chills, aches, injection site pain) and when to bed earlier than usual because he was tired.  He didn\'t sleep well, and this morning his sleep app indicated his heart rate during the night was between 100-110.  After noticing his heart rate was between 130-140, he called the clinic and was told to go to the ER.  Hospital ER administered several tests and did blood work. The MD\'s determined his heart was fine and it is likely vaccine related.  He is home again and is feeling better (no chills, etc.) and his resting heart rate is now in the low-90\'s.','Covaxin'),('2020-08-19',8970044,1568702611,1578565826,'12/31/2020 very dizzy 1/1/2021 not as dizzy but still dizzy 1/2/2021 still dizzy','CoronaVac'),('2020-08-19',22871367,1770824955,1528134103,'On Sunday, 1/17/21, patient was nauseous and vomiting and could not keep anything down at one point vomit was dark in appearance.  Patient receives home dialysis when nurse came to home on Monday, 1/18,  saw condition of patient and sent them to the hospital.  At the hospital it was noted she had redness throughout body, no hives or blisters.  Patient was lethargic, received antiemetic and medication for rash, does not know what medications were.  On Tuesday, 1/19,  she received 2 liter transfusion, discharged on Thursday, 1/21.  Today, Thursday 1/28 patient still feels lethargic and states rash is peeling.','BBIBP-CorV'),('2020-08-19',63103776,1730545138,1174600431,'Rash and pain at injection site','Sputnik'),('2020-08-20',30627374,1861860041,1154556884,'Soreness Headache','BBIBP-CorV'),('2020-08-20',50140312,1619320793,1720114093,'RECEIVED VACCINE ON 2/9.  FELT QUEASY BUT NOT BAD ON TUES PM AND WED.  THEN FINE WED 2/10 NITE. ON THURSDAY 2/11 RASH STARTED ON LEFT ARM NEAR INJECTION SITE.  TOOK OTC BENADRYL .  STARTED SPREADING TO WHOLE ARM AND UPPER CHEST AND HEAD AND NECK.  SEVERE SHEDDING OF SKIN.  PAINFUL AND ITCHING.  ON SUNDAY 2/14 WENT TO EMERGENCY ROOM AND WAS ADMITTED OVERNIGHT OBSERVATION.  RECEIVED IV LIBRIUM, DIPHENHYDRAMINE, FAMOTIDINE, OLORAZEPAM, METHYLPREDNISOLONE SOD SUC (PF).','PFIZER'),('2020-08-20',75905461,1851426175,1285652024,'Sx: Cough & tightening in throat. Tested Binax for Covid - Negative  POC Test. Tx: Claritin Tablet Personal Inhaler','Sputnik'),('2020-08-21',4505548,1730584988,1528346145,'Myalgia & Fever','ASTRAZENECA'),('2020-08-21',25507019,1407843527,1598851404,'Fever, flu like symptoms, muscle aches, fatigue and pain redness swelling in arm which spread over a large portion of my upper arm. Area on arm looked like 13 bee stings attacked and this swelling and redness lasted until  today, 6 days after the vaccine. I have photos of my arm it was severe.','CoronaVac'),('2020-08-21',67803213,1205384872,1548376320,'Patient is a 99yr old female who got a covid vaccine in the afternoon of 1/10/21 and woke up in the morning of 1/11/21 with altered mental status, weakness, and dysarthria. She was taken from her assisted living facility to the hospital and MRI showed a small stroke in the right medial thalamus. She was also found to have new onset atrial fibrillation. She was treated appropriately for both conditions and discharged to a skilled nursing facility on 1/13/21.','BBIBP-CorV'),('2020-08-22',67407134,1265458970,1962667451,'Pt. states that he received covid Pzifzer vaccine at 11:17 am on 01/05/2021 to left deltoid IM. Around six to seven minutes  at 11:23 am post vaccination patient started having burning sensation at site, felt flushed, diaphoretic, light-headed, nauseated, and now he is experiencing tingling to bilateral feet. Pt. states that earlier post vaccination he was feeling anxious, but he is no longer feeling anxious. Pt. denies feeling this way post vaccination with other vaccines. Pt. states that he is still having bilateral  feet tingling up to both calves right greater than left.','Covishield'),('2020-08-23',10958547,1427469816,1891959854,'EE report symptoms of left arm pain, fever of 101 , chills, and mild body aches. Treatment include Tylenol with symptom improving.','Sputnik'),('2020-08-23',24521564,1104848530,1366453110,'Myalgia, Arthralgia, Fever, 100.1 fever Narrative: right arm pain at site of injection fell ill a couple hours after','CoronaVac'),('2020-08-23',51919925,1982070512,1336140722,'Sever muscle aches and joint pain, headache radiating down into neck 6/10, sore throat, pain at injection site','MODERNA'),('2020-08-24',42933214,1407843527,1073592002,'Extreme soreness and pain in in arm near injection site. Unable to move arm the following day with difficulty 2 days post vaccine Fever Headache','Covishield'),('2020-08-24',48280426,1598001927,1770780017,'coughing up blood, significant hemoptysis -- > cardiac arrest. started day after vaccine but likely related to ongoing progression of lung cancer','Covaxin'),('2020-08-24',50227515,1063879583,1588664775,'Hives, started 24 hours after vaccine administration, present for about 1 week after vaccine dose, improved with antihistamine therapy. no lip/tongue swelling, shortness of breath, vomiting, syncope, hypotension','Covishield'),('2020-08-25',36736310,1780677716,1477865194,'Fever, rapid heart rate, and flu like symptoms within 6 hours of receiving vaccine. Extreme abdominal pain coupled with fever began again in the night of 01/26-01/28/2021. Extreme abdominal pain continued and I had to have emergency appendectomy on 01/30/2021.','BBIBP-CorV'),('2020-08-26',4690250,1154417699,1841348828,'Arm swollen below the injection site chills body aches','CoronaVac'),('2020-08-26',69412681,1831298611,1952325029,'At 5 days post vaccination, patient developed severe left shoulder pain, originally thought to be secondary to chronic shoulder pain and a recent fall, over the next three days it progressed to swelling, severe pain, and limited ROM. He ended up being admitted to the hospital and CT scan showed development of significant soft tissue infiltration around sternum and sternoclavicular joints. This was originally thought to be infectious, but he never developed a fever or leukocytosis and we feel this was most likely an inflammatory process. I have no idea if this was actually a vaccine side effect, but given the proximity in both time a location and the known complication of shoulder pain with the vaccine, it seems reasonable to give you the information to monitor for other similar cases.','CoronaVac'),('2020-08-27',282770,1487108312,1528398203,'12/30/2020 - Pt c/o  low-grade fever about 20 hrs after vaccine dose given.  3 hrs later, c/o temp. 101.6 F.   12/31/2020 - Pt c/o fever, dry cough, fatigue, nausea, light H/A.  Referred her to PMD.','Covaxin'),('2020-08-27',50847005,1376749911,1487759973,'Fever - 100.7','Covaxin'),('2020-08-27',52981463,1982616306,1932292331,'Welted, Red, Raised, Swollen, Hot, Change in size/color. Gets better, then gets worse.  Large area of effect.','Sputnik'),('2020-08-27',56368601,1811259955,1427052786,'Headache, fever, joint pain','BBIBP-CorV'),('2020-08-27',66505356,1760749097,1861530842,'Long bone aching pain, involving bilateral humeral bones and left femur.   Pain began on day two and resolved on day five.  I required two doses of ibuprofen to sleep on days three and four.','Covishield'),('2020-08-28',23929290,1902211162,1255316683,'c/o funny taste 10 min after vaccination Narrative:  10 min after vaccination employee c/o funny taste. Denies numbness/tingling to lips or tongue. No difficulty swallowing. Monitored pt for 30 minutes. Emploees states funny taste has resolved.','CoronaVac'),('2020-08-28',37728638,1285668798,1144274192,'Headache, Myalgia, CHILLS Narrative:  EMPLOYEE REPORTS THAT HE WOKE UP 1/1/2021 WITH CHILLS, BODY ACHES, AND FATIGUE THAT RESOLVED WITHIN 24 HOURS. RECENTLY HAD COVID INFECTION.','CoronaVac'),('2020-08-28',43365468,1790208577,1871587956,'ONE WEEK AFTER RECEIVING THE VACCINE, THE PATIENT HAD SWELLING, PAIN, AND A RASH THAT DEVELOPED AROUND THE INJECTION SITE. IT RESOLVED AFTER A FEW DAYS.','MODERNA'),('2020-08-28',51733380,1245362318,1326149253,'is 5 X 5.5 CM. States redness started on 12/23/2020, redness expanded 12/28/2020 and swelling increased. States the area is painful and redness has heat. Does not feel the skin is taught.','MODERNA'),('2020-08-29',342455,1801996319,1205889219,'After an hour of receiving my vaccine, I started feeling  a little jittery, my heart rate went up to 113. I felt very short of breath. worst when walking and talking that improved with me sitting. Nausea with lots of drool. Around 4:30 I started feeling body aches . Then at 5 on my way home, i started feeling extreme pain in my joints, to where i couldnt hold the steering wheel tight. Around 7:30 I started having shaking and aching. Around 9:30 I ate potatoes, and took motrin and it helped a little. I felt weak and washed out like I ran a marathon.  I was still feeling fatigue and wiped out, I had no energy.  I took my pulse ox and it was 95-96.  I am now having muscle pain at the injection site, and injection site is very sore.','CoronaVac'),('2020-08-29',42066901,1386915650,1306896782,'Swelling of throat and tongue, anaphylaxis, hives, redness, swelling','Covishield'),('2020-08-29',47111732,1922095223,1689618167,'Headache at 4 pm that night but went away after 2 advil. Started with chills and body aches during the night and then fever. Took Advil with little effect. Temp went up to 38.8 by next 24 hours with continued body aches. Continued with Advil. Fever never went below 38 for next 24 hours. but then started to go down along with body aches.  Tired 3 days later temp down to normal.','BBIBP-CorV'),('2020-08-29',50853844,1184826786,1891189122,'High fever continues into second day severe chills body aches constant headache  and cannot sleep','Sputnik'),('2020-08-29',51406774,1619296852,1821100736,'Approximately 24 hours after administration, developed sudden onset of severe headache, nausea, severe abdominal cramps, followed by generalized body aches, pallor, \'brain fog\', and approximately 4 hours later had stabbing chest pain on inspiration. Majority of symptoms passed within 8 hours. Brain fog, headache and fatigue lingered through 12/30/20.','Covishield'),('2020-08-29',53742824,1639559149,1447420732,'Onset of vaccine: 17:19 Onset of symptoms at 17:25 with tongue tingling to entire tongue Onset of other sx at 17:27: red hands  Patient opted to stay in waiting room until hand concern She ambulated without assistance to medical center She was given Benadryl 25 mg po with water, tolerated well at 17:47  VS taken and stable 128/74 RR: 14 Pulse 82  At 18:00, sx of tongue tingling improved, but tinnitus BL worsened - this is common for patient She was discharged to home at 18:07 with her partner Instructed to call PCP in AM, and watch for other developing sx of allergy/anaphylaxis overnight','CoronaVac'),('2020-08-29',54039902,1124565478,1407862642,'Exactly one week post vaccination, woke up to peri injection site erythema, slightly raised with irregular border. Site measured 4cm x 12 cm x 2mm. This was accompanied by a strong metallic taste in mouth that was similar to experience at time of original injection.','BBIBP-CorV'),('2020-08-30',40533547,1134678246,1952331407,'Light headed lasted 3-4 hr','ASTRAZENECA'),('2020-08-30',44810500,1558789339,1366670143,'2/9 received 2nd vaccine in series. 2/10 mild headache and fatigue. 2/11 worsening headache, extreme fatigue, and general malaise. In bed except for bathroom use and minimal food consumption starting 2/11 until hospitalization on 2/17/2021.','BBIBP-CorV'),('2020-08-30',50676145,1457632747,1467436725,'Hospital on 1/2 - then again on 1/5, transferred and admitted to hospital, discharged 1/6 Abnormal reflex/weakness   back pain  paresthesia and weakness of legs abdominal pain  evaluation for possible GBS post covid 19 vaccine','MODERNA'),('2020-08-31',32207810,1992000210,1194920801,'Redness, swelling, itchiness at injection site (left deltoid) that began 7 days after injection','CoronaVac'),('2020-08-31',36419172,1952302887,1790016004,'Patient received a dose of vaccine that may be less than completely effective due to storage conditions.  No adverse effects noted.','PFIZER'),('2020-08-31',66316075,1659756203,1740252915,'Fever, tachycardia,  hypotension, diffuse urticaria','MODERNA'),('2020-09-01',21058499,1881791895,1851582175,'pulmonary embolism that presented with chest pain and inability to take a deep breath, admitted and started on Heparin drip.  Patient transitioned to Apixiban.','ASTRAZENECA'),('2020-09-01',27168199,1609241538,1851302830,'Thyroiditis with hyperthyroidism: 5 days after vaccine developed sweats, 10 days after the vaccine (1/1/21)developed fevers and right sided neck pain, tachycardia, myalgia','BBIBP-CorV'),('2020-09-01',39384655,1376881607,1114274669,'SkinRash Narrative:','ASTRAZENECA'),('2020-09-01',44658828,1437107943,1639145675,'Dizziness, flushing','PFIZER'),('2020-09-03',50290539,1285015560,1558504118,'hive like appearance at injection site, next day 1/1 followed by redness and hot to the touch, worse on 1/2 went away by 1/3. returned with redness and hot to the touch on 1/5 worse on 1/6 starting to go away today 1/7','Covishield'),('2020-09-03',51602849,1881617967,1104849595,'She received the vaccine on 12/30/2020 at approximately 4:35 PM. At 7 PM she experienced immediate exhaustion, very hot, and body aches. Her temp when she got home was 102.7. She experienced an all over rash and her temp fluctuated for 65 hours. She went to Urgent Care both on Saturday and Sunday due to the ?burning? of the rash. She received Steroid treatment both days. She is back to work today, however, continues to have burning rash. She was advised by the Urgent Care provider not to receive the second injection, and not to ever receive vaccines with the mRNA component.','Sputnik'),('2020-09-03',66110403,1720442007,1265414163,'3pm, day after vaccine, general malaise, fatigue, body aches, no fever. Slept for 2.5 hours and woke up feeling better. Went to bed early and feel fine.','PFIZER'),('2020-09-04',6388177,1871592147,1720008931,'Right sided facial tightness pt states similar reaction to alcohol consumption. Moderna Covid 19 Vaccine Lot: 011L20A EXP: 07.03.2021 NDC# 80777-273-99','PFIZER'),('2020-09-04',21547879,1659406759,1912115320,'Hospitalization-planned Narrative:  Patient with planned admission to the hospital for COVID testing and quarantine prior to admission to rehabilitation, strengthening, and social services to establish new home health care services after the previous provider discontinued services.','PFIZER'),('2020-09-04',40284051,1255390043,1790753366,'Fever (max temp 38.7C), chills, myalgias, fatigue, sweats. Symptoms began 10 hrs after vaccination and lasted until 36 hrs after vaccination. Unable to work the following two days.','BBIBP-CorV'),('2020-09-04',42564073,1174811343,1144223579,'nauseated; vomited and cannot keep anything down; This is a spontaneous report from a contactable consumer (patient). An 82-year-old female patient received the first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE; lot number and expiry date: unknown), via an unspecified route of administration on the left arm, on 30Jan2021 14:40 at a single dose for covid-19 immunisation. Medical history included diabetes mellitus diagnosed 40 years ago.  There were no concomitant medications and no prior vaccinations within 4 weeks. The patient was nauseated and vomited and cannot keep anything down starting on 31Jan2021 to the date of report. Events did not require emergency room nor physician\'s office visit and no treatment was received. Outcome of the events was not recovered.  Information on the lot/batch number has been requested.','Covishield'),('2020-09-04',47651650,1851794374,1992045439,'Developed mild redness, hives, and itching at site of injection on days 2 and 3. Symptoms completely resolved independently on days 4 and 5. On day 6, developed significant welt-like hives, intense burning and itching, and numbness/tingling of entire extremity. Also developed a non-pruritic, flat, diffuse, pinpoint rash to the trunk. Rash and itching resolved with Benadryl. Right upper extremity burning, pain, and numbness persist.','Covaxin'),('2020-09-04',51992211,1366697922,1861835423,'Myalgia Narrative:','ASTRAZENECA'),('2020-09-04',52863993,1316297161,1174503197,'Shortness of breath, abnormal ECGs, lack of oxygen to the heart, numbness of legs and arms, tachycardia (130-160) for over 12 hours, difficulty breathing,  bilateral pin point pain in legs, dizzy, syncopal convusions, fainting, hyperventilation, vomiting, chills, headache, heart pain, fever, kidney pain','ASTRAZENECA'),('2020-09-04',53338829,1275937419,1285683987,'One hour after vaccination, she experienced itchy throat, facial flushing, tongue swelling, respiratory distress, and abdominal pain and cramping.   Patient self-administered epinephrine injection 0.3 mg in the car on the way home.  Administered a second dose at home 45 minutes later.  Then went to Hospital ER. she was given injections of benadryl and phenergan.  observed and released.','BBIBP-CorV'),('2020-09-04',65512418,1184826786,1144214032,'Large localized reaction at injection site. Pain, swelling, redness, lumps under the skin and intense itching lasting for just over 1 week and unresolved but slowly improving. Initial reaction was approximately 10 cm in diameter and lasted for 5 days. Current reaction is approximately 5 cm but itching is worsening.','CoronaVac'),('2020-09-05',3905367,1013229947,1780755868,'Dizziness, Elevated','Sputnik'),('2020-09-05',53092874,1023286408,1851652432,'No adverse event. We picked up what was supposed to be COVID-19 Moderna vaccine. Lot numbers and expiration date matched tracking sheet given to us by the agency. Color of medication also matched what was stated on Fact Sheet for Healthcare Providers and regulatory authority website for the Moderna vaccine. Instead, the medication in the vial was actually COVID -19 antibodies meant for hospital use. After administration for 44 individuals, we received call from the agency that the medications had been mixed up. The vials and box that medication came in had no identifying factors to indicate it was not the Moderna vaccine.','BBIBP-CorV'),('2020-09-06',15817254,1578716601,1578791976,'Sweaty/Clammy, vomiting Narrative:','ASTRAZENECA'),('2020-09-06',50220150,1225435423,1790753366,'The covid vaccine that has caused severe abdominal pain/severe pains; This is a spontaneous report from a contactable consumer (patient). An unknown age and gender patient received BNT162B2 (Batch/lot number: Unknown) on 03Feb2021 at single dose for covid-19 immunization. Medical history and concomitant drug were not reported. It was reported that the covid vaccine that has caused severe abdominal pain (hospitalization). I round up in hospital and yesterday was severe pains and they ruled any life threatening issue out, through a CAT scan, blood work and urine specimen, so I just basically wanted to know if anybody else had the problems with the abdominal pain. Outcome of the event was unknown.  Information on the lot/batch number has been requested.','Covaxin'),('2020-09-07',3674219,1811916059,1255491239,'Extreme tiredness, extreme pain in left wrist, cannot sleep, headache, nausea,  irritability,   THESE HAVE BEEN GOING ON FOR A WEEK. I\'ve had to call into work','Covishield'),('2020-09-07',46825612,1740591437,1861539470,'Fever Facial tingling, blue nailbeds Narrative:  Facial tingling resolved. Still has low grade fever, fatigue','PFIZER'),('2020-09-07',48496632,1326046434,1396179255,'Summary - ANAPHYLAXIS. Screened via medical questionnaire with no known hx of anaphylaxis after receiving injection.  Less than 10 minutes after receiving injection, pt\'s son reported to staff that pt was overheated and not feeling well. After receiving ice water, pt became non-responsive to questions and developed tongue swelling, blocked airway and audible wheezing. 0.3mg IM epinephrine injected into L thigh. Pt was laid down in empty exam room. Blood pressure 130/80, pulse 96, temp 96.9. Pt able to sit up, answer questions and breathe comfortably without distress within few minutes of receiving epinephrine. Examined by EMS and declined transportation to ER. Called by physician 4 hours later; pt reported doing well.','Sputnik'),('2020-09-07',50224785,1134194962,1740286301,'HPI: 69 y/o woman with minimal PMH of hysterectomy and cystic mass resection in 2016. She presented with c/o fatigue, fevers, shaking chills, SOB/cough, anorexia, N/V/D for the past 6 days (GI symptoms started 2 days ago). Husband reports she has also had periodic confusion during this time. She received her second COVID vaccine 7 days ago and symptoms started the following day.','MODERNA'),('2020-09-07',51941661,1689770521,1972571750,'The employee was hospitalized on 1/25/21 and is currently being treated for multiple reasons including IVIG therapy for Guillian Barre.','BBIBP-CorV'),('2020-09-07',53818936,1427469816,1760405245,'lip/tongue swelling, tingling','PFIZER'),('2020-09-07',59216204,1679814784,1205079142,'CoughWheeze some mild congestion, scratchy throat post nasal drip Narrative: 12/29 Tested positive COVID','CoronaVac'),('2020-09-08',52316368,1891161451,1316178213,'UrticariaPruritus 9X7 cm induration Narrative: 9X7 cm pruritic, erythematous , warm induration 7d after Vaccination.','ASTRAZENECA'),('2020-09-08',55882709,1821012709,1588930762,'Developed red rash in the region where the vaccine was administered. It started out very small and has progressively gotten larger in size. Measures approximately 4 x 2.5 in. This is warm to the touch. It is red and blotchy.','MODERNA'),('2020-09-08',57706194,1962505123,1154556884,'Resident received second dose of C0VID -19  ON 2/2/21 on  2/3/21 resident had a fall after an episode of syncope','PFIZER'),('2020-09-09',3503783,1851426175,1255399341,'Patient presented to the ED after a mechanical fall resulting in left hip pain. She was found to have a fracture and underwent a left hip hemiarthroplasty. Patient remains hospitalized at this time. Per the EUA, hospitalizations are to be reported irrespective of attribution to the vaccine','Covishield'),('2020-09-09',21589443,1275807703,1528145570,'bilateral facial paralysis, Treatment: Immune Globulin - 5 infusions, steroid, anti-viral; recovering; 6 days','MODERNA'),('2020-09-09',59365662,1104108471,1528000437,'In the morning of Thursday February 25 at around 6:5 AM, as I was brushing my teeth, the water was leaking out when swishing from side to side. As the day progress, the right side of my mouth was getting number.  The next morning Friday February 26, the right side of my face was numb, my speech was swirl, eating and drinking became  challenging. I went to the emergency rom at Hospital where the team of doctors diagnosed me with Bell\'s Palsy.  I was given Prednisone and Valtrex for a period of 7 days. Physical therapy as also being advised.  The hospital advise me to follow up with my Primary Care Doctor (schedule for Monday March 1st), and to see a neurologist (waiting for an appt). As of today, the right side of my face has lost mobility.','PFIZER'),('2020-09-09',68014623,1184099905,1578660155,'Patient\'s wife reported via telephone conversation with current nursing staff that patient had presented outpatient this morning around roughly 10:30AM, where he received his Covid-19 vaccination. He then went grocery shopping with his wife, and presented to home, where he began having notable difficulty swallowing and increased confusion, family had then sat him down in living room chair, where his daughter noted acute onset of tongue, upper/lower lip swelling, and right eye drooping. Patient\'s wife reports that he typically manages all of his home medications by himself, and manages his own ADL\'s without assistance at home. She reports that he did miss his noon dose of Sinemet, otherwise he has not missed any doses of current prescribed medications, and denies any recent start/change to current medication regimen, or OTC medications. Patient had difficulty swallowing scrambled eggs','Sputnik'),('2020-09-10',50110889,1932647278,1578751020,'Resident was noted yesterday to have red itchy rash to his left arm','CoronaVac'),('2020-09-10',54286632,1427097641,1659400729,'fever, body aches, chills, fatigue','Covaxin'),('2020-09-11',23219193,1730100165,1134197957,'I noticed that I had hives on my right forearm. I took 25 mg of benadryl, and the hives went away. This occured at 10:00 PM, approximately 12 hours after the vaccination.','PFIZER'),('2020-09-11',44344591,1598298556,1699929448,'Lymphadenopathy (Axillary, Left Groin, Submandibular)','PFIZER'),('2020-09-11',57928372,1346565306,1790714921,'Headache, muscle pain, minor neck stiffness','MODERNA'),('2020-09-12',66518502,1720442007,1477844082,'The patient presented on the 9th day post-vaccine administration with a significant 7 cm x 5 cm firm urticarial lesion at the site of her vaccination with pruritus and surrounding erythema.  Prior to this point, she was asymptomatic other than a small amount of soreness at the vaccination site with no reaction, lesions or pruritus.','Covaxin'),('2020-09-12',75107372,1982933693,1770633349,'**Pfizer-BioNTech COVID-19 Vaccine EUA** 1/25/2021 - was found unresponsive with left upward gaze deviation at midnight and admitted to hospital (last seen normal around 7 pm 1/24/2021).  Intubated in ED, ABG 6.98/17/186 on 40%, Bicarb <5, Scr 1.4, Lactate 1, Wbc 20.3, BP 101/45-- >95/41, Temp 94.3, RR 23-32.  Acidotic and initially required norepineprine for hypotension management (stopped 1/26/2021 0400 am) 1/26 to 2/1/2021 - supportive care for encephalopathy (anoxic vs. ischemic brain injury), ARF, HTN, MSSA growth in resp culture (no respiratory distress, on antibiotic) 1/28 GCS:E4VTM4; 1/29 GCS: EV4VTM4 with intact protective reflexes, extubated 2 pm 2/1 arousable, follows very simple commands, non verbal','ASTRAZENECA'),('2020-09-13',49415490,1124419312,1487936886,'caller (son) stayed w/ the pt for about an hour after he received the vax and the pt stated the only symptoms at that time  was some achiness on the arm around the injection site.  Son went home after that.  He tried to contact him on 3/1/2021 but wasn\'t able to reach him.  On 3/2/21 the brother tried to contact him and wasn\'t able to reach him.  They contacted the police dept on 3/2/2021 around 8:00 AM to do a well check.  Pt was found on the couch like he had fallen asleep but was deceased.  They suspect he probably expired on 3/1/2021.  No autopsy will be conducted per the son.','BBIBP-CorV'),('2020-09-14',21810757,1285833137,1134535156,'MILD URTICARIA Narrative:','CoronaVac'),('2020-09-14',31448238,1134529076,1902219850,'Bell?s Palsy','MODERNA'),('2020-09-15',4210846,1750791331,1972628618,'Around 2 inch lump at the injection site about 5 days after first injection','CoronaVac'),('2020-09-15',42692457,1619377868,1770714537,'Night sweats beginning at unknown time, noticed upon waking at 6:00 AM. Heart rate about 20 points higher than normal throughout course of sleep as evidenced by Apple Watch data.','CoronaVac'),('2020-09-16',4978998,1013451921,1669409256,'on 2/21/2021, I noticed vaccination site was slightly sore again like it had been in days after receiving vaccine and felt a little firm.  On 2/22 I felt a slight discomfort and looked at my arm, discovering redness.  It