st vaccination, woke up to peri injection site erythema, slightly raised with irregular border. Site measured 4cm x 12 cm x 2mm. This was accompanied by a strong metallic taste in mouth that was similar to experience at time of original injection.','BBIBP-CorV'),('2020-09-28',50853844,1407243835,1588024806,'High fever continues into second day severe chills body aches constant headache  and cannot sleep','Sputnik'),('2020-09-30',40357434,1528063914,1699929448,'Rash Chills, Ftaigue Narrative: Took OTC ibuprofen.','PFIZER'),('2020-09-30',47111732,1609889021,1336140722,'Headache at 4 pm that night but went away after 2 advil. Started with chills and body aches during the night and then fever. Took Advil with little effect. Temp went up to 38.8 by next 24 hours with continued body aches. Continued with Advil. Fever never went below 38 for next 24 hours. but then started to go down along with body aches.  Tired 3 days later temp down to normal.','BBIBP-CorV'),('2020-10-01',342455,1588605711,1649378613,'After an hour of receiving my vaccine, I started feeling  a little jittery, my heart rate went up to 113. I felt very short of breath. worst when walking and talking that improved with me sitting. Nausea with lots of drool. Around 4:30 I started feeling body aches . Then at 5 on my way home, i started feeling extreme pain in my joints, to where i couldnt hold the steering wheel tight. Around 7:30 I started having shaking and aching. Around 9:30 I ate potatoes, and took motrin and it helped a little. I felt weak and washed out like I ran a marathon.  I was still feeling fatigue and wiped out, I had no energy.  I took my pulse ox and it was 95-96.  I am now having muscle pain at the injection site, and injection site is very sore.','CoronaVac'),('2020-10-01',47410881,1134546831,1548233844,'I woke up at 2:00 am and was dizzy and rolled over and was dizzier with Vertigo - couldn\'t sit up I couldn\'t stand up or walk. Son took me to ER - Medical Center - and they put me on an 