ow about the size of my palm.','CoronaVac'),('2020-10-22',6746427,1477612828,1417179011,'SkinRash swelling Narrative:','Sputnik'),('2020-10-22',9652951,1063879583,1982880902,'Chest pain; LBBB (left bundle branch block); NSTEMI (non-ST elevated myocardial infarction); angioplasty & bypass done 1/11/21; discharged home 1/12/21 with referral to radiation oncology and f/u with interventional cardiology.','CoronaVac'),('2020-10-22',23248107,1922256775,1730108739,'dizziness. Patient felt normal after drinking water.  Sx resilved monitored for about 15-20 minutes after symptoms resolved. PSOB, palpitations, chills, ED Precautions discuseed. BP 160/90 Hx High Blood Pressure  T98.0  New BP 151/81 HR 78  #21 allowed to go home advised to contact pcp if symptoms recur or','BBIBP-CorV'),('2020-10-22',46935673,1134165889,1205889219,'bilateral unprovoked Pulmonary emboli','PFIZER'),('2020-10-22',49612233,1366626673,1962418988,'3 WEEKS POST VACCINE AND ARM MUSCLE/SHOULDER HAS PRETTY SEVERE PAIN.  IT HURTS TO RAISE MY ARM ABOVE MY HEAD, SHAMPOO/BRUSH MY HAIR, ETC....','MODERNA'),('2020-10-23',40119036,1073867958,1184925638,'UrticariaPruritus Started with urticaria/pruritus around 3rd day, then redness, swelling, induration, itching started 1/2/201, resolved to redness 1/5/2021.','ASTRAZENECA'),('2020-10-24',3632512,1740647742,1063845576,'Significant soreness, pain lifting arm, tenderness to any touch, redness around 1 in in diameter around injection site for 7 days','PFIZER'),('2020-10-24',29704927,1922190073,1205839180,'Welp and swelling','BBIBP-CorV'),('2020-10-24',54370701,1851539670,1629028253,'On January 26, patient lost his balance and fell, no injury.  On January 28, patient, fell, no injury.  In both cases falls were observed and were not to the head.  On January 29 patient could not maintain his balance.  Taken to  hospital.  MRI revealed large subdural hematoma.  Craniotomy on January 30, by Dr.  Approximately 10 days later, Hbg, was down to 7, unexplained internal bleedi