veloped red, hard, hot area at injection site.  Redness is fading. Hard/swelling lasted about 48 hours.','BBIBP-CorV'),('2020-10-29',40357434,1659689529,1508952821,'Rash Chills, Ftaigue Narrative: Took OTC ibuprofen.','PFIZER'),('2020-10-29',47410881,1144212754,1396859815,'I woke up at 2:00 am and was dizzy and rolled over and was dizzier with Vertigo - couldn\'t sit up I couldn\'t stand up or walk. Son took me to ER - Medical Center - and they put me on an IV and gave me Meclizine. Kept me for obsevation for 36 hours as it was not subsiding (the vertigo). Ruled out stroke with CT scan. They sent me home with Meclizine and I\'m still taking it. I get Vertigo every day still.','Covishield'),('2020-10-29',52060853,1104848530,1053492876,'UrticariaPruritus Reported lip numbness c/ injection, reported to monitor no action. Employee left and called staff and reported hives on upper and lower lips, lips warm to touch Narrative:  Reported lip numbness c/ injection, reported to monitor no action taken. Employee left after 15mins. Employee reported hives on upper and lower lips, lips warm to touch ( text message) no action taken','Sputnik'),('2020-10-29',76603874,1366697922,1225285349,'Received vaccine at 0830 at 1400 developed numbness on left side of face','BBIBP-CorV'),('2020-10-30',22154149,1851539670,1669562880,'An hour after receiving the first dose of the Moderna vaccine I experienced mild blurry vision. This lasted about 30 minutes then went away with no other problems.','Sputnik'),('2020-10-30',37604602,1013314384,1891729752,'Full right side paralyzed, facial pain, shooting body pain','MODERNA'),('2020-10-31',15412445,1164769139,1578855987,'My arm was sore for about 3 days.  On day 8, the area of the injection became red, raised and itchy much like a mosquito bite.  There felt like a 2.5 inch hard knot under the skin and it felt warm.  Day 9, still slightly itch, smaller red area, not raised, no \'knot\'.  Sore when area pressed.  No longer warm.','BBIBP-CorV'),('202