wollen. I did not get an epi shot since I was mostly okay and the EMTs were convinced I had a panic attack so I just went home.','Covishield'),('2021-02-28',836303,1356366850,1679539274,'Headache chills/flushing','Covishield'),('2021-02-28',13566327,1497782122,1922247881,'WHEN I AWOKE ON THE 8TH DAY AFTER BEING VACCINATED, AT 07:00 MY LEFT ARM ITCHED AT THE POINT OF INJECTION.  THIS GOT WORSE AS THE DAY PROGRESSED.  AROUND NOON  AN AREA FROM THE INJECTION SITE TO THE CREASE IN THE ELBOW HAD TURNED RED AND SWOLLEN.   IT ALSO TURNED FLABBY, LIKE MY BICEP WAS A WATER BALOON.  THE REDNESS, SWELLING AND ITCHING  WORSENED UNTIL BEDTIME AT 11:00.  AT 06:00 THE FOLLOWING MORNING ALL 3 SYMPTOMS SEEMED TO BE RECEEDING. THIS WAS CONFIRMED BY MY WIFE.  BY EVENING, EXCEPT FOR AN ANNOYING ITCH, ALL APPAERED NORMAL.','MODERNA'),('2021-03-01',4944824,1477975910,1740273499,'I had my vaccine at 910am 12/30/2020.  I was sitting in the chair and one of the people walking around checking on people asked me how I was doing . I told her I was feeling a little foggy. She gave me a bottle of water and kept checking on me every few mins. At around 935 she took me into the back with the medics to get my vitals. They hooked me up to their defib machine for my vitals. My BP was 190/111. They did it manually and it was 180/110. I was starting a headache. By the time I left my BP was 165/99.  I then went to work. At lunchtime my BP was 148/99. I still had a headache for the rest of the day','Covaxin'),('2021-03-01',60038017,1245765841,1235391129,'Parathesia, dysphagia,  fever, nausea,  vomiting,  loss of voice,  loss  bowel movement','Sputnik'),('2021-03-01',75909329,1013962281,1730187410,'Chills headache nausea vomiting still vomiting and nausea five days later','Covaxin'),('2021-03-02',36160754,1710086665,1013024561,'Trouble breathing. Chest tightness, hives, redness,  started at 10:08 and it was called as a code at 10:15 and they administered epi','CoronaVac'),('2021-03-03',880673,1831591270,1