eeling a little foggy. She gave me a bottle of water and kept checking on me every few mins. At around 935 she took me into the back with the medics to get my vitals. They hooked me up to their defib machine for my vitals. My BP was 190/111. They did it manually and it was 180/110. I was starting a headache. By the time I left my BP was 165/99.  I then went to work. At lunchtime my BP was 148/99. I still had a headache for the rest of the day','Covaxin'),('2021-03-26',22228479,1366998478,1255324216,'Patient developed shortness of breath and tachycardia/palpitations in the evening after receiving the vaccine, as well as pins and needles sensation over her torso.','CoronaVac'),('2021-03-26',42887282,1568403798,1053496406,'Headache, Myalgia, NauseaVomiting, Fatigue, Brain Feels Foggy','MODERNA'),('2021-03-26',50254446,1245318666,1871530378,'I started getting a headache on 12/22 with nasal congestion worsening over night the next day I continued having congestion and headache, I called employee health and received a covid test which was negative. I continued to have headache and congestion for two more days and the 25th I was really tired and  took a nap. By the 26th I felt completely normal','Covishield'),('2021-03-26',50860558,1497296040,1285652024,'Numbness and tingling of face and lips that got progressively worse. Throat swelling','MODERNA'),('2021-03-26',52940003,1104878263,1912950098,'Delirium, started 2-1/2 hours after injection, admitted to the hospital, required IV sedation, Then, 20 hours after vaccine developed fever up to 100.9, and patient developed somnolence but no longer combative, then about 32 hours after vaccine improved to 50% of normal status, 48 hours after vaccine was 90% normal, and then slowly returned to normal over the next 2 weeks','Covishield'),('2021-03-27',36160754,1043260268,1134162464,'Trouble breathing. Chest tightness, hives, redness,  started at 10:08 and it was called as a code at 10:15 and they administered epi','CoronaVac'),('2021-03-27',44640362,1003094772,1558339440,'Left arm pain and headaches and tiredness','MODERNA'),('2021-03-27',48866458,1033561444,1710948336,'Cardiac arrest just stopped breathing fortunately at home wife called 911 within five minutes of noticing not breathing responders there in 3-5 minutes worked on him for 15 minutes at home before transporting to ER hospital. No heart beat pulse etc... used CPR machines and paddles  Patient had walked 6 1/2 miles that morning no problems did about 50-60 miles weekly outside. This was sudden and me, his wife, say it was a reaction to something in shot that contributed to this event- there is absolutely nothing you could say to make believe differently. This happened 1 1/2 hours after getting shot.','Covaxin'),('2021-03-28',880673,1033139068,1215305560,'Shortness of breath beginning 4 days after vaccination. Pacemaker was checked per wife and it was fine.','CoronaVac'),('2021-03-28',25505939,1922256775,1033556253,'flu-like symptom; aches; chills; This is a spontaneous report from a contactable consumer. A male patient of an unspecified age received BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE, lot number and expiration date were not reported), via an unspecified route of administration on an unspecified date at a single dose for COVID-19 immunization. The patient medical history and concomitant medications were not reported. The patient reported that he felt like he had flu-like symptoms, aches and chills on an unspecified date (Event took place after use of product). The outcome of the event was unknown.  No follow-up attempts are possible. Information about Lot/Batch cannot be obtained. No further information is expected.','PFIZER'),('2021-03-28',25518462,1063743441,1679825566,'Myalgia Narrative:','Covaxin'),('2021-03-28',44562116,1609119650,1043217706,'Chills- was occasional, not associated with any fevers. Happened multiple times a day until 12/27/2020 in AM then subsided.','MODERNA'),('2021-03-28',57842671,1023374279,1174596217,