uising noted.   Ice applied and patient monitored for over 30 minutes.  Patient did complain of scratchy throat while being monitored, but refused Benadryl at this time.   Patient will notify her physician of this reaction to the vaccine.','CoronaVac'),('2021-04-02',51821240,1154345767,1033359146,'I was 22 months pregnant  I chose to get the vaccine because I work with Covid patients at hospital as a PA. 8 days after the vaccine, I got a needle stick at work. As part of the work up for this, they checked my ALT and it was markedly elevated (previously well within normal range).','MODERNA'),('2021-04-03',4162802,1013456755,1386635464,'Headache, Myalgia, UrticariaPruritus, NauseaVomiting, metallic taste, LN Swelling','MODERNA'),('2021-04-03',52458099,1861940645,1578565826,'6 days after receiving the first dose, I suddenly noticed a circular area of redness, swelling, and itchiness around the injection site. 3 inches in diameter. It has been 5 days and is still mildly red, swollen, and itchy.','ASTRAZENECA'),('2021-04-04',25823374,1053722132,1437256518,'Moderna vaccine around 2 this afternoon Had initial reaction of flushing and tachycardia; nurse monitored her and symptoms went away about 15-20 minutes later. Around 5:15 pm this evening felt like a flip switched and suddenly felt flushing and itching, hives to chest, and became very lethargic.  EpiPen given at 5:50 and all symptoms resolved.','CoronaVac'),('2021-04-04',52491521,1386048270,1417020462,'Fatigue, wheezing, soreness, palpitations','Sputnik'),('2021-04-04',76505976,1720320740,1316989288,'Employee stated she felt dizzy shortly after receiving vaccine. Assessed by RN and EMT\'s and rested for 30 minutes then went home.','ASTRAZENECA'),('2021-04-05',3478562,1134678246,1063691830,'Left lower lobe Pneumonia with small pleural effusion','Covishield'),('2021-04-05',22210320,1093773582,1457319915,'Severe chills /tremors 14 hours following the second injection that lasted uncontrollably for one hour, headaches, fati