t. She had excruciating pain for 48 hours, especially if she tried to move it. It was better after 4 days, but still is uncomfortable 4 weeks later, when she reported this to us. She reports that she will go to her PCP if the pain does not resolve totally. She has been doing ROM excerises that her cousin who is a PT has recommended for her.','ASTRAZENECA'),('2021-04-20',37929397,1912301193,1922072388,'Raspy voice, hives on lips, itching at mucus membranes. Started around 1/6 at 1500 and carried over to around 0900 on 1/7.  Client states she is used to this kind of reaction and managed it the same way she does with other reactions. 50mg Benadryl in two 25mg doses 6 hours apart, 10mg singulair, and her daily 20mg of prednisone. She did have an epi-pen on hand, but did not use (no difficulty breathing, no swelling in throat or mouth).','ASTRAZENECA'),('2021-04-20',42887282,1972917987,1841257540,'Headache, Myalgia, NauseaVomiting, Fatigue, Brain Feels Foggy','MODERNA'),('2021-04-20',53328338,1104277474,1063544849,'On 1/1/2021, in the early morning, I started having severe shoulder pain in my right shoulder (the arm opposite of the injection site arm).  By the afternoon the pain was so bad that I was unable to lift my arm all the way.  I sent a message to my PCP but have not heard back yet, probably because it is a holiday.  I have been applying ice and heat to the area with little relief.','Covaxin'),('2021-04-20',53853860,1912450958,1720176704,'Severe night sweats for 3 nights in a row.  Severe fatigue for 2 weeks.  No fever.  No cough.  No sick contacts and no contacts became sick.','PFIZER'),('2021-04-20',58732519,1891112033,1144226366,'Red, hot, slightly raised swelling around vaccination site, appeared 8 days after vaccination, slightly itchy, currently the red patch is the size of an open palm, has been visible for 3 days. Not painful or debilitating, just abnormal and slightly uncomfortable','BBIBP-CorV'),('2021-04-20',69507002,1902816911,1972890242,'SkinRash, Rash, 6cm x 2cm circular area of erythema rt deltoid. no discharge, skin is intact Narrative:','PFIZER'),('2021-04-21',840356,1316219231,1851302830,'Very itchy rash in face, neck, ears and spread to arms and chest.','Sputnik'),('2021-04-21',22228479,1700310877,1043385289,'Patient developed shortness of breath and tachycardia/palpitations in the evening after receiving the vaccine, as well as pins and needles sensation over her torso.','CoronaVac'),('2021-04-21',46114500,1558357673,1154595346,'Started the night of the shot with arm soreness , by 12/31/20 I had a fever of 101.4, leg aches, horrible headache Tylenol did not help it at all, nausea , chills','PFIZER'),('2021-04-21',47451185,1013356500,1629062922,'Around 6pm I felt fatigued and tired. I went to bed around 8pm. I could not sleep. Had injection site pain on right arm. Tossed and turned. Had a headache. Became fevered and chilled. Had temperature of 100.1 at 2am on 1/4/2021. Temperature decrease back to 98.3 in the morning hours. Remained fatigue and chilled throughout rest of the day. Minor headache.','MODERNA'),('2021-04-21',50254446,1912282435,1124076559,'I started getting a headache on 12/22 with nasal congestion worsening over night the next day I continued having congestion and headache, I called employee health and received a covid test which was negative. I continued to have headache and congestion for two more days and the 25th I was really tired and  took a nap. By the 26th I felt completely normal','Covishield'),('2021-04-21',52760004,1881652840,1205207735,'Severe headache (worst headache of my life), tremor, weakness, fatigue','Covishield'),('2021-04-21',68064673,1417187212,1992715957,'Patient\'s reaction(s) noted during COVID vaccine observation period: lips tingling like when he eats shellfish; has shellfish allergy  Actions Taken: Vital signs taken and within normal. Pt felt okay enough to go home.  Disposition: Patient declined ED visit','BBIBP-CorV'),('2021-04-21',76307264,1891158564,122501986