loping. Site stayed red for ~48hrs.  Arm was sore, but nothing too bad.  At hour 35 developed fatigue.  Redness started to fade.  Not much activity around site until early morning of 02/22/21 when site started to redden again and rash began to develop.  Site began getting itchy and noticeably hot at 9am.  At 1245pm surrounding skin and other arm surface temps were ~85-86 degrees but area around injection site and on rash was 95.6 to 96.8 degrees.  The reaction is roughly 2/25 (top to bottom)  x 2/5 (side to side) at 1:28pm.','Sputnik'),('2021-04-28',31660483,1215240981,1164780227,'Fatigue and fever on day 5 after vaccination','Covaxin'),('2021-04-28',49164310,1578974580,1043522402,'Patient began to feel faint and lightheaded.','MODERNA'),('2021-04-28',52458099,1689984452,1942297833,'6 days after receiving the first dose, I suddenly noticed a circular area of redness, swelling, and itchiness around the injection site. 3 inches in diameter. It has been 5 days and is still mildly red, swollen, and itchy.','ASTRAZENECA'),('2021-04-28',52491521,1437303146,1750383626,'Fatigue, wheezing, soreness, palpitations','Sputnik'),('2021-04-28',68416071,1518123173,1588638894,'Noticed redness at injection site and and just below injection site around 2 am Tuesday, February 23, 2021.   It\'s not painful to the touch and does not itch.  Some areas look like welts.','BBIBP-CorV'),('2021-04-29',11446838,1013358530,1063411940,'Persistent nausea x48 hours, so far. Half dollar size red, warm, swollen area at injection site since 12 hours post injection. No fevers.','Covaxin'),('2021-04-29',51747343,1619128162,1639132293,'Upon assessment resident noted to have increased respirations, lungs CTA. Resident c/o increased fatigue and muscle aches. VS 202/180, 118, 22, 97.1, 96%.','BBIBP-CorV'),('2021-04-29',52062867,1851547475,1497751499,'Patient received the 1st dose of Moderna and was found deceased in her home the next day.','BBIBP-CorV'),('2021-04-29',53055113,1538266697,1053617571,'Allergic