ven Wed evening...finally Sun was little to none symptoms.','ASTRAZENECA'),('2021-05-01',47803790,1922105568,1851365662,'the patient appeared with a swollen face when the morning shift arrived at 7 am . no signs of respiratory concerns, vitals within normal limits . face swollen and warm to the touch.  the patient was taken to urgent care by her POA. clinic transferred the patient to a local hospital where she admitted to be observed overnight. The Resident returned back to the facility the next day (1/21/21).  Reported received verbal notification from POA that the patient\'s primary physician is recommending to not receive the second dose of the Moderna vaccine.','CoronaVac'),('2021-05-02',30446731,1992701718,1235223421,'Facial itiching with hypersensitive skin started a 2-3 days after injection. Swelling of face and eyes and blotchy facial skin 13 days after injection. Seen by ED physician for steroids and benadryl. Slight decrease in swelling 24-36 hrs post start of steroid regimen.','Covishield'),('2021-05-03',3634744,1043617855,1992961486,'not feeling okay; This is a spontaneous report from a contactable consumer (patient) from a Pfizer-sponsored program. A female patient of an unspecified age received BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE; batch/lot number and expiration date unknown), via an unspecified route of administration on 27Jan2021 at a single dose for COVID-19 immunization. The patient\'s medical history and concomitant medications were not reported. The patient was asking how to register/sign up with V-safe. She doesn\'t know how to use a smartphone. At the end of the call, while transferring to the Consumer Fact sheet, the patient said she is not feeling okay then call got disconnected. The outcome of the event was unknown.  Information on the lot/batch number has been requested.','PFIZER'),('2021-05-03',23457406,1730100165,1669669792,'The day after booster shot extremely lethargic, malaise, dry heaves and diarrhea with low grade fever. I\'m 