really high fever. My fever was 102.8 when I first woke up. I was very nauseous and my fever felt worse. My thermometer would not read any more until my temp came down. I can only guess how high it got but at least 103 degrees. I took Advil Liquid Gells and then my fever broke. I was actually scare for my life. In March I actually caught coronavirus and developed  anti bodies for Covid. I can only guess my body was fighting for it\'s life.','PFIZER'),('2021-05-13',51588884,1922064401,1639123995,'During a Covid-19 Vaccination Clinic for employees, a mixing error occurred with 3 Covid-19 vaccine vials. Nursing mixed and used 3 vials on 10 patients. Proper procedure requires 1.8 mL of Normal Saline 0.9% be added to 1 Pfizer-BioNTech COVID-19 vaccine vial. This quantity (3 vials) should have been enough for 15 patients. Facility pharmacist was called to investigate and found syringes that were used for dilution still had liquid in the syringe. It is believed that nurse mixing vials pressurized contents with backflow into syringe without realizing this had occurred. Volume injected into patient was accurate with double check of 0.3 mL. We are unable to verify proper mixing of vaccine vials was accomplished. All 10 patients are being notified of the potential error.','BBIBP-CorV'),('2021-05-13',57790576,1649663063,1447420732,'Fever, sorness in the injection site, chills. Started to occurs between 4- 7 hours after the injection.','ASTRAZENECA'),('2021-05-13',58732519,1184971368,1851559199,'Red, hot, slightly raised swelling around vaccination site, appeared 8 days after vaccination, slightly itchy, currently the red patch is the size of an open palm, has been visible for 3 days. Not painful or debilitating, just abnormal and slightly uncomfortable','BBIBP-CorV'),('2021-05-14',53328338,1285630392,1538169008,'On 1/1/2021, in the early morning, I started having severe shoulder pain in my right shoulder (the arm opposite of the injection site arm).  By the afternoon the pain was so bad that I was unable to lift my arm all the way.  I sent a message to my PCP but have not heard back yet, probably because it is a holiday.  I have been applying ice and heat to the area with little relief.','Covaxin'),('2021-05-14',68024238,1962840751,1881691681,'Headache FAtigue','PFIZER'),('2021-05-14',76486784,1902828858,1720065212,'Chills, body aches, mild headache, fatigue.','Covaxin'),('2021-05-15',3956852,1629463005,1275557415,'Her father also got the vaccine, and 1 day after had heaviness in his chest. He felt like his chest was trembling; Her father also got the vaccine, and 1 day after had heaviness in his chest. He felt like his chest was trembling; This is a spontaneous report from a contactable consumer. This consumer reported for a 72-year-old male patient (father) that he received BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on an unspecified date at single dose for COVID-19 immunization. The patient medical history and concomitant medications were not reported. It was reported her father got the vaccine, and 1 day after had heaviness in his chest, he felt like his chest was trembling (medically significant) on an unspecified date with outcome of unknown.  Information about lot/batch number has been requested.','BBIBP-CorV'),('2021-05-15',22103668,1417187212,1831177377,'Chills, fever (101); arm sore all night; could not sleep; took Tylenol to bring temp down; nose was running; did not feel like eating;  feeling much better today; no fever, chills, temp normal','MODERNA'),('2021-05-15',37929397,1912004953,1437266962,'Raspy voice, hives on lips, itching at mucus membranes. Started around 1/6 at 1500 and carried over to around 0900 on 1/7.  Client states she is used to this kind of reaction and managed it the same way she does with other reactions. 50mg Benadryl in two 25mg doses 6 hours apart, 10mg singulair, and her daily 20mg of prednisone. She did have an epi-pen on hand, but did not use (no difficulty breathing, no swelling in throat or mouth).','ASTRAZENECA'),('2021-05-15',40632727,1023374279,1295896603,'Generalized Body Aches Fever 102.4 ( today AM) Nausea Rigors and Chills all Night. Severe Headache. Uneasy Gut. Pain at Site and Neck','Covaxin'),('2021-05-16',46114500,1437673423,1760643290,'Started the night of the shot with arm soreness , by 12/31/20 I had a fever of 101.4, leg aches, horrible headache Tylenol did not help it at all, nausea , chills','PFIZER'),('2021-05-16',76307264,1710264304,1912068966,'pt initially noted palpitations and shortness of breath. After several minutes improved and then pt developed lip and tongue swelling','PFIZER'),('2021-05-17',23402912,1518976885,1265421002,'Dizziness & Headache Narrative:  reported that day after the injection woke up with a massive headache and was dizzy. the dizziness lasted half of the day. spent the day in bed.','ASTRAZENECA'),('2021-05-17',52760004,1417403759,1578739611,'Severe headache (worst headache of my life), tremor, weakness, fatigue','Covishield'),('2021-05-18',840356,1700805801,1649432543,'Very itchy rash in face, neck, ears and spread to arms and chest.','Sputnik'),('2021-05-19',658310,1124218102,1568690154,'On the sixth day after the vaccination at the site of the vaccination  on the left upper arm I experienced slight swelling, redness, and itching.','BBIBP-CorV'),('2021-05-19',22417945,1679932636,1245211267,'Dizziness, Headache, malaise, pain and limited ROM in injected arm Narrative:','Sputnik'),('2021-05-19',47451185,1164776548,1003815671,'Around 6pm I felt fatigued and tired. I went to bed around 8pm. I could not sleep. Had injection site pain on right arm. Tossed and turned. Had a headache. Became fevered and chilled. Had temperature of 100.1 at 2am on 1/4/2021. Temperature decrease back to 98.3 in the morning hours. Remained fatigue and chilled throughout rest of the day. Minor headache.','MODERNA'),('2021-05-19',54004202,1861413288,1649546821,'Administration error - Vaccine was under diluted, and patient received dose calculated to be approximately 25% more than recommended.','CoronaVac'),('2021-05-19',68064673,1780193110,1407828718,'Patient\'s reaction(s) noted during COVID vaccine observation period: lips tingling like when he eats shellfish; has shellfish allergy  Actions Taken: Vital signs taken and within normal. Pt felt okay enough to go home.  Disposition: Patient declined ED visit','BBIBP-CorV'),('2021-05-20',3822321,1386913945,1033476593,'My regular menses have completely disappeared when I had previously been regular and my hormone levels went from normal to menopausal levels. I had my levels taken only a month before getting the first vaccine.  I was fine after first dose and got very sick after the second dose and since that time have not had a menstrual cycle or ovulated.','MODERNA'),('2021-05-20',15036055,1548221427,1992045439,'Nausea; Fatigue; Head fog; This is a spontaneous report from a contactable consumer. A female patient of an unspecified age received BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on an unspecified date at single dose for covid-19 immunization. The COVID-19 vaccine was administered at Hospital. Medical history included the patient already had Covid \'more than 90 days ago\'. The patient\'s concomitant medications were not reported. The patient experienced nausea, fatigue, head fog on an unspecified date. The outcome of the events was unknown. Information on Lot/Batch number has been requested.','BBIBP-CorV'),('2021-05-20',26033252,1780672451,1154556884,'Took covid shot Thursday 12/17. On Friday 12/18 had avastin shot to right eye. That afternoon had EXTREME inflammation, irritation, tearing, pain and light sensitivity. Vision became whited out. Saw Dr. sunday 12/20, received two antibiotic shot and steroid shot all to right eye. Prescribed Levaquin po and antibiotic and steroid eye drops. Followed up with retinologist again today 1/4/21, symptoms fairly resolved but vision is still blurry. Hoping to completely regain my sight.','MODERNA'),('2021-05-20',49516120,1376895318,1518922087,'Body aches and chills the following morning after receiving the vaccination.  I was very sluggish and remained in bed for the majority of the day.    I also had a lot of pain at the injection site and couldn\'t lift my arm.  Tylenol resolved the issues for the most part but it was only effective for about three hours prompting me to wait an additional 2-3 hours with the symptoms.   This lasted 24 hours and I felt good as new the following day with minor pain at the injection site.','Covaxin'),('2021-05-21',51424233,1912301193,1447486980,'extreme tiredness and chills','BBIBP-CorV'),('2021-05-21',64826731,1821299140,1699820480,'some mild fatigue that last a few days after injection, site pain 12 hours following shot that lasted about 24 hours.  Upset stomach on 48 hours after vaccination, cramping, lose stool.  Did not cause nausea or vomitting.  resolved within 24 hours.  No other symptoms.  did not seek care.','PFIZER'),('2021-05-22',5740450,1245227982,1891804746,'TIA experienced on 2/13/2021 upon rising from sleep/found lacuner infarct on MRI in ER on 2/13/21','ASTRAZENECA'),('2021-05-22',65338341,1588929210,1326309576,'Moderna vaccine EUA within 4 minutes i began to feel faint, heart started pounding ,immediate headache and was very shaky.  I was laid down, cold compress. It came in waves over a period of 20 minutes. I was given a few sips of water. When it did not resolve I was taken to the ER and given IV fluids.  The doctor said I had an adverse reaction to something in the vaccine. The chief of Infectious disease thought I had a vaso vagel response.  While I am nervous to get the second vaccine , I will go forward and get it..','BBIBP-CorV'),('2021-05-23',25688846,1801940770,1003809575,'When I first got the shot,  my right hand tingled for a few minutes and then it went away.  My arm hurt for About a week after the vaccination my right arm (where I got the vaccination) started to itch.  I felt a slight bump- like a mosquito bite- where the shot happened.  The next day I had a slight rash.  Since then, there is a larger circle around the injection site and it has itched since then.  The rash is still there and it itches off and on- especially when my sleeves rub the wrong way on it.','Sputnik'),('2021-05-24',49164310,1063743441,1659372936,'Patient began to feel faint and lightheaded.','MODERNA'),('2021-05-24',52088733,1063781623,1225189251,'An irregular shaped Blister at site of vaccination was noticed a day after the first vaccine dose, and which then burst producing clear liquid with open skin when the bandage was removed. It healed later with a scar.','PFIZER'),('2021-05-24',52254591,1154302453,1477554137,'States a few minutes of receiving first Covid vaccine (Moderna) complaints of swelling, burning, and itching on L arm which progressed to left neck and ear. Went to see HCP immediately and received Benadryl and steroid shot. Feeling better day after receiving vaccine.','Sputnik'),('2021-05-25',11010372,1710284336,1780736876,'Presented to ED with dizziness and nausea and vomiting and SOB. Na level of 111 (1/27); Cl 82; CO2 17 All other BMP labs WNL.  Urine Osmolality 436; urine sodium 89. Admitted to hospital for treatment. Nephrologist states that she has not prior history of hyponatremia (12/1/20 Na was 139)','MODERNA'),('2021-05-25',31660483,1376670570,1821050758,'Fatigue and fever on day 5 after vaccination','Covaxin'),('2021-05-25',51566322,1134598881,1184707440,'102 degree fever Chills Headache Took three doses of Tylenol over 16 hrs; symptoms subsided with Tylenol and time','ASTRAZENECA'),('2021-05-25',68416071,1093799116,1619080306,'Noticed redness at injection site and and just below injection site around 2 am Tuesday, February 23, 2021.   It\'s not painful to the touch and does not itch.  Some areas look like welts.','BBIBP-CorV'),('2021-05-26',11446838,1831435627,1548204035,'Persistent 