'Sputnik'),('2021-05-28',53055113,1447268735,1093896698,'Allergic reaction; This is a spontaneous report from a contactable consumer (patient). A patient of unknown gender and age received BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE) on unknown date at single dose for COVID-19 immunisation. Medical history and concomitant medications were unknown. The patient had an allergic reaction to the COVID vaccine and she/ he was sent to the ER for treatment. The outcome of the event was unknown. Information on Lot/Batch number has been requested.','BBIBP-CorV'),('2021-05-29',51873697,1710284336,1568629582,'1 week after receiving vaccine, developed itchy rash, swollen, hot to touch, and redness at injection site on 1/4/2021','Covaxin'),('2021-05-30',27320410,1841684412,1457407355,'Tachycardia 160?s, Sharp Left Jaw Pain, Left Facial Swelling, Tingling/Numbness Roof of Mouth and Tongue','CoronaVac'),('2021-05-30',42505658,1083698492,1598792830,'Immediately upon injection, tingling all over lasted for about less than 1 minute.  Within 20 minutes, tingling & facial muscle tightness around mouth.  Twitching & facial mouth muscle tightness for about 4 days, diminishing each day.  Vaccine was given Wed evening...finally Sun was little to none symptoms.','ASTRAZENECA'),('2021-05-30',47803790,1306889878,1396847711,'the patient appeared with a swollen face when the morning shift arrived at 7 am . no signs of respiratory concerns, vitals within normal limits . face swollen and warm to the touch.  the patient was taken to urgent care by her POA. clinic transferred the patient to a local hospital where she admitted to be observed overnight. The Resident returned back to the facility the next day (1/21/21).  Reported received verbal notification from POA that the patient\'s primary physician is recommending to not receive the second dose of the Moderna vaccine.','CoronaVac'),('2021-05-30',50490701,1124078407,1235110719,'This is a spontaneous report from a Pfizer-sponsored program. A contactable consumer reported that a female patient of an unspecified age received first dose of bnt162b2 (PFIZER-BIONTECH COVID-19 VACCINE, solution for injection), via an unspecified route of administration on Dec2020 at single dose for COVID-19 immunization. The patient\'s medical history and concomitant medications were not reported. The patient got the first vaccine a week ago. It was reported that the patient had a migraine today and wants to know if there\'s any side effects of any medication or reactions to migraine medication she is taking at onset of migraines only. She wanted to know if she could take it. The outcome of the event was unknown.','Covaxin'),('2021-05-31',23314893,1578716601,1104850171,'Headache, Myalgia, Fever, Headache, sore muscles, fever and sore throat Narrative:','Covishield'),('2021-05-31',23457406,1477737922,1780724971,'The day after booster shot extremely lethargic, malaise, dry heaves and diarrhea with low grade fever. I\'m now seven days out with continued extreme lethargy and diarrhea.','CoronaVac'),('2021-05-31',30446731,1053743567,1659563641,'Facial itiching with hypersensitive skin started a 2-3 days after injection. Swelling of face and eyes and blotchy facial skin 13 days after injection. Seen by ED physician for steroids and benadryl. Slight decrease in swelling 24-36 hrs post start of steroid regimen.','Covishield'),('2021-05-31',50174938,1215919873,1265491260,'tooth ache; This is a spontaneous report from a non-contactable consumer (patient). A male patient of an unspecified age received first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on 30Jan2021 at single dose for COVID-19 immunisation.  The patient medical history and concomitant medications were not reported.  The patient experienced a tooth ache on unspecified date and after he got the shot they told him not to take paracetamol (TYLENOL) or anything, but didn\'t say for how long. He need to know if he can take paracetamol