ne day - I took Tylenol and Motrin. Was feeling better the day after the symptoms started.','PFIZER'),('2021-06-02',3560786,1871861625,1528398203,'1st dose no symptoms 2nd dose arm sore couldn\'t move it, headache, chills, fatigue, no appetite','MODERNA'),('2021-06-02',50409291,1295088946,1447204250,'Presented to ED with altered mental status. He became fatigued and lethargic with a brief period of unresponsiveness. Could not speak and had a gaze to his left. Could not carry on conversation or answer questions appropriately. Stroke team activated and CT completed. CT negative for bleed. Neurology ordered Alteplase to be administered. Patient then transferred for further evaluation and treatment. Patient had left MCA occlusion with TICI IIb achieved. Admitted to neurology stroke service in ICU following procedure. Started on aspirin with plavix. Rehab referral.','CoronaVac'),('2021-06-02',51336406,1497843593,1336584341,'about 9 cm circumference circle around injection site that is very red, hot, swollen with intermitten itchiness and aches.','Covaxin'),('2021-06-03',878384,1306237391,1275076234,'Started to have soreness in the left arm the day after with body aches the next day (12/30). Then developed low grade fever up to 99.9F, chills, and body aches on 1/1/21.','BBIBP-CorV'),('2021-06-03',15590647,1912032897,1811057946,'Covid Arm:  Day 10 after 1st dose - Huge triangle shaped rash on injection site ca 4w x 6h, warm to touch, itchy; no hardness no welts.  Lasted ca 4-5 days.  Slight fever 99.0 fahrenheit (my usual average 97.9-98.0), very slight headache both lasting ca 1.0-1.5 hours when rash appeared after showering.   Since then have received 2nd dose (Moderna #006M20A) same arm as 1st dose;  day 7 and no side affects. I have also reported this on V-Safe App.  (Have picture to share if needed.)','CoronaVac'),('2021-06-03',48470205,1831511955,1922075480,'5 minutes after receiving vaccine I started feeling ?heavy ?. This progressed until I was diagnosed with Covid pneumonia and hospitalized on 1/17/21. I must have had asymptomatic case of Covid that was escalated by vaccine.','ASTRAZENECA'),('2021-06-04',24902408,1003015140,1780905059,'My right neck shoulder region started hurting approximately 7 hours after the vaccination and progressively increase in pain. I took Tylenol 1300mg on Tuesday evening. I woke up Wednesday morning with some discomfort and decided to take another dose of Tylenol 1300mg approximately 10:00 am. The pain increased and I took another dose of Tylenol 1300 mg approximately 1500. Tylenol was not relieving my discomfort and approximately at 1800 I took Celebrex 200 mg . I went to bed at 2200. Lying down was difficult. I could not turn my head from side to side without excruciating pain. I finally went to sleep. I woke up Thursday morning pain free.','BBIBP-CorV'),('2021-06-04',28414556,1902828858,1720068737,'patient passed away within 60 days of receiving a COVID vaccine','Covaxin'),('2021-06-04',64796096,1518987296,1245268838,'Fever, nausea, body aches','CoronaVac'),('2021-06-05',51907054,1922476878,1982880902,'MY UPPER ARM/MUSCLE WHERE I GOT THE SHOT IS EXTREMELY SORE.  IT IS STILL SORE I THOUGHT THE SORENESS WOULD GO AWAY .  I CANT LIFT MY ARM LEVEL TO THE GROUND IT IS SO SORE I CANT HARDLY SLEEP ON IT , WAKES ME UP OUT OF A DEAD SLEEP, WHEN I PUT DEODORANT ON IT HURTS TO LIFT MY ARM TO THAT LEVEL.  IT IS A STRUGGLE TO PUT MY ARM OVER MY HEAD.','Covishield'),('2021-06-06',47046257,1083073373,1023010964,'Left T7 herpes zoster','MODERNA'),('2021-06-07',24409656,1649631946,1235132747,'Administration error - Vaccine was under diluted, and patient received dose calculated to be approximately 25% more than recommended.','CoronaVac'),('2021-06-07',39650144,1346669413,1093913212,'fist size red area with some burning and itching. On day 6, red area began increasing in size and burning and itching increased significantly','ASTRAZENECA'),('2021-06-07',65622117,1578554887,1740261601,'Patient felt warm and dizzy and fainted twice during monitoring period.','MODERNA'),('2021-06-08',15350496,1104976323,1285670521,'Patient complained of shortness of breath, chest tightness, and throat closure','ASTRAZENECA'),('2021-06-08',39621063,1528323771,1720080864,'emesis bright yellow in color, liquid BM, increased respirations','ASTRAZENECA'),('2021-06-08',75109565,1669860250,1699929448,'Cardiogenic shock occurred on 2/10/2021,  approximately 12 hours after patient received her 12th dose of pemetrexed/pembrolizumab and 4 days after COVID vaccine. Coronary angiography was done on 2/10/2021 and no significant coronary narrowing or blockage were noted. Baseline troponin on 2/10/21 was 0.02 and later on 2/10/21, troponins were 9.99 & 25.27. Creatinine increase from 1.2 to 3.4 within 24hours, and AST/ALT increased from 23 & 31 to  4,220 & 4,786 respectively on 2/11. Patient expired on 02/11/2021.','Covaxin'),('2021-06-09',39158472,1124485032,1669454856,'Have diverticulosis-bleeding issue and had severe bleed that started on 2/24 and subsided on 2/25-26','MODERNA'),('2021-06-09',39624088,1194781864,1962513440,'01/05/21: nausea 01/06/21: nausea and headache 01/07/21:nausea, head ache, muscle/joint pain','Sputnik'),('2021-06-09',44022621,1841501343,1265533939,'Injection site pain and tenderness (3/10 worsening to 6/10 within 24 hours then 0/10 at 48 hours).  Chills developed at 24 hours post injection and lasted 30 mins.  Fatigue onset at 24 hours, persisted through 48 hours post administration.  Headache onset at 24 hours (pain rate 8/10 and persisted for 6 hours).','PFIZER'),('2021-06-09',76702756,1760668271,1922072388,'This is an 82-year-old female with history of cerebellar degeneration, who had her first COVID vaccine today around 11  a.m. she was in her usual state of health prior to that time. About two  and half hours afterwards she became nauseated.  She had several bouts of  emesis and then had a fall.  She was found to be hypotensive and  bradycardic.  The ambulance crew actually gave her atropine at the same  because she had a pulse in the 30s, improved her quickly and she presented to the ER.  She is to remain very orthostatic, received several liters of  IV fluid as now symptomatically better.  She remains a little nauseated.   She denies any headache, diarrhea, fatigue, or myalgias.  She does not  feel quite right.  She is still dizzy with sitting up.','BBIBP-CorV'),('2021-06-10',51588884,1134490006,1326038142,'During a Covid-19 Vaccination Clinic for employees, a mixing error occurred with 3 Covid-19 vaccine vials. Nursing mixed and used 3 vials on 10 patients. Proper procedure requires 1.8 mL of Normal Saline 0.9% be added to 1 Pfizer-BioNTech COVID-19 vaccine vial. This quantity (3 vials) should have been enough for 15 patients. Facility pharmacist was called to investigate and found syringes that were used for dilution still had liquid in the syringe. It is believed that nurse mixing vials pressurized contents with backflow into syringe without realizing this had occurred. Volume injected into patient was accurate with double check of 0.3 mL. We are unable to verify proper mixing of vaccine vials was accomplished. All 10 patients are being notified of the potential error.','BBIBP-CorV'),('2021-06-10',68024238,1801143235,1104025899,'Headache FAtigue','PFIZER'),('2021-06-11',401289,1942346234,1811920028,'Acute sensorineural hearing loss right ear','BBIBP-CorV'),('2021-06-11',42054216,1285650903,1124090790,'Approximately 20 minutes post injection patient felt tingling/numbness in the left pinkie finger, migrated to right pinkie finger with one hours.  Acetaminophen','MODERNA'),('2021-06-11',50418187,1073686101,1689939886,'Same day injection site pain. Next day had flu-like sx\'s, which resolved. This AM developed erythema, induration, pruritus, warmth just below injection site. No acute SOB.','ASTRAZENECA'),('2021-06-11',75012234,1619941218,1932287653,'Patient presented to ED with chest pain radiating to the back, as well as left arm numbness, and lightheadedness. Patient was placed in observation unit - serial troponin negative, CTA showed no PE, mild ectasia of the distal ascending thoracic aorta. She was advised to follow up with PCP and cardiology for outpatient stress test. Per the EUA, hospitalizations are to be reported irrespective of attribution to the vaccine','CoronaVac'),('2021-06-11',76486784,1457579955,1073507380,'Chills, body aches, mild headache, fatigue.','Covaxin'),('2021-06-12',22103668,1689118440,1306295092,'Chills, fever (101); arm sore all night; could not sleep; took Tylenol to bring temp down; nose was running; did not feel like eating;  feeling much better today; no fever, chills, temp normal','MODERNA'),('2021-06-12',39182770,1366998478,1629030655,'Swelling pain redness hives heat','Sputnik'),('2021-06-12',39564668,1255798526,1639191646,'Injection site bruise(bleed a lot at injection ) Itchy, red, swollen(harden) right below the injection site','CoronaVac'),('2021-06-13',860435,1609119650,1508866575,'right arm started tingling about 15 minutes after vaccine. Rash started on left wrist/forearm area. Took Benadryl and Zyrtec...symptoms subsided.','BBIBP-CorV'),('2021-06-13',3956852,1164776548,1538376793,'Her father also got the vaccine, and 1 day after had heaviness in his chest. He felt like his chest was trembling; Her father also got the vaccine, and 1 day after had heaviness in his chest. He felt like his chest was trembling; This is a spontaneous report from a contactable consumer. This consumer reported for a 72-year-old male patient (father) that he received BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on an unspecified date at single dose for COVID-19 immunization. The patient medical history and concomitant medications were not reported. It was reported her father got the vaccine, and 1 day after had heaviness in his chest, he felt like his chest was trembling (medically significant) on an unspecified date with outcome of unknown.  Information about lot/batch number has been requested.','BBIBP-CorV'),('2021-06-14',21294128,1659514073,1245673680,'Starting 6 hours after the vaccine was given, I had severe pain that lasted for 3  full days and prohibited me from moving my arm.  It felt like my shoulder was broken.  The pain has mostly subsided, but I still do not have full range of motion.  In fact, I cannot take off my own shirt, because I can\'t do the movement of pulling and lifting my shirt over my head.  It hurts, but at  the same time feels like a pressure point that limits the movement.  Heat seems to make it feel better for a few minutes, as well as deep tissue massage - but this only lasts for a few minutes.  I feel handicapped.  At this point I DO NOT want the 2nd dose  because it could injure my shoulder more.  And I don\'t want it in my other arm for fear of having two arms that I can\'t use.','Covishield'),('2021-06-15',22228979,1003346768,1104937622,'Low degree fever (99.8 F) in the night of 01/02 until the afternoon of 01/03. Sore left arm and feeling unwell throughout the day.','Sputnik'),('2021-06-15',23402912,1346295458,1881740553,'Dizziness & Headache Narrative:  reported that day after the injection woke up with a massive headache and was dizzy. the dizziness lasted half of the day. spent the day in bed.','ASTRAZENECA'),('2021-06-15',40632727,1558659292,1447204250,'Generalized Body Aches Fever 102.4 ( today AM) Nausea Rigors and Chills all Night. Severe Headache. Uneasy Gut. Pain at Site and Neck','Covaxin'),('2021-06-15',52637968,1043260268,1700820818,'high blood pressure for several days afterword','Covishield'),('2021-06-15',57788195,1811379639,1144223579,'Patient had sharp pains in arm after COVID-19 vaccine near injection site. Observed patient for 30 minutes and gave a cold compress. Patient returned to work and later reported palpitations and heart racing. Checked vitals  BP 130/80 and HR in the 80\'s. HR later jumped to 100\'s.','Sputnik'),('2021-06-16',22417945