21-06-19',3930712,1134527831,1972551356,'Report HA that improved with Tylenol','CoronaVac'),('2021-06-19',5740450,1275903981,1356312771,'TIA experienced on 2/13/2021 upon rising from sleep/found lacuner infarct on MRI in ER on 2/13/21','ASTRAZENECA'),('2021-06-19',43449890,1902861222,1073888236,'Racing heart 40 minutes after vaccination Large redness and itching where the vaccine was done on left arm  2.5 days after vaccination','Covaxin'),('2021-06-19',46854296,1083985402,1083649008,'Resident passed away 2 days after receiving the vaccine. oxygen level has decreased shortly 1 day after receiving the vaccine.','PFIZER'),('2021-06-19',51424233,1093913410,1326013533,'extreme tiredness and chills','BBIBP-CorV'),('2021-06-19',53097948,1568766327,1528398203,'Diarrhea, near syncope, extreme fatigue. Started 30 hours post injection & continued x 48 hours.   Site soreness/edema 24 hours after injection that increased to extreme sensitivity at site after 30 hours which lasted 24 hours.  Left deltoid swollen x 1/2 more than usual size started 36 hours after injection and lasted 36 hours.','Covishield'),('2021-06-20',52254591,1528008232,1609285865,'States a few minutes of receiving first Covid vaccine (Moderna) complaints of swelling, burning, and itching on L arm which progressed to left neck and ear. Went to see HCP immediately and received Benadryl and steroid shot. Feeling better day after receiving vaccine.','Sputnik'),('2021-06-20',52388789,1023127966,1033149422,'Severe headaches; This is a spontaneous report from a contactable consumer from a Pfizer Sponsored Program. A patient of unspecified age and gender received bnt162b2 (BNT162B2 PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on 30Dec2020 at a single dose for immunization. The patient\'s medical history and concomitant medications were not reported. The patient experienced severe headaches on an unspecified date. The event outcome was unknown.   Information on the lot/batch number has