15669,'Day after receiving the vaccine, the patient complained of abdominal pain which worsened over the day.  She went to the ED and was hospitalized.  Abdominal pain complaints increased and continued, she decompensated rapidly, was intubated and subsequently died 3 days later.  Imaging results showed, progressive ovarian cancer in the bowels.  Blood culture revealed that she had E.Coli in her blood.  It is thought that this is NOT related to the vaccine.','MODERNA'),('2021-07-02',48154324,1568421816,1376502476,'red rash at injection site; itching at injection site; injection site warm to touch; left arm pain radiating from injection site to fingers.','Covishield'),('2021-07-03',22030487,1831179118,1548433378,'Parasthesias began in my lower extremities intermittently about 36 hours following administration. These spread to my upper extremities and became consistent. Occasionally will appear in lips and trunk. These are associated with sensation of numbness and some discomfort in my extremities. I\'m also experiencing significant brain fog, difficulty concentrating, and fatigue. Headaches are occurring about every other day.  Symptoms are present currently and have remained relatively consistent in severity.  Was evaluated by urgent care on December 28 and encouraged to observe. Was evaluated in the ER by neurology on January 4. There leading hypothesis is vaccine related immune response. Neurologic exam was largely normal, being evaluated by a specialist in the coming days.','BBIBP-CorV'),('2021-07-03',39880643,1063763571,1558354043,'blood clots on lungs  2 days in hospital   on blood thinner for the last 10 days','PFIZER'),('2021-07-03',65622117,1538275227,1528019338,'Patient felt warm and dizzy and fainted twice during monitoring period.','MODERNA'),('2021-07-04',15350496,1285650903,1952329401,'Patient complained of shortness of breath, chest tightness, and throat closure','ASTRAZENECA'),('2021-07-04',40039581,1316248339,1487697348,'Tingling lips 1100am, mild chest tightening 1115am','Covaxin'),('2021-07-04',40434540,1285699538,1215911466,'Headache, fever, uncontrollable shaking, heart rate 104, bp 140/86 called 911, ambulance ride to above Hospital. IV on route,  Kept over night in hospital. Shake stopped in about 2 hours , continued rapid heart for awhile and fever, Hospital gave him tylenol.  after about 4 hours his bp fell to 89 over 64  ... thus keeping him in hospital.   They did multi tests.   found an unknown infection in his blood.   Patient has had an elevated WBC but in hospital it was 50,000.   two weeks ago at his primary Dr.  it was 40,000.   He walks with a walker and cane, however he has lost his balance and fallen 3 time since vaccine and one of those was today.','MODERNA'),('2021-07-04',53842881,1467460303,1275086688,'Three days after second COVID-19 vaccine, patient became lethargic.  Due to advance directive that instructed that no life saving interventions to take place, patient continued to decline and expired on 29 January 2021.','ASTRAZENECA'),('2021-07-05',39621063,1659657740,1043218597,'emesis bright yellow in color, liquid BM, increased respirations','ASTRAZENECA'),('2021-07-05',61227084,1013201912,1043218597,'migraine; This is a spontaneous report from a contactable consumer. A female patient of an unspecified age received the first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on 26Jan2021 at single dose for COVID-19 immunization. The patient\'s medical history and concomitant medications were not reported. The reporter wanted to know if the patient could take Sudafed PE for a migraine that she was experiencing from an unspecified date. The patient received the first dose of the vaccine yesterday afternoon (26Jan2021), in which her doctor recommended her to not take ibuprofen within the first 24 hours of the vaccine. The outcome of event was unknown.  Information about lot/batch number has been requested.','PFIZER'),('2021-07-06',62069485,1972893758,1154474435,'Woke up with Right Arm Pain and SEVERE Body aches.  Took long hot shower, 600mg Motrin.','PFIZER'),('2021-07-06',76702756,1841538287,1043523046,'This is an 82-year-old female with history of cerebellar degeneration, who had her first COVID vaccine today around 11  a.m. she was in her usual state of health prior to that time. About two  and half hours afterwards she became nauseated.  She had several bouts of  emesis and then had a fall.  She was found to be hypotensive and  bradycardic.  The ambulance crew actually gave her atropine at the same  because she had a pulse in the 30s, improved her quickly and she presented to the ER.  She is to remain very orthostatic, received several liters of  IV fluid as now symptomatically better.  She remains a little nauseated.   She denies any headache, diarrhea, fatigue, or myalgias.  She does not  feel quite right.  She is still dizzy with sitting up.','BBIBP-CorV'),('2021-07-07',39624088,1972961472,1164699161,'01/05/21: nausea 01/06/21: nausea and headache 01/07/21:nausea, head ache, muscle/joint pain','Sputnik'),('2021-07-08',26030569,1568577021,1386655165,'Shortly after receiving the vaccination pt. complained tightening in thought area. Assessment revealed no obvious signs of edema or anaphylactic incident.  Pt. administered 50mg Benadryl PO.  Pt. monitored 1 hour+ with no changes in condition and no additional complaints.','Covishield'),('2021-07-08',42054216,1548686934,1568565984,'Approximately 20 minutes post injection patient felt tingling/numbness in the left pinkie finger, migrated to right pinkie finger with one hours.  Acetaminophen','MODERNA'),('2021-07-09',25160420,1861669038,1316132137,'Headache Narrative: Mild headache started 2 minutes after injection','Covishield'),('2021-07-09',66518345,1972512770,1346326428,'Fever Sore arm around 12 noon; chills 10pm for an hour, then fever 101-3F; relieved with tylenol','PFIZER'),('2021-07-09',75012234,1568620375,1760643290,'Patient presented to ED with chest pain radiating to the back, as well as left arm numbness, and lightheadedness. Patient was placed in observation unit - serial troponin negative, CTA showed no PE, mild ectasia of the distal ascending thoracic aorta. She was advised to follow up with PCP and cardiology for outpatient stress test. Per the EUA, hospitalizations are to be reported irrespective of attribution to the vaccine','CoronaVac'),('2021-07-10',401289,1477637338,1659697571,'Acute sensorineural hearing loss right ear','BBIBP-CorV'),('2021-07-10',38602446,1134527831,1023065240,'Moderna COVID?19 Vaccine EUA Moderna vaccine vial was opened on 12/30/2020, and the vial was placed back into the fridge later that afternoon, like 2-3 hours after puncture. The opened vial was reused for this patient the next morning for an injection when it should have been discarded. No adverse events occurred','PFIZER'),('2021-07-10',50418187,1013378280,1902219850,'Same day injection site pain. Next day had flu-like sx\'s, which resolved. This AM developed erythema, induration, pruritus, warmth just below injection site. No acute SOB.','ASTRAZENECA'),('2021-07-10',64604181,1164859195,1841376969,'Itching on various areas of body with hives and welts, redness. Took 50 mg Benadryl, 12 mg methylprednisolone, and applied hydrocortisone. Had to reside after 4-5 hrs, and again the next morning. Went to urgent care clinic and received 60 mg depo-prednisolone and went home and took more Benadryl and applied more hydrocortisone cream. Rash all over the body.','Covaxin'),('2021-07-10',75001302,1568620375,1497839351,'severe diarrhea; This is a spontaneous report from a contactable consumer (patient\'s wife). A male patient of an unspecified age received BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration in Jan2021 at single dose for COVID-19 immunization. The patient medical history and concomitant medications were not reported. Reporter was to report a possible side effect. The patient experienced severe diarrhea in Jan2021. Outcome of the event was unknown.  Information on the lot/batch number has been requested.','PFIZER'),('2021-07-11',4809673,1194267088,1326309576,'Patient is currently hospitalized in Hospital with Covid. His Wife reported admission with O2 Sat at 48.  He has Pneumonia, Ketones of 4, borderline ketoacidosis, and Fluid on his lungs,.','ASTRAZENECA'),('2021-07-11',39564668,1801996319,1467653196,'Injection site bruise(bleed a lot at injection ) Itchy, red, swollen(harden) right below the injection site','CoronaVac'),('2021-07-12',21490838,1386874188,1700806569,'Blood clot in her leg; This is a spontaneous report from a non-contactable consumer (patient). This female patient of unspecified age (reported only as 72) received the first single dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE) on an unknown date, for COVID-19 immunization. Medical history and concomitant medications were not reported. The patient believed she may have a blood clot in her leg since an unspecified date. She had the second vaccine dose scheduled on an unknown date. Event outcome was unknown.  No follow-up attempts are possible; information about lot/batch number cannot be obtained.','ASTRAZENECA'),('2021-07-12',39182770,1619164589,1154556884,'Swelling pain redness hives heat','Sputnik'),('2021-07-12',52009069,1194715821,1194109413,'SORENESS AT INJECTION SITE Narrative:','Sputnik'),('2021-07-12',57890173,1164695102,1578557807,'Headache, Seizures, UrticariaPruritus & NauseaVomiting Narrative:  NORMALLY HAVE SEIZURES EVERY EVENING, BUT THIS SEIZURE ABOUT 5.5 HRS POST VACCINE WAS MUCH MORE SEVERE WITH EYES ROLLING IN BACK OF HEAD AND FELT IN A DAZE. TOOK AN EXTRA DOSE OF CLONAZIPAM 1 MG','Covishield'),('2021-07-13',42118049,1548471386,1629390679,'-Fever/chills -extreme body ache -bones hurt','Sputnik'),('2021-07-15',860435,1164460390,1730108739,'right arm started tingling about 15 minutes after vaccine. Rash started on left wrist/forearm area. Took Benadryl and Zyrtec...symptoms subsided.','BBIBP-CorV'),('2021-07-15',57948323,1992861298,1477655959,'pfizer-Biotech/Covid-19 vaccine  flu like symptoms- nausea, light headed, trouble focusing, stuffy nose, body aches, fever and chills but no actual fever- body just felt really warm. problems breathing at times (like a panic attack), headache, stiff neck, fatigue-- I fell asleep in my car because I was so tired.  sore arm,  irritability, When trying to lie down, I could not get comfortable, I found myself lying on the floor since it was cold, this is not normal behavior. i felt super sick. I was crawling on the floor because of how dizzy and tired i felt. It felt like  a really bad drunk or hangover. noises were too loud, it felt horrible. I don\'t know if it is done.','BBIBP-CorV'),('2021-07-15',68107550,1467998732,1659396695,'metallic taste','Covishield'),('2021-07-16',21294128,1528515145,1649286519,'Starting 6 hours after the vaccine was given, I had severe pain that lasted for 3  full days and prohibited me from moving my arm.  It felt like my shoulder was broken.  The pain has mostly subsided, but I still do not have full range of motion.  In fact, I cannot take off my own shirt, because I can\'t do the movement of pulling and lifting my shirt over my head.  It hurts, but at  the same time feels like a pressure point that limits the movement.  Heat seems to make it feel better for a few minutes, as well as deep tissue massage - but this only lasts for a few minutes.  I feel handicapped.  At this point I DO NOT want the 2nd dose  because it could injure my shoulder more.  And I don\'t want it in my other arm for fear of having two arms that I can\'t use.','Covishield'),('2021-07-16',21972989,1871643536,1982684452,'A few hours post vaccine, developed splotches and a scratchy throat.  Took a Benadryl which resolved those symptoms. Wed, woke up with terrible headache, nausea and kidney pain, no other urinary symptoms or fever. Took Tylenol and Advil alternating between the two