nd called lyft to drive her home @  0925.  Pt. was advised to call an acquaintance to drive her home but she was unable to find anyone and chose to call lyft.','Sputnik'),('2021-07-19',34948910,1487628046,1962605816,'Systemic: Other- pt had history of copd and DNR on file. approx 3 1/2hr after vaccine pt had sob and lowo2 sat, emergency services called, pt passed on their arrival.staff felt due to pt existing condition','Covishield'),('2021-07-19',50233282,1063641777,1568565984,'Queasy and cold chills','Covaxin'),('2021-07-19',51508401,1821326760,1295823938,'Moderna COVID-19 Vaccine EUA A rash approximately the 2 long by 1 wide developed.  It worsened the next day, but then started to go away and is almost completely gone now.','PFIZER'),('2021-07-19',54794847,1215963996,1134162464,'Redness, swelling, hives at injection site.  Hives spread down arm and to neck, patient began trembling.  Benadryl given patient sent to emergency department.   Checked out in ED, HR 110 & reports nausea and headache.  Nothing else abnormal.  Patient observed and hives seemed to resolve.','PFIZER'),('2021-07-19',57925825,1902861222,1912168071,'Patient is a 32 yo G2P1001 with EDD 5/2/2021 by 7w US. She had the first dose of the Pfizer Covid 19 vaccination on 12/17/2020 at the Health Clinic and the second dose on 1/7/2021 at 1115 am. She began having abdominal pain and vaginal bleeding at 315 sm on 1/8/2021 progressing to a previable (22w2d) preterm birth at 739pm on 1/8/2021.','MODERNA'),('2021-07-20',53097948,1093918997,1053492876,'Diarrhea, near syncope, extreme fatigue. Started 30 hours post injection & continued x 48 hours.   Site soreness/edema 24 hours after injection that increased to extreme sensitivity at site after 30 hours which lasted 24 hours.  Left deltoid swollen x 1/2 more than usual size started 36 hours after injection and lasted 36 hours.','Covishield'),('2021-07-20',57764391,1821536251,1558625863,'9:20am- mild itching on both arms and legs, No hives present 9:30am- flushed face and redness present  9:45am- pins and needle like feeling on right side of lips 10:10am-Adult Benadryl taken with Prednisone  12:54pm-3:34- Tired went to sleep 5:00pm- Shoulder pains/ aches  5:15pm- Severe headache  6:00pm-7:30pm- Chills here and there 12/31/2020 All day symptoms  Lower back pain Upper back pain Ankle pains muscle Tired','ASTRAZENECA'),('2021-07-21',3930712,1891161451,1063412153,'Report HA that improved with Tylenol','CoronaVac'),('2021-07-22',23309940,1528373586,1033359146,'Left upper extremity DVT and pulmonary embolism diagnosed 2/24/2021. Arm swelling started 02/23/2021.','PFIZER'),('2021-07-22',38180703,1093822686,1144238379,'Raised, red area with warmth and tender to touch. On  right deltoid around injection site Kelflex 500mg TID x 7 days and ice packs until redness is resolved Reaction 12/27/2020 Resolved 12/29/2020','BBIBP-CorV'),('2021-07-22',43449890,1427235423,1346224680,'Racing heart 40 minutes after vaccination Large redness and itching where the vaccine was done on left arm  2.5 days after vaccination','Covaxin'),('2021-07-22',57733421,1407384480,1457319915,'Tachycardia scratchy throat, fuzzy feeling tongue neck beginning to swell Narrative:  monitored for 4 hours and discharged to home with epi pen,','CoronaVac'),('2021-07-23',15778824,1104020759,1013009448,'I had a headache at the top of my head, and a tingling sensation down my left leg from my buttocks to my calf. The tingling lasted until the next morning then went away. On 1/3/2021 I experienced a strong headache followed by facial numbness and tingling. This lasted for an hour or so and slowly subsided. The headache lingered for 3 days.','CoronaVac'),('2021-07-23',46854296,1407243835,1952373409,'Resident passed away 2 days after receiving the vaccine. oxygen level has decreased shortly 1 day after receiving the vaccine.','PFIZER'),('2021-07-24',23470415,1710913504,1518937903,'Throat swelling following vaccination. Epipen administered at time of adverse event.','Covaxin'),('2021-07-24',58716719,1568565919,1487697348,'One hour after receiving the vaccine I experienced a moderate headache that was relived by Ibuprofen.  24 hours after receiving the vaccine I experienced a rash (small raised red bumps) on both arms. lower back, and below knees on both legs.  36 hours after receiving the vaccine I experienced the same rash on my neck.  48 hours after receiving the vaccine I experienced the same rash on my upper chest.','CoronaVac'),('2021-07-25',52388789,1003844671,1639177108,'Severe headaches; This is a spontaneous report from a contactable consumer from a Pfizer Sponsored Program. A patient of unspecified age and gender received bnt162b2 (BNT162B2 PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on 30Dec2020 at a single dose for immunization. The patient\'s medical history and concomitant medications were not reported. The patient experienced severe headaches on an unspecified date. The event outcome was unknown.   Information on the lot/batch number has been requested.','Covishield'),('2021-07-25',68006195,1659657740,1568414571,'Swelling at injection site leaving round circle that itches. Swelling under arm and tenderness in glands under arm. Muscle spasms in arms and chest. Slight nausea.','PFIZER'),('2021-07-26',39820948,1598207300,1073536017,'The vaccine administered 12/31/20 and the person had a couple of episodes of hyperglycemia above 450 on 1/2/21','Covishield'),('2021-07-26',66110099,1992950570,1063965390,'vomiting, diarrhea, chills and body aches. Treatment: Phenergan, advil Time Course: 36 hrs.','ASTRAZENECA'),('2021-07-27',2842300,1558352526,1386620128,'I had the vaccine on the 23rd December I was monitored for 15 mins. My throat felt scratchy and itchy, I left at 3pm by 3:15 my head started hurting, mild. at 7pm I had a pounding headache, chills, body aches on the 24th AM I could not warm up my body was shivering I went to work at 8 am I thought I had a fever and I checked it was 100.2 when I got home my temp was 101 and 102.9 and my body aches were horrible I couldn\'t move nausea no appetite, shortness of breath, I did a telemed and talked to my primary and she said this was all related to the vaccine, she prescribed something for the nausea was asked to get a covid test and it came back negative, I started getting better Dec 27th .','MODERNA'),('2021-07-27',4701740,1336446038,1134150329,'Axillary soreness /pain in the same arm of the injection site. Urticaria, covering most of the deltoid muscle, with slight swelling.','MODERNA'),('2021-07-27',50558331,1922402247,1770633349,'My mother complained of a severe headache within 1 hour of receiving the injection. 18 hours later she was rushed to the the ER with a Hemorrhagic stroke. Hospitalized for 3.5 days,  cognitive impairment remains, resulting in the need for rehabilitation therapy.','BBIBP-CorV'),('2021-07-27',51889245,1114354768,1083651186,'Severe joint pain and muscle aches rash on hands','MODERNA'),('2021-07-27',55829208,1922354869,1316971203,'Vaccine received at ~830 on 12/30/20. At 1220am on 12/31, woke up shivering and freezing.  Temperature was 103.1.  Took a couple of Tylenol and retook my temp 40 mins later and it went up to 104.3.  Then took some Advil and was able to get it back down to 103.1.  was like that until about 530am and it started coming down 102, 101 and by 630 was 98.7.    Had COVID in August.  Feel perfectly fine by 0930 on 12/31.','Sputnik'),('2021-07-27',58728466,1962482869,1528019338,'Patient given Pfizer instead of Moderna for her 2nd vaccination','Covishield'),('2021-07-27',65528956,1497782122,1295896603,'Headache, Myalgia, NauseaVomiting, fever-100.3 F had two days of leave, rest at home','CoronaVac'),('2021-07-28',4306437,1477519478,1538175799,'Tachycardia (see above, tachycardia) Narrative:  Recipient immediately felt bad s/p vaccination - vitals demonstrated HR 133. No other signs or symptoms of anaphylaxis. Tachycardia resolved within 1-2 minutes of rest without intervention to HR of high 70s-low 80s. BP 131/91, SpO2 98% on room air, temperature 98.4F. Recipient able to ambulate on own to exam room. Exam benign, including recipient\'s HR observed prior to/during/after exam to be high 70s. Tolerated oral intake without issue, no further intervention indicated. Recipient observed for 30 minutes after vaccine administration without further issue.','CoronaVac'),('2021-07-28',22888741,1710211065,1841690898,'at 4:08 pm, 10 minutes after receiving vaccine pt reports feeling dizzy and has bilateral rash on arms. pt was evaluated by EMS. BP 124/80, P 82, O2 Sat 100%. pt reports feeling better and declined EMS transport to hospital and left AMA 4:26','CoronaVac'),('2021-07-29',24036567,1396970232,1053467357,'Pain in vaccinated arm, joint pain,  headache, chills, fatigue','MODERNA'),('2021-07-29',31186051,1477669505,1194971317,'Rash','Covaxin'),('2021-07-30',51624159,1619209053,1841284890,'She passed out.; This is a spontaneous report from a contactable consumer (parent). A 17-year-old female patient (daughter) received first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE, lot number= EL1284) on 22Jan2021 11:45 AM at left arm at single dose for COVID-19 immunisation. Medical history and concomitant medications were none. No known allergies. Patient was not pregnant. Patient did not have COVID prior vaccination, and did not have other vaccine in four weeks, did not other medications in two weeks. The patient experienced passed out on 22Jan2021 12:00 PM. Treatment included they had her lay on the ground with her knees up and cold compresses. Patient did not test COVID post vaccination. The outcome of event was recovering.','PFIZER'),('2021-07-30',69507800,1063528990,1568414571,'Administered Patient vaccine 01/21/21.  Went to ED and diagnosed with the following: 1. Shortness of breath   2. Peripheral edema   3. Hypertensive urgency   4. Weight gain   5. Hypervolemia, unspecified hypervolemia type   6. Atypical chest pain     Admitted to inpatient to hospitalist but then signed AMA and left hospital.','MODERNA'),('2021-07-31',2688846,1225450653,1235199811,'Received my vaccine on Wednesday 12/30/20. The following Tuesday 1/5/21, I woke up with uncomfortable swollen Axillary lymph nodes. Thursday evening (1/7/21) I noticed redness and slight swelling at the injection site. Swollen nodes continue.','MODERNA'),('2021-07-31',48321572,1629256318,1932153285,'Since the vaccine I have been having right sided hearing loss. Two days after my first dose I felt like I was underwater when talking to people, as their speech was distorted. I also felt pressure in my ear, as if it was filled with fluid, and was unable to pop my ears. I was evaluated by an ENT and there was no infection or fluid in my ear. It started to get better a little.  After my second dose, the symptoms worsen. My hearing loss was back worse than the original time and this time I had tinnitus constantly. I also had chills, fevers, myalgia, back pain, and headaches.','Covaxin'),('2021-08-02',13868166,1811947583,1073888236,'Initially started as shortness of breath followed by fevers, aches, muscle cramps.  Ultimately ended up in the hospital with hypoxemia, pleural effusions.  Laboratory values showed evidence of acute renal insufficiency, eosinophilia.  Physical exam consistent with pulmonary edema and lower extremity macular rash.  Entire presentation concerning for DRESS syndrome','PFIZER'),('2021-08-02',51686008,1881847895,1750302170,'Red skin, hot, hard, swollen area around injection site. Swelling increased  for 24 hours. Applied ice to affected area. At the time of this form the site is less swollen, no longer hot, and less red.','PFIZER'),('2021-08-03',23501963,1992701718,1073575403,'Tingling in the 1st, 2nd, 3rd digits as well as pain at the injection site.','PFIZER'),('2021-08-03',50845114,1962704577,1851582175,'swelling at injection site, some redness, some headache','CoronaVac'),('2021-08-04',722117,1407843527,1588930762,'Palms became sweaty Narrative:  Noted palms becoming sweaty after 30 minutes of having the vaccine. Initial blood pressure 86/55 P 84 (lying down) with 97 O2 Sat. Denied difficulty breathing. Interval blood pressure 97/57 p. 83 regular. Final blood pressure 137/74 (sitting) P. 90. Left in stable condition to continue being a part of the COVID vaccination team as check-out.','CoronaVac'),('2021-08-04',22524064,1225008279,1093742256,'Two weeks later post vaccine developed full body Rash','Sputnik'),('2021-08-04',42597847,1528008232,1770694671,'Day after receiving the vaccine, the patient complained of abdominal pain which worsened over the day.  She went to the ED and was hospitalized.  Abdominal pain complaints increased and continued, she decompensated rapidly, was intubated and subsequently died 3 days later.  Imaging results showed, progressive ovarian cancer in the bowels.  Blood culture revealed that she had E.Coli in her blood.  It is thought that this is NOT related to the vaccine.','MODERNA'),('2021-08-04',44965772,1356366850,1407937444,'Headache, Myalgia, Fever, fatigue','BBIBP-CorV'),('2021-08-04',48154324,1487628046,1790983237,'red rash at injection site; itching at injection site; injection site warm to touch; left arm pain radiating from injection site to fingers.','Covishield'),('2021-08-05',22030487,1740251305,1770780017,'Parasthesias began in my lower extremities intermittently about 36 hours following administration. These spread to my upper extremities and became consistent. Occasionally will appear in lips and trunk. These are associated with sensation of numbness and some discomfort in my extremities. I\'m also experiencing significant brain fog, difficulty concentrating, and fatigue. Headaches are occurring about every other day.  Symptoms are present currently and have remained relatively consistent in severity.  Was evaluated by urgent care on December 28 and encouraged to observe. Was evaluated in the ER by neurology on January 4. There leading hypothesis is vaccine related immune response. Neurologic exam was largely normal, being evaluated by a specialist in the coming days.','BBIBP-CorV'),('2021-08-05',31802921,1679996375,1497020879,'Puffy eyes. Right more than left; This is a spontaneous report from a contactable other-HCP. This 39-year-old female other-HCP (patient) reported for herself that she received the first dose BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE) Intramuscularly at left arm at single dose for COVID-19 immunization on 30Dec2020 02:00 PM. Relevant medical history was none. Relevant concomitant drug was unknown. The patient experienced puffy eyes, right more than left on 30Dec2020. The event was assessed as non-serious. No treatment was received for the event. Outcome of event was recovering.   No follow-up attempts are possible; information about lot/batch number cannot be obtained.','ASTRAZENECA'),('2021-08-05',39880643,1245365949,1902041296,'blood clots on lungs  2 days in hospital   on blood thinner for the last 10 days','PFIZER'),('2021-08-05',40039581,1821268103,1457347361,'Tingling lips 1100am, mild chest tightening 1115am','Covaxin'),('2021-08-05',40434540,1124497961,1700949112,'Headache, fever, uncontrollable shaking, heart rate 104, bp 140/86 called 911, ambulance ride to above Hospital. IV on route,  Kept over night in hospital. Shake stopped in about 2 hours , continued rapid heart for awhile and fever, Hospital gave him tylenol.  after about 4 hours his bp fell to 89 over 64  ... thus keeping him in hospital.   They did multi tests.   found an unknown infection in his blood.   Patient has had an elevated WBC but in hospital it was 50,000.   two weeks ago at his primary Dr.  it was 40,000.   He walks with a walker and cane, however he has lost his balance and fallen 3 time since vaccine and one of those was today.','MODERNA'),('2021-08-05',53842881,1104277474,1760405245,'Three days after second COVID-19 vaccine, patient became lethargic.  Due to advance directive that instructed that no life saving interventions to take place, patient continued to decline and expired on 29 January 2021.','ASTRAZENECA'),('2021-08-06',66114820,1447564109,1790719201,'started with a red rash and then kind of itchy warmness in my back lasted about two days and then today my left arm looks like covid arm and red circle with a spot that looks like raw skin and a blisters next to it','MODERNA'),('2021-08-07',3954257,1700844313,1184886137,'Our infectious disease physician is reviewing notes from previous hospital stay for this patient who reports having had DRESS 2 days after receiving the MOderna COVID vaccine on 2/4/2021. MD cannot be sure if the DRESS is related to vaccine or new initiation of allopuriol as the drug was started 2 weeks prior to this reaction and is known to cause this. He wants it reported as a precaution, again cannot be sure what caused this, the vaccine or the new medication.','ASTRAZENECA'),('2021-08-07',51788784,1457768343,1730621657,'kidney infection; This is a spontaneous report from a contactable consumer or other non hcp.   A 88-years-old male patient received the second dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE, lot# unknown), via an unspecified route of administration single dose on 09Feb2021 for covid-19 immunisation. The patient medical history was not reported. The patient\'s concomitant medications were not reported. The patient experienced kidney infection on an unspecified date. Patient started on sulfamethoxazole/trimethoprim. The outcome was unknown.   Information about lot/batch number has been requested.','BBIBP-CorV'),('2021-08-08',25160420,1194148593,1063462547,'Headache Narrative: Mild headache started 2 minutes after injection','Covishield'),('2021-08-08',26030569,1790234052,1215929633,'Shortly after receiving the vaccination pt. complained tightening in thought area. Assessment revealed no obvious signs of edema or anaphylactic incident.  Pt. administered 50mg Benadryl PO.  Pt. monitored 1 hour+ with no changes in condition and no additional complaints.','Covishield'),('2021-08-08',54341197,1346684248,1962529206,'Headache, Myalgia & Arthralgia Narrative: Mild symptom onset, presented to clinic to report. No further actions.','PFIZER'),('2021-08-08',61227084,1710384896,1063965390,'migraine; This is a spontaneous report from a contactable consumer. A female patient of an unspecified age received the first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on 26Jan2021 at single dose for COVID-19 immunization. The patient\'s medical history and concomitant medications were not reported. The reporter wanted to know if the patient could take Sudafed PE for a migraine that she was experiencing from an unspecified date. The patient received the first dose of the vaccine yesterday afternoon (26Jan2021), in which her doctor recommended her to not take ibuprofen within the first 24 hours of the vaccine. The outcome of event was unknown.  Information about lot/batch number has been requested.','PFIZER'),('2021-08-08',62069485,1083010631,1295094530,'Woke up with Right Arm Pain and SEVERE Body aches.  Took long hot shower, 600mg Motrin.','PFIZER'),('2021-08-08',66518345,1891720470,1457347361,'Fever Sore arm around 12 noon; chills 10pm for an hour, then fever 101-3F; relieved with tylenol','PFIZER'),('2021-08-09',38602446,1952386633,1578772513,'Moderna COVID?19 Vaccine EUA Moderna vaccine vial was opened on 12/30/2020, and the vial was placed back into the fridge later that afternoon, like 2-3 hours after puncture. The opened vial was reused for this patient the next morning for an injection when it should have been discarded. No adverse events occurred','PFIZER'),('2021-08-10',3872305,1235106667,1073540704,'Hot; heaviness in right arm / sore; feeling flushed; feeling hot in legs.  Monitored for total of 40 minutes. Laid on a stretcher and systems resolved. Released to home.','ASTRAZENECA'),('2021-08-10',64604181,1912301193,1396737458,'Itching on