re she fell of her hands and knees complaining of weakness and unable to get self up.','ASTRAZENECA'),('2021-08-12',52009069,1790830412,1447219845,'SORENESS AT INJECTION SITE Narrative:','Sputnik'),('2021-08-12',57890173,1215077151,1780762583,'Headache, Seizures, UrticariaPruritus & NauseaVomiting Narrative:  NORMALLY HAVE SEIZURES EVERY EVENING, BUT THIS SEIZURE ABOUT 5.5 HRS POST VACCINE WAS MUCH MORE SEVERE WITH EYES ROLLING IN BACK OF HEAD AND FELT IN A DAZE. TOOK AN EXTRA DOSE OF CLONAZIPAM 1 MG','Covishield'),('2021-08-13',23672061,1437121621,1396720173,'FEVER 102.1 , CHILL AND BODY PAIN FOR 28 HOURS. AFTER THAT NO SYMPTOMS AND FEELING BETTER, JUST TOOK TYLENOL 500MG THRICE A DAY.','MODERNA'),('2021-08-13',42118049,1760565774,1467689463,'-Fever/chills -extreme body ache -bones hurt','Sputnik'),('2021-08-14',57722838,1215983325,1174600431,'EE called to report L axilla swelling x 5 days, not improving.  VEARS completed. Advised her to see MD as this is most likely from the injection, but could also be from another cause .','BBIBP-CorV'),('2021-08-14',57948323,1780053066,1871530378,'pfizer-Biotech/Covid-19 vaccine  flu like symptoms- nausea, light headed, trouble focusing, stuffy nose, body aches, fever and chills but no actual fever- body just felt really warm. problems breathing at times (like a panic attack), headache, stiff neck, fatigue-- I fell asleep in my car because I was so tired.  sore arm,  irritability, When trying to lie down, I could not get comfortable, I found myself lying on the floor since it was cold, this is not normal behavior. i felt super sick. I was crawling on the floor because of how dizzy and tired i felt. It felt like  a really bad drunk or hangover. noises were too loud, it felt horrible. I don\'t know if it is done.','BBIBP-CorV'),('2021-08-14',68107550,1194803510,1477700995,'metallic taste','Covishield'),('2021-08-15',354895,1528449766,1780788299,'Sore arm with it 2 hours of the vaccine administration second dose, fatigue onset 4 hours after vaccination second dose , lightheadedness and nausea onset 5 hours post administration  second dose.','ASTRAZENECA'),('2021-08-15',50168454,1073951257,1104810878,'pt c/o tingling in B/L arms and head. pt stated she was a bit dizzy at first but sx subsided. Pt sat in view of Rn for extended time period. VS 198/108 HR92 SPO2 97. Pt VS rechecked BP 148/90 SPO2 97 HR 94 pt stated she felt better. Pt ambulated independently, RR even and unlabored, NAD noted, Skin NFR. Pt declined transport to ED.','BBIBP-CorV'),('2021-08-15',51676492,1194006312,1730369307,'Dizzyness (I felt like I was drunk or drugged) starting about 1 minute after vaccine.  I left my car there and got a ride home.  Now, 2 hours later, my head still feels cloudy.','BBIBP-CorV'),('2021-08-15',53463790,1902969918,1710059498,'21 yo M w/ no known chronic medical conditions, presents w/ 2 hours MEG/central chest burning. Initial a/w mild SOB and LH; by time of my eval, LH/SOB had resolved and CP was 4/10. Pts sx completely resolved w/ GI cocktail. No exertional sx. No recent infectious sx.','BBIBP-CorV'),('2021-08-16',21972989,1982769287,1790719201,'A few hours post vaccine, developed splotches and a scratchy throat.  Took a Benadryl which resolved those symptoms. Wed, woke up with terrible headache, nausea and kidney pain, no other urinary symptoms or fever. Took Tylenol and Advil alternating between the two. Thursday, had kidney pain and diffuse joint pain. Friday, joint pain improved, still had kidney pain and do as of today, 4 Jan 2021.','PFIZER'),('2021-08-16',53986194,1134233729,1063449817,'Myalgia, Fever, chills','BBIBP-CorV'),('2021-08-16',65301461,1194026120,1841690898,'Fatigue, myalgias, arthralgias, headache, rhinorrhea, scratchy throat, chest tightness - approximately 72 hours duration','Sputnik'),('2021-08-17',50621963,1750339495,1760922405,'Weakness; Tingling in arm that was vaccine was given; Fever; Extreme fatigue; This is a spontaneous report from a contactable healthcare professional (patient). A 47-year-old female patient received BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE, lot number: EC1284), via an unspecified route of administration on 29Dec2020 at single dose for COVID-19 immunization. The patient\'s medical history and concomitant medications were not reported. The patient experienced extreme fatigue, tingling in arm that was vaccine was given, fever, and weakness on 30Dec2020. No treatment was given for the events. The patient did not receive any other vaccines within 4 weeks prior to the COVID vaccine. Prior to vaccination, the patient was not diagnosed with COVID-19 and since the vaccination the patient has not been tested for COVID-19. The outcome of the events was unknown.','Sputnik'),('2021-08-18',14104719,1932157039,1851430896,'Erythema,itching  and swelling at injection site, circumference of a medium apple slowly growing  over  time.','Covaxin'),('2021-08-19',22112951,1700036993,1184698722,'rash on my upper thighs; left more inflamed than the right. Eventually went away. Ittchy.','BBIBP-CorV'),('2021-08-19',23325964,1295704856,1073844973,'Headache, Myalgia, Fever, Diarrhea, NauseaVomiting & Tachycardia Narrative: Vaccine received on 12-19-20. Symptom onset several hours later, needed to miss work on Monday 12-21-20 on account of symptoms. No immediate medical intervention required. Self-managed with tylenol.','Covishield'),('2021-08-19',50233282,1730375643,1225057755,'Queasy and cold chills','Covaxin'),('2021-08-19',51126645,1891960175,1598828634,'Fever Chills Body ache','ASTRAZENECA'),('2021-08-19',54794847,1760593339,1891804712,'Redness, swelling, hives at injection site.  Hives spread down arm and to neck, patient began trembling.  Benadryl given patient sent to emergency department.   Checked out in ED, HR 110 & reports nausea and headache.  Nothing else abnormal.  Patient observed and hives seemed to resolve.','PFIZER'),('2021-08-19',68910447,1023286408,1083651186,'Myalgia, Fever, fatigue Narrative:','Covishield'),('2021-08-20',30848451,1619086501,1568410652,'Pt. felt dizzy and lightheaded and slumped out of observation chair.  Pt. was arousable, but sluggish in response.  No SOB, LOC, or rashes noted.  Pt. placed supine in trendelenberg position.  Paramedics arrived @ 0853 and transport to hospital was declined by pt.  Pt. continued to be observed and stated she felt 100% better and called lyft to drive her home @  0925.  Pt. was advised to call an acquaintance to drive her home but she was unable to find anyone and chose to call lyft.','Sputnik'),('2021-08-20',34948910,1922256775,1124026554,'Systemic: Other- pt had history of copd and DNR on file. approx 3 1/2hr after vaccine pt had sob and lowo2 sat, emergency services called, pt passed on their arrival.staff felt due to pt existing condition','Covishield'),('2021-08-20',51508401,1386087039,1073521738,'Moderna COVID-19 Vaccine EUA A rash approximately the 2 long by 1 wide developed.  It worsened the next day, but then started to go away and is almost completely gone now.','PFIZER'),('2021-08-20',64616559,1356608921,1174562797,'Body aches, bone pain and extreme fatigue, loss of appetite','Covaxin'),('2021-08-21',9396068,1114222569,1255339305,'Arm redness and soreness at injection site 7 days after receiving injection. Also shoulder sourness','Covishield'),('2021-08-21',52880710,1396126918,1558625863,'localized reaction red bump. hot to touch. not painful','MODERNA'),('2021-08-22',38180703,1508874231,1184918112,'Raised, red area with warmth and tender to touch. On  right deltoid around injection site Kelflex 500mg TID x 7 days and ice packs until redness is resolved Reaction 12/27/2020 Resolved 12/29/2020','BBIBP-CorV'),('2021-08-22',43932930,1356640668,1417992447,'Fever pain at injection site','MODERNA'),('2021-08-22',57764391,1407919822,1982880902,'9:20am- mild itching on both arms and legs, No hives present 9:30am- flushed face and redness present  9:45am- pins and needle like feeling on right side of lips 10:10am-Adult Benadry