luated by an ENT and there was no infection or fluid in my ear. It started to get better a little.  After my second dose, the symptoms worsen. My hearing loss was back worse than the original time and this time I had tinnitus constantly. I also had chills, fevers, myalgia, back pain, and headaches.','Covaxin'),('2021-08-30',65010917,1215383559,1154324846,'injection site at upper deltoid, Pain in mid shoulder with ROM above >90 13:30, at 15:30 pain increased in left shoulder with AROM. Shoulder and back warmth. Numbness in left cheek and left lip. All resolved, mild with arm pain with turning apply force c Narrative:','Sputnik'),('2021-08-31',13868166,1154345767,1356432561,'Initially started as shortness of breath followed by fevers, aches, muscle cramps.  Ultimately ended up in the hospital with hypoxemia, pleural effusions.  Laboratory values showed evidence of acute renal insufficiency, eosinophilia.  Physical exam consistent with pulmonary edema and lower extremity macular rash.  Entire presentation concerning for DRESS syndrome','PFIZER'),('2021-08-31',50508155,1043477912,1770548042,'Severe arm pain at the site of the injection  which started 24 hours after injection and persisting through today - day 9  postvaccine. The pain is lateral upper right arm and descends inferiorly toward the elbow. No redness or swelling at the site.  I\'m having great difficulty with sleep because of the pain.  The pain is aggravated by  motion.  The pain is helped somewhat with ibuprofen 200 mg every 6-8 hours.','ASTRAZENECA'),('2021-08-31',51686008,1164769139,1144223579,'Red skin, hot, hard, swollen area around injection site. Swelling increased  for 24 hours. Applied ice to affected area. At the time of this form the site is less swollen, no longer hot, and less red.','PFIZER'),('2021-08-31',75105869,1932654563,1770714537,'I still hv swollen painful node above my collarbone..just been taking tylenol..no much relieve','ASTRAZENECA'),('2021-09-01',4292457,1891706776,1487697348,'Tongue and lip swelling on one side (left) and throat closure, admitted to ER then ICU 2/17/2021.  Discharged from ICU on 2/19/2021.','Covishield'),('2021-09-01',23501963,1801996319,1770780017,'Tingling in the 1st, 2nd, 3rd digits as well as pain at the injection site.','PFIZER'),('2021-09-02',42775374,1710308697,1316178213,'Red face, swollen lips, itchy watery eyes, red rash over body','ASTRAZENECA'),('2021-09-03',42126849,1477869626,1295811099,'Begin with abdominal pain on December 30 when she woke up, continued with nausea, then headaches, loss of appetite and by Sunday  January  3, 2021 swollen lymph node in left arm pit.  Was seen on January 4, 2021, told to call or return if it gets worse.  As of today she still has a swollen lymph node and swelling and redness around her injection site.','MODERNA'),('2021-09-03',44190724,1326063959,1710077482,'death','MODERNA'),('2021-09-04',974394,1922190073,1922035278,'Began with itchiness at the injection site which shortly turned into a swollen and raised injection site, hot to the touch, then it got really painful.','MODERNA'),('2021-09-04',51949559,1851604920,1992011472,'DEATH Narrative: Pt he reports he developed chills SOB body aches the same night as receiving the COVID vaccine on 1.26.2021-pt is currently reporting CheSt tightness and SOB Admitted to hosp: ICU with Bilateral Pulmonary Emboli, LLE DVT, NSTEMI, Arrhythmia.','Covishield'),('2021-09-04',57807734,1548365901,1346417524,'Pfizer BioNTech COVID 19 vaccine EUA-  fever, headache, fatigue.  Fever lasted less than 23 hours. no  medications still have slight HA','Sputnik'),('2021-09-05',722117,1558454876,1730108739,'Palms became sweaty Narrative:  Noted palms becoming sweaty after 30 minutes of having the vaccine. Initial blood pressure 86/55 P 84 (lying down) with 97 O2 Sat. Denied difficulty breathing. Interval blood pressure 97/57 p. 83 regular. Final blood pressure 137/74 (sitting) P. 90. Left in stable condition to continue being a part of the COVID vaccination