nation.','Sputnik'),('2021-09-06',52010676,1184970444,1003871559,'L hand edema, hematoma which burst and caused bleeding sending pt to the ER for pressure dressing and 2 stitches.  L hand and arm progressively got more edematous and bruised looking (severely black/blue/purple) and the hand continued to bleed and swell on 2/6/21.  Severe arterial and venous issues and apparent blood clots.  On 2/7/21 there were also lumps noted on left inner thigh.  Pt. stopped eating or drinking on 2/8/21 and expired on 2/12/21.','MODERNA'),('2021-09-06',54134983,1962817528,1619068459,'Itching, redness, swelling, heat at injection site. Continues to itch occasionally.','Covaxin'),('2021-09-06',75810103,1902199920,1295763969,'24 hours after vaccine, I had typical mild cold/flu symptoms. After 48 hours I had a lot of pain in my injection arm and my armpit lymph nodes were swollen. I treated the pain with Advil and a heating pad. 72 hours after the vaccine I felt faint, dizzy, and nauseous. I began to vomit and have diarrhea that entire night and next morning. I felt very weak and was unable to keep any foods or liquids down. I was unable to walk around. I took Zofran 8mg which helped with the severe nausea and weakness.  These symptoms are ongoing.','ASTRAZENECA'),('2021-09-07',54178060,1346295458,1629075064,'First dose was given 12/21/20 and second dose was given 1/6/2020 at day 16.','PFIZER'),('2021-09-07',66114820,1710913504,1629334065,'started with a red rash and then kind of itchy warmness in my back lasted about two days and then today my left arm looks like covid arm and red circle with a spot that looks like raw skin and a blisters next to it','MODERNA'),('2021-09-08',3954257,1609125269,1083873319,'Our infectious disease physician is reviewing notes from previous hospital stay for this patient who reports having had DRESS 2 days after receiving the MOderna COVID vaccine on 2/4/2021. MD cannot be sure if the DRESS is related to vaccine or new initiation of allopuriol as the dru