 COVID-19 prior to vaccination. The patient did not receive any other vaccines within 4 weeks prior to the COVID vaccine. On 28Dec2020, the patient experienced large rash around the injection site which lasted 7 days. There was no treatment received for the adverse event. The outcome of event was recovered on 04Jan2021. The patient has not been tested for COVID-19 since the vaccination.','Sputnik'),('2021-10-07',52010676,1437553377,1639153554,'L hand edema, hematoma which burst and caused bleeding sending pt to the ER for pressure dressing and 2 stitches.  L hand and arm progressively got more edematous and bruised looking (severely black/blue/purple) and the hand continued to bleed and swell on 2/6/21.  Severe arterial and venous issues and apparent blood clots.  On 2/7/21 there were also lumps noted on left inner thigh.  Pt. stopped eating or drinking on 2/8/21 and expired on 2/12/21.','MODERNA'),('2021-10-08',54178060,1972909810,1497780928,'First dose was given 12/21/20 and second dose was given 1/6/2020 at day 16.','PFIZER'),('2021-10-11',966931,1033352893,1346314218,'I got the shot, didn?t feel it at all so it went good. I went to the bathroom and went pee and got my arm back in my long sleeve shirt under my scrub top. I wasn?t anxious about getting the vaccine. Then I went to sit down and be monitored. After about another minute I felt very weird like a warm feeling going all over my body.  I started pulling my mask away from my face to get a deep breath. Then I broke out in a sweat from head to toe. I think I became pale (I apparently didn?t look good).  I started feeling more ?weird? as I had never felt this way before and I stood up to walk because the nurse there wanted me upstairs near the ED but I was weak so I sat down and had tunnel vision. After that it?s a bit of a blur. After I stopped sweating I got very cold and shaky but vitals were ok.  It scared me because I have never had a reaction before to a vaccine.','CoronaVac'),('2021-10-11',48540216,158