d headache. Next day my whole lower back was spasm and had horrible body pain/back pain. I almost passed out putting pants on.  A friend took me to an Urgent care they  gave me Shot of tramadol and given Tylenol 3. They also did a test on my kidney. About 50 hours after the shot I was feeling better.','MODERNA'),('2021-11-05',14203857,1073500591,1841511490,'Received the vaccine 1/5 at 8:09 am.  She was observed for 15 minutes and had no symptoms.  Next day, 1/6, she called work to say she had chills and headache and would not be reporting to work.  At 2:00 pm, she felt her heart racing, and noticed face and lip swelling and tightness in her throat.  She called her PMD who directed her to go to urgent care.  At urgent care, she got an EKG, IV fluids, IV steroids, and IV antihistamine.  Symptoms resolved within 2 hours.','ASTRAZENECA'),('2021-11-05',14376245,1578525523,1003841958,'Had my first Shingrix vaccination on Oct 29 2019 GSK Lot number 3099 Also had Prevnar 13 Pfizer Lot AP2987 same day Developed shingles diagnosed by my doctor on Nov 5 2019 Treating with valacyclovir 1 gram TID for 7 days.','Covishield'),('2021-11-05',26704629,1619120136,1609820968,'Pt complained of extremity feeling warm internally, itching, and numbness.','CoronaVac'),('2021-11-06',54770428,1902856354,1942414982,'Received the vaccine during break at work at approx 11:00 am. Sudden onset blinding headache with visual disturbance at 15:30 pm while working. Fifteen minutes after that the headache started to subside and I suddenly became very dizzy and was rolled to a stretcher and assisted to lie down ,associated diaphoresis and pale clammy skin. The following day, experienced significant joint pain and lethargy. I continue to have joint pain but otherwise feel relatively normal.','Covaxin'),('2021-11-07',44572523,1770032575,1790782522,'Pt began to have numbness and tingling in the left side of her face during first 15 minutes of observation. Pt was given 50mg of benadryl IM in the Left arm. (