ing up felt exhausting.  By evening of that day, my joint pain was lessening and my stomach felt somewhat better.  By the following morning, I felt normal, basically.  So in total, about a day and a half of bad reaction.','BBIBP-CorV'),('2021-11-14',32258815,1881622900,1881691681,'1/6/21 Pt received vaccine and complained of difficulty swallowing  and rapid heart rate.  Pt received methylprednisolone 125mg IVP, diphenhydramine 25mg IVP, & famotidine 20mg IVP.  Pt reported improvement and was discharged.  Sent home on diphenhydramine and oral prednisone.  1/7/21 Pt unable to swallow her own secretions and experienced eyelid swelling.  Pt vomitted. Pt received epinephrine and Benadryl X 1 dose each.  Pt then transported to hospital via ambulance.  Reason for admission - acute respiratory failure secondary to anaphylactic reaction.  Decision was made to emergently intubate the patient for airway protection despite aggressive intervention.  Pt successfully extubated 1/8/21.  Plan to discharge home  and start Medrol Dose Pack 1/9/21.','BBIBP-CorV'),('2021-11-15',23541011,1417367335,1952496200,'Lip and facial area swelling tow days after receiving vaccine.','BBIBP-CorV'),('2021-11-15',39648791,1043290968,1861420960,'2/28/2021 patient was admitted for rectal bleeding while taking apixaban Per the EUA, hospitalizations are to be reported irrespective of attribution to vaccine. This hospitalization does not appear to be related to the vaccine.','Covaxin'),('2021-11-15',50121513,1528211760,1578751020,'Started with right arm tingling/slight numbness feeling down to my fingertips. Two days my left arm felt the same with slight improvement in my right arm. Later that day, I felt tingling in my left leg down to my toes. I have felt these symptoms every day since, but they have improved in severity, moving from one side to the other at times. This has not affected my activities of daily living, nor my work as a RN.','ASTRAZENECA'),('2021-11-15',51744799,1437484219,1063442283,'Bright red patch at site of injection. One week later and arm still red and itching. Started using hydrocortisone cream and taking benedryl.','CoronaVac'),('2021-11-16',30958016,1427352855,1619067998,'Patient has hx of anxiety, states she usually takes 0.5 mg, took only 1/2 prior to vaccine clinic.  After scheduling return visit, patient sat down and shortly c/o having problems breathing.  Line monitor noticed patient and called APRN and EMS.  Patient placed in WC and brought to a room.  VS monitored, patient called and spoke to husband and after about 30 mi she left.  VS normal, no SOB, calmed own.','Covaxin'),('2021-11-16',40013220,1285015560,1134399199,'Patient given 1st dose COVID vaccine.  No history of allergies or  reactions to vaccinations.  Immediately following injection, patient c/o of dizziness, clamminess, skin color became pale and he appeared diaphoretic.  BP 153/93, P = 103 .  He stated not having breakfast or lunch.  Vitals repeated.  BP 154/88, P 94.  Rapid response team called at 1317.  Patient given water and Reese cup.  EKG completed.  BS = 88. Vitals retaken - BP 158/88; P 95.  Continued c/o dizziness and clamminess/  Moved to cart and monitored additional 30 minutes without further issues.  MD came at 1405 and evaluated patient; patient cleared to go home.','Covishield'),('2021-11-16',47492320,1649693169,1548284326,'Low grade fever, chills, muscle aches, headache, fatigue, and cold sore on bottom lip','MODERNA'),('2021-11-16',52052016,1386915650,1699712083,'Dizziness- following day, until present time (continual) Arm weakness - 4 days after administering   Leg weakness - 4 days after  Muscle twitching / restless legs -4 days after','Sputnik'),('2021-11-16',64914853,1316297161,1467469718,'EMG: Demyelinating neuropathy, possible AIDP vs developing CIDP','MODERNA'),('2021-11-16',68060719,1134598881,1659400729,'Had itchyness on skin around neck/throat area','ASTRAZENECA'),('2021-11-17',52057635,1023027331,1699737387,'Woke up next day very fatigued, left work after 1/2 day and slept 20hrs  Two days after injection lymph nodes very sore and swollen in armpit (pain with applying deodorant)  Four days after injection bruising with about 3x3 cm area of redness/swelling present at injection site Daily headaches managed with ibuprofen   Not anything too concerning but not comfortable. I have never reacted to a vaccine prior','MODERNA'),('2021-11-17',53555496,1679970289,1669813952,'Received vaccine on 1/26/2021 at 10:30am and at 2134 was observed to be having difficulty with breathing and cyanotic when staff entered his room.  He was coughing and sounded congested.  He was repositioner and SPO2 78% on room air so O2 applied at 2L which increased SPO2 88% so O2 increased to 4L and SPO2 increased to 95%.  Temp 103.1, B/P 188/110, resp 28, pulse 128.  911 called and sent to Community Hospital ER at 2145.  Received call from hospital reporting diagnosis of right sided pneumonia.   He had received his 1st dose on 12/29/2020.  On 1/8/2021 he was on droplet isolation due to possible exposure of Covid 19 and receiving duoneb treatments for chronic nonproductive cough.','Covaxin'),('2021-11-17',64616817,1215301379,1659462299,'Within 5 minutes after Moderna dose 1 vaccine patient developed tingling around the lips and tongue.   Patient has a history of anaphylaxis to Latex, and ceftriaxone.  HR 86 and regular, BP 130/80, O2 96% on room air with mask on.  After further evaluation patient c/o feeling winded like  I just finished a walk pushing the stroller. Lungs and throat sound clear.  Discussed with patient the pros and cons of administering benadryl and or epi and that would require a visit to the ED for further evaluation. Patient concerned about how the drugs will affect her breast feeding.  Through our conversation, the tingling of the lips and tongue has increased, patient is stable, decision made to wheel patient to the ED for evaluation.','Sputnik'),('2021-11-17',75020566,1730282161,1255312492,'Resident found unresponsive