r patient had refused initially. Patient verbally agreed. Vaccine was administered. Patient then reported that they had an additional Vaccination Record Card would we like to see it. The patient produced a card that had a dose record given. Upon looking into the records, patient was given a third dose of vaccine today as a result of facility confusion. Patient is doing well, no complaints at this time.','Covishield'),('2021-11-25',43563423,1558674598,1477655959,'All at injection site area: pain, swelling, hardness, red and very warm to the touch.','Covishield'),('2021-11-26',8066532,1760559330,1255304655,'Ten minutes after Covid vaccine begin to feel itchy , lips tingling/itchy; dry heaving, chest pressure.E rythematous rash on face. Evidence of excoriation on neck and upper chest. No shortness of breath  Rapid response team called and transported to ED.  Received epinephrine, Benadryl, Pepcid, Zofran and Solu-Medrol.  Discharged at 8:20 PM home.   E Today she is experiencing: itching all over, lips tingling, legs and arms feel very heavy, weak. Will follow up with her healthcare provider MD @ Hospital.','CoronaVac'),('2021-11-26',57449167,1184826786,1649351560,'SkinRash chills, sore throat, body aches','ASTRAZENECA'),('2021-11-26',67914718,1417220765,1770694671,'Tongue and throat swelling, followed by dizziness and slight itchiness. Was monitored by RN and symptoms subsided after about 30 minutes with no treatment. Vital signs were normal. Blood glucose check was normal.','ASTRAZENECA'),('2021-11-27',392912,1982661930,1639132293,'-Muscles Spasms (lasted about 15 minutes) -Fever -Chills (including chattering teeth) -Diarrhea -Vomiting -Sore Throat -Headache -Fatigue -Stomachache -Loss of appetite -Shortness of breath','CoronaVac'),('2021-11-27',51472060,1861884249,1366437899,'tiredness, headache  muscle pain, chills, nausea, feeling unwell','Covishield'),('2021-11-28',382881,1750372983,1629334065,'throat dryness and swelling; throat dryness; This is a spontaneous report from a contactable other healthcare professional. An adult female patient (reported as 38 and 28 years old) received first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE, solution for injection, lot number number and expiry date: unknown) via an unspecified route of administration, on 23Dec2020, at a single dose, for Covid-19 immunization. The patient\'s medical history and concomitant medications were not reported. The patient received the first dose of the Covid-19 vaccine on 23Dec2020 and one hour afterwards she experienced throat dryness and swelling. She could still swallow but that the symptoms lasted about 45 minutes. Outcome of the events was unknown.  Information on the lot/batch number has been requested.','BBIBP-CorV'),('2021-11-28',22124340,1790208577,1437256518,'Chills, headache, muscle pain, tiredness, and nausea.','ASTRAZENECA'),('2021-11-28',40774060,1023236536,1588638894,'delayed urticarial at site of injection, resolved within 24 hours with 1 dose of fexofenadine 180mg','BBIBP-CorV'),('2021-11-28',50296818,1184643074,1598843971,'pain to that area when lifting arm; This is a spontaneous report received from a contactable consumer (patient) via a Pfizer-sponsored program. A female patient of an unspecified age received the first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE lot number and expiry date unknown), via an unspecified route of administration, in Jan2021 (reported as 3 weeks ago), at single dose, for COVID-19 immunization. The patient medical history and concomitant medications were not reported.  The patient had complaints of pain to that area when lifting arm (pending clarification) in Jan2021. The patient was scheduled to have the second dose in the afternoon of 27Jan2021. The outcome of the event was unknown.  Information on the Batch/Lot number has been requested.','BBIBP-CorV'),('2021-11-28',53001515,1811966302,1083646194,'Swelling at injection site, hard llump under skin, skin at injection site is hot to touch, injection site is painful, injection site is itching and burning','BBIBP-CorV'),('2021-11-28',60022674,1821326760,1639148554,'Fatigue','BBIBP-CorV'),('2021-11-29',42445975,1326044603,1134157662,'Itchy,  red rash  and swelling around vaccinated area.  Occured seven days  ( 2/22/21) after vaccination. Area warm.  Treating  with ice pack to control the itchiness.','PFIZER'),('2021-11-29',59512752,1710086665,1063544849,'Pt received initial dose on 1/5/21, diagnosed with COVID-19 on 1/8/21, treated with monoclonal antibodies on 1/13/21. Pt experienced CHF exacerbation, anasarca, and renal failure during acute illness. Pt also treated for pneumonia during this time. Pt was considered terminal status on 1/25/21. She received second COVID-19 vaccine on 2/15/21. Pt then experienced increased difficulty eating and taking medications this same day, in addition to hallucinations she was experiencing. Patient subsequently died on 2/16/21.','MODERNA'),('2021-11-30',2720779,1255879276,1346232899,'LITTLE SORENESS ON VACCINE SITE','Covaxin'),('2021-12-01',14203857,1396174272,1780905059,'Received the vaccine 1/5 at 8:09 am.  She was observed for 15 minutes and had no symptoms.  Next day, 1/6, she called work to say she had chills and headache and would not be reporting to work.  At 2:00 pm, she felt her heart racing, and noticed face and lip swelling and tightness in her throat.  She called her PMD who directed her to go to urgent care.  At urgent care, she got an EKG, IV fluids, IV steroids, and IV antihistamine.  Symptoms resolved within 2 hours.','ASTRAZENECA'),('2021-12-01',39096027,1730260027,1760922405,'Moderna COVID-19 Vaccine  Moderate to severe chills, fatigue, myalgias, and headache. Moderate to severe tension like pulling in posterior neck and posterior head.  NyQuil and Advil therapy.','ASTRAZENECA'),('2021-12-01',44696609,1124078407,1922075480,'Immediately I got nauseas and headache. Next day my whole lower back was spasm and had horrible body pain/back pain. I almost passed out