dication prescribed and is lowerin blood pressure now, within an hour of taking medication, but numbness remains.','Sputnik'),('2021-12-04',39368342,1801252291,1548581614,'My left shoulder and collarbone area got really swollen and then I discovered a small lump right above my collarbone that is painful to touch. The pain and swelling has lessened but it has been over a week and the lump is still there.','MODERNA'),('2021-12-04',51262841,1871740506,1083651186,'On Jan 2 I noted bicep pain and under arm pit. The following day redness started to appear on previous scarring from vaccine. The lymph nodes felt swollen and painful.','CoronaVac'),('2021-12-05',22349644,1134288251,1861434037,'She had a vaccine on 12/24 and was fine.   On 12/31 she had onset of hives on the Left arm below the injection site . She was seen twice in the ED , was given a course of Keflex In case it was developing cellulitis- however was told it was likely a delayed reaction.   For the next few days she had tingling and pin in the arm.        She is now feeling fine.','BBIBP-CorV'),('2021-12-05',52001009,1053841163,1922075480,'After 5 minutes of having the vaccine I experienced right sided tongue tingling followed by a funny taste. 5 minutes after that my arm started itching from the injection site. I took ibuprofen pm that had Benadryl in it to help. I was fine all night after taking the ibuprofen with Benadryl. This morning 1/7/21, I have a sour metallic taste which has not resolved.','PFIZER'),('2021-12-05',53219248,1427261916,1467400077,'5minutes post injection. I had Sour taste of medicine in back of throat. Couple minutes later. Felt throat swell.  Not lymph nodes. Swelling sensation Inside throat. Had a mild headache. Was given 50mg of Benadryl. Taken to ER for observation.  Swelling resolved couple hours later without any further reactions. Swelling never impeded my ability to breathe.','Sputnik'),('2021-12-06',41811618,1992114359,1437578069,'Unable to breathe and died. Doctors unable to 