tatus, Fever, Lethargy','Sputnik'),('2021-12-13',52052016,1548471386,1881645224,'Dizziness- following day, until present time (continual) Arm weakness - 4 days after administering   Leg weakness - 4 days after  Muscle twitching / restless legs -4 days after','Sputnik'),('2021-12-13',54417198,1528407327,1467406017,'Diarrhea,  nausea, vomit, fatigue, dehydration, gastric pain Emergency room advised by primary care, received 1 liter IV saline Blood draw and CT scan all negative','Covishield'),('2021-12-14',30958016,1114931318,1245630870,'Patient has hx of anxiety, states she usually takes 0.5 mg, took only 1/2 prior to vaccine clinic.  After scheduling return visit, patient sat down and shortly c/o having problems breathing.  Line monitor noticed patient and called APRN and EMS.  Patient placed in WC and brought to a room.  VS monitored, patient called and spoke to husband and after about 30 mi she left.  VS normal, no SOB, calmed own.','Covaxin'),('2021-12-14',53555496,1851604920,1376610915,'Received vaccine on 1/26/2021 at 10:30am and at 2134 was observed to be having difficulty with breathing and cyanotic when staff entered his room.  He was coughing and sounded congested.  He was repositioner and SPO2 78% on room air so O2 applied at 2L which increased SPO2 88% so O2 increased to 4L and SPO2 increased to 95%.  Temp 103.1, B/P 188/110, resp 28, pulse 128.  911 called and sent to Community Hospital ER at 2145.  Received call from hospital reporting diagnosis of right sided pneumonia.   He had received his 1st dose on 12/29/2020.  On 1/8/2021 he was on droplet isolation due to possible exposure of Covid 19 and receiving duoneb treatments for chronic nonproductive cough.','Covaxin'),('2021-12-14',75020566,1588910061,1558504118,'Resident found unresponsive and without pulse at 05:45am.','MODERNA'),('2021-12-15',888972,1992259980,1275623563,'The day after the shot she developed fever for 2 days as high as 101.  She developed a pruritic burning rash to posterior right leg extending down the lateral lower leg.   She had fatigue and myalgias.    Diagnosed with shingles on 2/23. and informed to not receive the 2nd vaccine.   She presented to the Emergency room on 2/27 with fatigue, numbness right side of the face, no reports of shortness of breath or chest pain.   Ambulated in to ER.     After her work up she was discharged home - she present back to the ER within 30 minutes.  PTA arrival at the ER for the 2nd time - she complained of left neck and arm pain - then went unconscious.  She arrived to the ER in full arrest - pronounced deceased after resuscitation efforts were not effective','Sputnik'),('2021-12-15',37025891,1285699538,1265432611,'Headaches; body aches; Injection site pain; This is a spontaneous report from a contactable Pharmacist (patient). A 37-year-old male patient received first dose of BNT162B2 (PFIZER-BIONTECH COVID-19 VACCINE), via an unspecified route of administration on left arm on an unspecified date at single dose for COVID-19 immunization. The relevant medical history and concomitant medications were reported as none. The patient experienced headaches and body aches, injection site pain, on 29Dec2020 at 08:00 AM. The patient had Acetaminophen as the treatment for the events. The patient stated that no other vaccine in four weeks and no other medications in two weeks. No Covid prior vaccination and no Covid tested post vaccination. The outcome of the events was unknown.  Information about batch/lot number has been requested.','Sputnik'),('2021-12-15',52057635,1760860761,1467750497,'Woke up next day very fatigued, left work after 1/2 day and slept 20hrs  Two days after injection lymph nodes very sore and swollen in armpit (pain with applying deodorant)  Four days after injection bruising with about 3x3 cm area of redness/swelling present at injection site Daily headaches managed with ibuprofen   Not anything too concerning but not comfortable. I have never reacted to a vaccine prior','MODERNA'),('2021-12-16',50845136,1659514073,1760405245,'The day after I recieved the vaccine, my arm was red and swollen and hurt to the touch.  Around noon, I felt achy and had a headache.  At around 3 PM, I felt feverish and had a fever of 100.4.  I felt general malaise and achy all evening.  This morning, I still have a bit of a headache, but feel much better than yesterday.','Sputnik'),('2021-12-16',58587120,1730100165,1740261601,'Intense headache from temple across eyes to temple. Severe eye pain. Totally unlike my migraines. Lasted two days Also body aches. Lasted two days','MODERNA'),('2021-12-17',3560265,1801145149,1659321610,'Nausea and vomiting','BBIBP-CorV'),('2021-12-17',27418822,1962787366,1033124573,'Severe chills (heater turned to 80 F); no fever headache malaise widespread body aches nausea lightheadedness/dizziness  ongoing not alleviated by APAP or ibuprofen','MODERNA'),('2021-12-17',48678422,1801253158,1851652432,'Low grade fever, lethargy, sore arm','BBIBP-CorV'),('2021-12-18',962052,1437136546,1932254745,'12-24 hours after vaccination:  high fever 102+,  chills,  nausea, fatigue, headache, arm occasionally twitching near injection site,  very sore arm, irritability','BBIBP-CorV'),('2021-12-18',53084663,1720184203,1548239858,'10 minutes after the vaccine was administered, the patient started presenting a tingling sensation on her throat.  She was given diphenhydramine 50 mg IM.','Covaxin'),('2021-12-18',68505821,1871525527,1134599210,'DYSPNEA WITH HYPOXIA, WEAKNESS, LOSS OF APPETITIE, FATIGUE  Narrative: Per nephr note 1/25/21: got 1st covid vaccine on 1/21/21 and \'was doing okay afterwards until over the weekend. He\'s fallen 3 times, has run a low grade fever and his oxygen sat is down to 88%.\' Brought to ED, per ED MD note 1/25/21: after 1st covid vaccine dose, \'has had generalized weakness of all extremities w/ falls w/o injury; previously ambulated w/ walker but now unable to do so & using wheelchair; since vaccine has had decreased appetite and PO intake, fatigue